INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (18,'MentorE Online Youth Services','<p><span style=\"font-size: 11pt; line-height: 115%;\">MentorE Online Youth Services&rsquo; mission is to enable youth to take charge of their futures. Our program links at-risk youth to trained mentors virtually, where the pair can interact in a rich online community. E-mentoring builds relationships between mentees and their mentors through chatting, e-mail, gaming and project collaboration. MentorE will attract positive role models who might not have time to participate in a traditional face-to-face mentoring program, but can contribute their time over the internet. Our goal is provide mentors to youth who need them, want them, and might not find a traditional mentor elsewhere.<span style=\"mso-spacerun: yes;\">&nbsp; </span></span></p>','4026 N. Miller Rd. Suite 200','Scottsdale','Ar','85251','United States','Youth Services',NULL,'2019-11-09 07:54:42','0000-00-00 00:00:00',1);
