INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (107,'Wellspring House, Inc.','<p class=\"MsoSubtitle\" style=\"margin: 0in 0in 0pt; line-height: 200%;\"><span style=\"font-size: 10pt; line-height: 200%;\"><span style=\"font-family: Times New Roman;\">Wellspring is a community of faith, aware that each life touches every other life.<span style=\"mso-spacerun: yes;\">&nbsp; </span>Our work and our decisions are therefore guided by the vision of a just society, in which we must care for the earth and her people by using our resources, property and land in a spirit of hospitality.<span style=\"mso-spacerun: yes;\">&nbsp; </span></span></span></p>\r\n<p class=\"MsoSubtitle\" style=\"margin: 0in 0in 0pt; line-height: 200%;\"><span style=\"font-size: 10pt; line-height: 200%;\"><span style=\"font-family: Times New Roman;\">In this spirit we work to meet basic human needs and participate in social change through the provision of shelter, affordable housing local economic opportunity and education rooted in community needs.</span></span></p>','302 Essex Avenue','Gloucester','Ma','1930','United States','Homelessness, Housing, Job Training and Workplace Issues, Training','http://www.wellspringhouse.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
