INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (142,'The Ark Foundation','<p class=\"style1\" align=\"justify\">The Ark Foundation was founded in 2007 to bring about social and qualitative changes in the lives of underprivileged communities in the Southern African region. The aim is to contribute towards effective social transformation through the development of education. Our key objective is to provide qualitative educational opportunities to learners from underprivileged communities. Furthermore our secondary goal is to improve the standard of education and infrastructure in the Southern African region.</p>\r\n<p class=\"style1\" align=\"justify\">This organization is driven by the idea of the existence of a socially harmonious lifestyle for all people as well as an equal standard of education and infrastructure. The Ark Foundation believes that education is a vital resource in achieving economic and social development.</p>','272 Oak Avenue','Johannesburg','Ot','2197','South Africa','Economic Development, Education and Academia, Entrepreneurship','','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
