INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (248,'Prosperity International Network','<p><span style=\"font-size: 12pt; font-family: \'Times New Roman\';\"><span style=\"font-family: Times New Roman; font-size: medium;\"><span style=\"text-decoration: underline;\"><em><strong>Mission</strong></em></span></span></span><span style=\"font-size: 12pt; font-family: \'Times New Roman\';\"><br /> <br /> </span><span style=\"font-size: 12pt; color: black; font-family: \'Times New Roman\';\" lang=\"EN-GB\">The mission of </span><span style=\"font-size: 12pt; font-family: \'Times New Roman\';\">Pin Limited</span><span style=\"font-size: 12pt; color: black; font-family: \'Times New Roman\';\" lang=\"EN-GB\"> is to promote good health, education and skills training to empower the\r\nyouth, orphans and disadvantaged vulnerable communities.<br /> <br /> -To promote Capacity building for manpower development through formal\r\nand non formal education, skills equipping, training and talent\r\ndevelopment of her target groups and the community.</span><span style=\"font-size: 13.5pt; color: black; font-family: \'Times New Roman\';\"></span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 0pt;\"><span style=\"font-size: 12pt; color: black; font-family: \'Times New Roman\';\" lang=\"EN-GB\">-To\r\nenhance and encourage income generation projects and enterprise support\r\nto her target groups and members in the community for socio-economic\r\ndevelopment and sustainability.<br /> </span></p>','P.O.BOX 31103','kampala','Ha','256','Uganda','AIDS/HIV Services, Art, Children and Youth, Community Building and Renewal, Education and Academia','http://www.globalprosp.page.tl','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (252,'Journey to Solidarity','<p><span style=\"font-size: 13px; line-height: 17px;\"><span style=\"color: #333399;\">Journey to Solidarity is a talented and diverse team of individuals who share a passion for helping people and working together. There is a common goal to create better lives and social solidarity throughout the world without demanding money to those we serve or by being political. The project was originally started by a Chiropractor, Dr. Jay Breitlow, who has a vision to share the best and most natural form of healthcare with the world, while creating long lasting social ties to communities of need. Journey to Solidarity is a public 501(c)(3) non-profit corporation.</span></span></p>','301 Cottage Grove Ave. SE','Cedar Rapids','Io','52403','United States','Other Service Organization','http://www.journeytosolidarity.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
