INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (268,'Grace Church Community Center, Inc.','<h3 class=\"header2\" style=\"margin-top: 0pt;\"><span style=\"font-family: arial; font-size: xx-small;\">Grace Church Community Center (GCCC) is a non-sectarian, community-based 501(c) (3)\r\norganization whose <strong><em>mission is to assist Westchester \r\n                      County&rsquo;s neediest and most at-risk residents, especially \r\n                      those who are under-served by other resources. </em></strong></span></h3>\r\n<h3 class=\"header2\"><span style=\"font-family: arial; font-size: xx-small;\">GCCC is one of the largest social services agencies\r\nin Westchester County and has been providing shelter and support for\r\nindividuals and families for over 27 years.&nbsp;</span></h3>','35 Orchard Street - Second Floor','White Plains','Ne','10603','United States','Community Building and Renewal, Housing, Multi-Service Community Agency, Other Service Organization, Social Services','','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
