INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (330,'St. Teresa Acupuncture Wellness Clinic','St. Teresa Acupuncture Wellness Clinic is a nonprofit low cost acupuncture clinic organized for the purpose of providing quality alternative healthcare to the public that is safe & natural, effective, and affordable for all people and all different income levels. Our clinic is operated and supported by voluntary donations only. At St. Teresa, treatments are provided equally to all patients and no person will be denied service due to one\'s inability to donate or pay.\r\n \r\nSt. Teresa was founded in 2009 as a grassroots response to the rising costs of healthcare, the unstable economy that undermines so many people\'s livelihood, and the noncoverage of acupuncture in healthcare plans. Government\'s medicare, medicaid, and most insurance plans currently do not cover acupuncture. Chinese medicine treatment is an out-of-pocket expense for the majority of people. Acupuncture is no longer an optional health service but a necessity. With the growing number of Americans now relying more and more on Chinese medicine as primary or complementary healthcare, our current economic challenges are not filling this need for so many people.\r\n \r\nOur organization is nonprofit, nondenominational, and nonpolitical. We simply recognized a real basic need for a workable system of healthcare for everyone. As a result, our vision of a compassionate and equitable healthcare service was conceived to support the needs of all people from all socioeconomic strata and from all walks of life.\r\n','1920 Hollister Road','Houston','Te','77080','United States','Health and Medicine','','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (356,'Good People Helping Others','<p><span style=\"font-family: Helvetica,Arial,sans-serif; color: #000000;\">Our mission here at Good People Helping Others,Inc.is </span><span style=\"font-family: Tahoma,Arial,Helvetica,sans-serif; color: #000000;\">to provide services to</span><span style=\"font-family: Tahoma,Arial,Helvetica,sans-serif; color: #000000;\"><br /></span><span style=\"font-family: Tahoma,Arial,Helvetica,sans-serif; color: #000000;\">low-income persons in order to help them obtain and/or maintain self-sufficiency </span><span style=\"font-family: Tahoma,Arial,Helvetica,sans-serif; color: #000000;\"><br /></span><span style=\"font-family: Tahoma,Arial,Helvetica,sans-serif; color: #000000;\">and prevent homelessness.</span><span style=\"font-family: Tahoma,Arial,Helvetica,sans-serif; color: #000000;\"><br /></span></p>','4591 Cote Brilliante','Saint Louis','Mi','63113','United States','Community Service and Volunteering','','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
