INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (361,'The Fallen Soldiers Organization Inc','<p><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 12pt; font-family: Arial;\">We are a non-profit organization dedicated to helping soldiers&rsquo; transition from military to civilian life.<span style=\"mso-spacerun: yes;\">&nbsp; </span>We provide support, encouragement, and hope by treating each soldier like family.</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-right: -4.2pt; mso-pagination: widow-orphan lines-together;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 12pt; font-family: Arial;\"><span style=\"color: #000000;\">&nbsp;</span></span></strong><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 12pt; font-family: Arial;\"><span style=\"color: #000000;\">Our mission is to assist soldiers and their families. We work with soldiers returning home from duty overseas by connecting them with community resources. We help soldier&rsquo;s re-enter civilian life by providing assistance in finding employment and housing.</span></span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-right: -4.2pt; mso-pagination: widow-orphan lines-together;\"><span style=\"font-size: 12pt; font-family: Symbol;\"><span style=\"mso-list: Ignore;\">O</span></span><span style=\"font-size: 12pt; font-family: Arial;\">ur vision is that every soldier returning from active military duty will be provided with the opportunity to live a normal life</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top: 0in; margin-right: -4.2pt; margin-bottom: .0001pt; margin-left: 0in; mso-add-space: auto; mso-pagination: widow-orphan lines-together;\">&nbsp;</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top: 0in; margin-right: -4.2pt; margin-bottom: .0001pt; margin-left: 0in; mso-add-space: auto; mso-pagination: widow-orphan lines-together;\"><span style=\"font-family: Arial; font-size: 16px;\">Every soldier will receive the care and respect that they deserve</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-right: -4.2pt; mso-pagination: widow-orphan lines-together;\"><span style=\"font-family: Arial; font-size: 16px;\">Every soldier being discharged from the military will be given proper support services to ensure a smooth transition</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top: 0in; margin-right: -4.2pt; margin-bottom: .0001pt; margin-left: 0in; mso-add-space: auto; mso-pagination: widow-orphan lines-together;\"><span style=\"font-family: Arial; font-size: 16px;\">Every military family will have the support necessary to provide for themselves</span></p>\r\n<p><!--EndFragment--></p>\r\n<p>&nbsp;</p>','152 South 2nd St','Lindenhurst','Ne','11757','United States','Veterans Issues','','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (362,'Lifebread Inc. ','<p><!--StartFragment--></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 14.0pt;\"><span lang=\"RU\">Lifebread is\r\ndedicated to empowering the people of impoverished nations through nutritional\r\neducation and food preparation training as a means to curb the severity of\r\nworld hunger. This is accomplished by building ovens and training the residents\r\nof the area how to bake. An emphasis on sanitation and small business\r\nmanagement is also included. Different locations require unique food relief\r\nprograms, which are evaluated on a case by case situation. Through these\r\nprograms, Lifebread is committed to fighting hunger in an attempt to better\r\nshare the true bread of life, Jesus Christ.&nbsp;</span></p>\r\n<p><!--EndFragment--></p>\r\n<p>&nbsp;</p>','568 N. Jackson Street','Andrews','In','46702','','Community Building and Renewal, Community Service and Volunteering, Economic Development, Entrepreneurship, Faith-Based, Poverty and Hunger','','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
