INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (444,'Handbags of Hope','<p>Handbags of Hope believes a well equipped handbag if a necessary tool in most womens lives. We show women how to turn their gently used purses into a handbag of hope. Our handbags are delivered across the State to women and teens in shelter situations.</p>','15580 glander','Eastpointe','Mi','48021','United States','Domestic Violence Support Services','http://www.handbagsofhope.webs.com','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (460,'North Carolina Coalition for a Moratorium','<p>&nbsp;</p>\r\n<p style=\"margin: 0.0px 0.0px 0.0px 0.0px; font: 12.0px Cambria;\">The North Carolina Coalition for a Moratorium is a partnership of organizations and individuals across</p>\r\n<p style=\"margin: 0.0px 0.0px 0.0px 0.0px; font: 12.0px Cambria;\">the state that supports reforms to our capital punishment system. Innocent people have been sentenced&nbsp;to death in North Carolina. Until substantial reforms are enacted and implemented, we will continue to&nbsp;run the risk of wrongfully convicting and executing innocent people. The current suspension of&nbsp;executions should be sustained until we eliminate the risk of wrongful convictions and executions.</p>\r\n<p>&nbsp;</p>','201 W. Main St. , Suite 301','Durham','No','27701','United States','Crime, Safety, and Victims Issues','http://www.ncmoratorium.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
