INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (565,'Tinkuy Peru','<p style=\"padding-left: 30px; text-align: justify;\"><span style=\"font-family: helvetica; color: #000080; font-size: small;\">Tinkuy Peru is a not for profit organisation established in 2003 to tackle poverty and social immobility in the rural regions of Huancayo, Peru. Since the birth of the organisation, we have been striving to promote growth and development among underprivileged children in the rural regions of Huancayo. Our main project is The Mountain School where we focus on the instruction of English, but nonetheless also teach the children Crafts, Mathematics, Geography and Health issues to expand their perspective and, thereby, break the vicious cycle that is poverty.</span></p>','La Florida 280, Cuadra 9 de Giraldez.','Huancayo','Ot','7','Peru','Child Care, Children and Youth, Communications, Community Organizing / Advocacy, Community Service and Volunteering, Education and Academia, English Language Learners (ELL), Poverty and Hunger, Rural Issues, Youth Services','http://www.tinkuyperu.com','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
