INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (597,'Spreadkindness.org','<p><span style=\"color: #000000;\"><span style=\"font-size: x-small;\"><strong><span style=\"color: #0000ff;\">SpreadKindness.org</span></strong> is a global project with a simple goal. Our purpose is to inspire others to be kind, compassionate and loving to one another at home, at work, and in every interaction throughout the day. <br /><br />This group is for people who believe in random acts of kindness in everyday life. If we can get more people doing this then the world will become a happier place where peace and joy happen.<br /><br /><span style=\"color: #0000ff;\"><strong>SpreadKindness.org</strong></span> is a non-profit organization dedicated to encouraging individuals and groups to practice kindness in their everyday life. Our mission is to inspire, enlighten, and spread joy through the sincere kindness of our hearts and actions. For more information about our organization, please go to <a href=\"http://www.spreadkindness.org/\"><span style=\"color: #ee6600;\">www.spreadkindness.org</span></a>.&nbsp; You can also find us on facebook and meetup.&nbsp; <a href=\"http://www.facebook.com/SpreadKindness.org\"><span style=\"color: #ee6600;\">www.facebook.com/SpreadKindness.org</span></a></span></span></p>\r\n<p><span style=\"color: #000000;\"><a href=\"http://www.meetup.com/SpreadKindness/\"><span style=\"color: #ee6600; font-size: x-small;\">http://www.meetup.com/SpreadKindness/</span></a></span></p>\r\n<p><span style=\"color: #000000;\"><span style=\"font-size: x-small;\">It all starts with you. You have the power to impact someone right now in a positive, kind way. Share a smile. Be kind. Pass it on.</span></span></p>','21001 San Ramon Valley Blvd., UPS Box # A4-121','San Ramon','Ca','94583','United States','Community Building and Renewal, Community Service and Volunteering, Network of Nonprofit Organizations','http://www.spreadkindness.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
