INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (607,'SHALEM MINISTRIES','<p><span style=\"font-family: Arial; font-size: 9pt; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">The Shalem Ministries is a non-profitable organization which is registered under the Registration of Societies Act 35 of 2001 bearing the registration number 799 of 2008 which is located in the town of Neraducherla village in the district of Nalagonda in Andhra Pradesh in South India. <br /><br />Andhra Pradesh is the second largest state in India in respect to area and population. Majority of the population is illiterate and are below the poverty line. Our main aim and objective is to work among communities who are downtrodden, neglected, and oppressed people in the society. <br /><br />We are concerned about holistic approach in dealing and building up of people and the communities. I am involved in the activities for Children, Women and Youths who play an important role in the society. <br /><br />Our main goal is to educate, to equip, and to enrich wisdom and knowledge, to enrich to lead a peaceful life which is the art of living. I am involved in counseling the addicts, the depressed, broken families.<br /><br />Our aim is to go to the grassroot level of the people and the community and to eradicate the cause of lack, poverty and bring awareness. By adopting these methods we can build and educate the people and transform the society. Our goal is to reach the unreached and neglected communities like Dalits, Scheduled Caste and Scheduled Tribes who are under the bondage of rich people. <br /><br />Given below are the aims and objectives of our organization:<br />To maintain old women &amp; child welfare and educational activities of various types.<br />To maintain a Primary Health Care Centre. <br />To maintain hostels for the benefit of the economically poor students, especially those who came from rural areas for the purpose of continuing their studies. <br />To undertake any project to eradicate illiteracy.<br />To co-operate with the Government in all its educational programmes.<br />To provide computer education to the people in rural and urban areas.<br />Proclaim the good news through Video Projector for illiteracy programmes.<br />Conducting GOOD NEWS FESTIVAL in the rural and urban areas. <br />To work among RAG PICKERS.<br />To work among SLUM PEOPLE.<br />To work among STREET CHILDREN.<br /><br />We presently are looking for your support and assistance by partnering with our organization in any of the above mentioned activities. We kindly request you to assist us and kindly oblige with us. Hoping to receive a positive reply from your end at the earliest. <br style=\"mso-special-character: line-break;\" /><br style=\"mso-special-character: line-break;\" /></span></p>','N.S.P.Camp, John Pahad Road,Neredcherla Mandal & Post','Nalagonda Dt Andhra Pradesh','Fe','508218','India','Child Care, Children and Youth','','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
