INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (615,'Life Skills Training & Educational Programs','<p>&nbsp;</p>\r\n<p><span style=\"font-size: small;\"> </span></p>\r\n<p><span style=\"font-family: arial; font-size: small;\"> </span></p>\r\n<p><span style=\"font-size: small;\"> </span></p>\r\n<p><span style=\"font-weight: 400;\"><em><span style=\"font-family: arial; font-size: small;\">The mission of LifeSTEPS is to provide effective &nbsp;educational and supportive services to maximize the strengths of individuals and build resilient communities.</span></em></span></p>\r\n<p><span style=\"font-size: small;\"> </span></p>\r\n<p><span style=\"font-family: arial; font-size: small;\"> </span></p>\r\n<p><span style=\"font-size: small;\"> </span></p>\r\n<h2><span style=\"font-weight: 400;\"><strong><span style=\"font-family: arial; font-size: small;\">LifeSTEPS\' Guiding Principles&nbsp;(Our Vision)</span></strong></span></h2>\r\n<p><span style=\"font-size: small;\"> </span></p>\r\n<p><span style=\"font-family: arial; font-size: small;\"> </span></p>\r\n<p><span style=\"font-size: small;\"> </span></p>\r\n<p><span style=\"font-weight: 400;\"><span style=\"font-family: arial;\"><span style=\"font-size: small;\"><strong>LifeSTEPS is committed</strong> to taking care of our team and supporting each other to stay healthy. </span></span></span></p>\r\n<p><span style=\"font-size: small;\"> </span></p>\r\n<p><span style=\"font-family: arial; font-size: small;\"> </span></p>\r\n<p><span style=\"font-size: small;\"> </span></p>\r\n<p><span style=\"font-weight: 400;\"><span style=\"font-family: arial;\"><span style=\"font-size: small;\"><strong>LifeSTEPS encourages</strong> staff to participate in helping LifeSTEPS evolve in such a way that our impact is meaningful to not just one or two clients, but to thousands.</span></span></span></p>\r\n<p><span style=\"font-size: small;\"> </span></p>\r\n<p><span style=\"font-family: arial; font-size: small;\"> </span></p>\r\n<p><span style=\"font-size: small;\"> </span></p>\r\n<p><span style=\"font-weight: 400;\"><span style=\"font-family: arial;\"><span style=\"font-size: small;\"><strong>LifeSTEPS challenges</strong> themselves and the team to be moved and inspired on a daily basis to do the very best for everyone we serve. </span></span></span></p>\r\n<p><span style=\"font-size: small;\"> </span></p>\r\n<p><span style=\"font-family: arial; font-size: small;\"> </span></p>\r\n<p><span style=\"font-size: small;\"> </span></p>\r\n<p><span style=\"font-weight: 400;\"><span style=\"font-family: arial;\"><span style=\"font-size: small;\"><strong>LifeSTEPS recognizes</strong> that in and of ourselves we are not significant, but what we do together and the lives we help to change, is the legacy by which we are impassioned. </span></span></span></p>\r\n<p><span style=\"font-size: small;\"> </span></p>\r\n<p><span style=\"font-family: arial; font-size: small;\"> </span></p>\r\n<p><span style=\"font-size: small;\"> </span></p>\r\n<p><span style=\"font-weight: 400;\"><span style=\"font-family: arial;\"><span style=\"font-size: small;\"><strong>LifeSTEPS will continue</strong> to spend monies responsibly and ensure that we do not spend monies we do not have. &nbsp;The goal is that the legacy of LifeSTEPS will thrive for generations to come and, in some small way, we will have each contributed to something on a much grander level than we ever thought possible. </span></span></span></p>\r\n<p><span style=\"font-size: small;\"> </span></p>\r\n<p><span style=\"font-family: arial; font-size: small;\"> </span></p>\r\n<p><span style=\"font-size: small;\"> </span></p>\r\n<p><span style=\"font-weight: 400;\"><span style=\"font-family: arial; font-size: small;\">The name LifeSTEPS represents all of us. &nbsp;We are in this together and we recognize that our actions and words in regard to this agency are a reflection of our work, our mission, and our team. </span></span></p>\r\n<p><span style=\"font-size: small;\"> </span></p>\r\n<p><span style=\"font-family: arial; font-size: small;\"> </span></p>\r\n<p><span style=\"font-size: small;\"> </span></p>\r\n<h2><span style=\"font-weight: 400;\"><strong><span style=\"font-family: arial; font-size: small;\">Our Values</span></strong></span></h2>\r\n<p><span style=\"font-size: small;\"> </span></p>\r\n<p><span style=\"font-family: arial; font-size: small;\"> </span></p>\r\n<p><span style=\"font-size: small;\"> </span></p>\r\n<p><span style=\"font-weight: 400;\"><span style=\"font-family: arial;\"><span style=\"font-size: small;\"><strong>INTEGRITY:</strong> &nbsp;We demonstrate integrity in all of our dealings as we believe that integrity is the cornerstone of all positive and productive relationships.</span></span></span></p>\r\n<p><span style=\"font-size: small;\"> </span></p>\r\n<p><span style=\"font-family: arial; font-size: small;\"> </span></p>\r\n<p><span style=\"font-size: small;\"> </span></p>\r\n<p><span style=\"font-weight: 400;\"><span style=\"font-family: arial;\"><span style=\"font-size: small;\"><strong>INNOVATION:</strong> &nbsp;We strive to be innovative by delivering services that are &nbsp;intuitive and responsive to the needs of our clients, partners and employees.</span></span></span></p>\r\n<p><span style=\"font-size: small;\"> </span></p>\r\n<p><span style=\"font-family: arial; font-size: small;\"> </span></p>\r\n<p><span style=\"font-size: small;\"> </span></p>\r\n<p><span style=\"font-weight: 400;\"><span style=\"font-family: arial;\"><span style=\"font-size: small;\"><strong>EMPOWERMENT:</strong> &nbsp;We believe in an empowerment approach that encourages individual abilities. &nbsp;We support this by ensuring that everyone has adequate tools, skills, input, opportunities and knowledge to be successful.</span></span></span></p>\r\n<p><span style=\"font-size: small;\"> </span></p>\r\n<p><span style=\"font-family: arial; font-size: small;\"> </span></p>\r\n<p><span style=\"font-size: small;\"> </span></p>\r\n<p><span style=\"font-weight: 400;\"><span style=\"font-family: arial;\"><span style=\"font-size: small;\"><strong>RESPECT:</strong> &nbsp;We are committed to an atmosphere of respect. &nbsp;We honor this by embracing the diversity of our staff, clients and partners; recognizing that our success as an agency is based on the talent, skills and expertise of our team.</span></span></span></p>\r\n<p><span style=\"font-size: small;\"> </span></p>\r\n<p><span style=\"font-family: arial; font-size: small;\"> </span></p>\r\n<p><span style=\"font-size: small;\"> </span></p>\r\n<p><span style=\"font-weight: 400;\"><span style=\"font-family: arial;\"><span style=\"font-size: small;\"><strong>PERSONAL GROWTH:</strong> &nbsp;We value personal growth and know that it is vital to the long term success of our agency and those we serve.</span></span></span></p>\r\n<p>&nbsp;</p>','3247 Ramos Circle','Sacramento','Ca','95827','United States','Social Services','http://www.lifestepsusa.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
