INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (838,'ReVamp Ministries','<div style=\"text-align: center;\">\r\n<p style=\"text-align: center;\"><span style=\"font-family: Georgia, serif; font-size: 14px;\">ReVamp Ministries strives to transform, empower, and uplift the spiritual and physical lives of youth and young adults, to build civic leadership and stronger communities.&nbsp;With growth, we will be able to accomplish more, and have a larger impact upon our community.&nbsp;Lead by God, our ministry is positioned to be one that has touched and blessed millions of lives. We welcome you with open arms. Please inquire below so you can become a part of our growing ministry.<br /></span><br /><span style=\"font-family: Georgia, serif;\"><strong>Mission<br /></strong></span><span style=\"font-size: 16px;\"><span style=\"font-family: Georgia, serif; font-size: 14px;\">ReVamp Ministries\' Mission is to Transform, Empower, and Uplift the Spiritual and Physical Lives of Youth and Young Adults, to build Civic Leadership and Stronger Communities.</span></span></p>\r\n</div>\r\n<div style=\"text-align: center;\"><span style=\"font-family: Georgia, serif;\">&nbsp;</span></div>\r\n<div style=\"text-align: center;\"><span style=\"font-family: Georgia, serif;\">&nbsp;</span></div>\r\n<div style=\"text-align: center;\"><strong><span style=\"font-size: 16px;\"><em><span style=\"font-size: 20px;\"><span style=\"font-size: 22px;\"><span style=\"font-size: 20px;\">Vision</span></span></span></em></span></strong></div>\r\n<div style=\"text-align: center;\"><span style=\"font-size: 20px;\"><span style=\"font-size: 18px;\"><span style=\"font-family: Georgia, serif; font-size: 14px;\"><span>ReVamp Ministries\' Vision is Youth and Young Adults working together to identify their destiny; implementing the process of reaching their destiny; and investing in one another\'s ability to reach their destiny.</span><br /></span></span></span></div>','1688 Gathering Lane','Manteca','Ca','95337','United States','Baptist Organization, Catholic Organization, Children and Youth, Community Organizing / Advocacy, Community Service and Volunteering, Cultural Affairs, Entrepreneurship, Faith-Based, Family and Parenting, Fathers, Gang Prevention and Intervention, Homelessness, Media and Journalism, Mens Issues, Methodist Organization, Network of Nonprofit Organizations, Other Religious Organization, Other Service Organization, Poverty and Hunger, Service Organization, Urban Affairs, Youth Services','','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
