INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (855,'NABA, Inc','<table class=\"MsoNormalTable\" style=\"width: 100%; mso-cellspacing: 0in; mso-yfti-tbllook: 1184; mso-padding-alt: 3.75pt 3.75pt 3.75pt 3.75pt;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"100%\">\r\n<tbody>\r\n<tr style=\"mso-yfti-irow: 0; mso-yfti-firstrow: yes; mso-yfti-lastrow: yes;\">\r\n<td style=\"background-color: transparent; border: #ebe9ed; padding: 3.75pt;\" valign=\"top\">\r\n<p style=\"text-align: justify; margin: 0in 0in 0pt;\"><span style=\"font-family: &quot;Trebuchet MS&quot;,&quot;sans-serif&quot;; color: black; font-size: 8pt;\">NABA, Inc. is the premier association for today\'s accounting, finance, and business professionals. NABA represents the interests of African-Americans and other professionals of color. The mission of NABA, Inc. is to address the professional needs of its members and to build leaders that shape the future of the accounting, finance, information technology, and business professions with an unfaltering commitment to inspire the same in their successors.&nbsp; NABA\'s overall objective is to create business leaders.&nbsp; Focusing on the essential skills for success, we offer unique value-added leadership training and professional development opportunities as well as venues for organizations and individuals to build new business.</span></p>\r\n<p style=\"text-align: justify; margin: 0in 0in 0pt;\"><span style=\"font-family: &quot;Trebuchet MS&quot;,&quot;sans-serif&quot;; color: black; font-size: 8pt;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify; margin: 0in 0in 0pt;\"><span style=\"font-family: &quot;Trebuchet MS&quot;,&quot;sans-serif&quot;; color: black; font-size: 8pt;\">Established in 1969 by nine African American accountants in New York City, the organization currently boasts more than 200 professional and student chapters across the country and partners with like-minded organizations nationally and internationally. For additional information about NABA, Inc. call (301) 474-6222, visit <a href=\"http://r20.rs6.net/tn.jsp?llr=x9m7t4cab&amp;et=1108195629415&amp;s=1725&amp;e=0019E-gh20c6YkczhaNwGTISPoRYkmi5aM8pZBvzf5Qy3aLttFsj_HmqvcujJqP_yeD8NSglUbtaKikOWBb3ePMxid6qxHRx1Y73zO8z90akOA=\" target=\"_blank\">http://www.NABAInc.org</a> or email <a href=\"mailto:communications@NABAInc.org\">communications@NABAInc.org</a>. Follow NABA\'s social networks:&nbsp;<a href=\"http://r20.rs6.net/tn.jsp?llr=x9m7t4cab&amp;et=1108195629415&amp;s=1725&amp;e=0019E-gh20c6YnUuupwzZJAxCenPfGGyb6x5InQTIfYECGTni9wSAwx7SpFRwFvgD-XcshgXFE1TIVGYwFZSLLc2k_fMWqA6B8vQvVuQ1n2njvLNmM2RmEu8yJIy0FvWSX_NHN5sRtNHGkhLyFhO8hzEZpBWglwpLEy\" target=\"_blank\">Facebook</a> | <a href=\"http://r20.rs6.net/tn.jsp?llr=x9m7t4cab&amp;et=1108195629415&amp;s=1725&amp;e=0019E-gh20c6YkgtVHlNGjQ9Bs0j7P_32wwin5naHENDms68zWkzm6jUn-1kZLsZ24u6lt2TDGbJ4L_346zR197oirAyxlKOr0LVsSFlZ9_xhFTwAc0684Lyg==\" target=\"_blank\">Twitter</a> | <a href=\"http://r20.rs6.net/tn.jsp?llr=x9m7t4cab&amp;et=1108195629415&amp;s=1725&amp;e=0019E-gh20c6Yl_w-MuA3rmFghruP9L7Y2mUPPWWgcREc3Hd0GZyf2x8h2iTVZW8RIUBtl1gDvQ6BJG7Fj2BHNcYp45cFLFpliyE7oVnrca0iVT35BVUkQfRZHPdlLL_1f2ftRxz90EA7Q=\" target=\"_blank\">LinkedIn</a> | <a href=\"http://r20.rs6.net/tn.jsp?llr=x9m7t4cab&amp;et=1108195629415&amp;s=1725&amp;e=0019E-gh20c6YltLmewMwuyXUGU1g41PtsgnnjzXGEEMotcp6V5dlivkxTURqaDQzSLfBaYU5_qnQRA8ar4NAnshYyWKobVSRS2pYeCtmW0Y0K2ki6-mn-wOk2DG_HF7Tcz\" target=\"_blank\">YouTube</a>&nbsp;</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>','7474 Greenway Center Drive','Greenbelt ','Ma','20770','United States','Professional Association','http://www.nabainc.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (879,'Drive Aid Ghana','<p><span style=\"font-family: helvetica; font-size: large;\">Drive Aid Ghana is a (501) c3 Non profit organization located in Damongo, our prime focus is to empower rural poor communities through sustainable projects, team work with other NGO\'s/NPO\'s along side volunteer services</span></p>\r\n<p><span style=\"font-family: helvetica; font-size: large;\">follow us:</span></p>\r\n<p><span style=\"font-family: helvetica; font-size: large;\">http://www.facebook.com/driveaidghana</span></p>\r\n<p><span style=\"font-family: helvetica; font-size: large;\">http://www.twitter.com/driveaidghana</span></p>\r\n<p><span style=\"font-family: helvetica; font-size: large;\">or go to our home page</span></p>\r\n<p><span style=\"font-family: helvetica; font-size: large;\">www.driveaidghana.org</span></p>\r\n<p><span style=\"font-family: helvetica; font-size: large;\">our blog:</span></p>\r\n<p><span style=\"font-family: helvetica; font-size: large;\">www.driveeaidghana.blogspot.com<br /></span></p>','Drive Aid Ghana, Box 516','Tamale','Ot','233','Ghana','Children and Youth, Community Organizing / Advocacy, Community Service and Volunteering, Education and Academia, English Language Learners (ELL), Farming and Agriculture, Foundations, Fundraising, and Philanthropy, Homelessness, Network of Nonprofit Organizations, Rural Issues, Teaching, Training, Youth Services','http://www.driveaidghana.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (880,'Drive Aid Ghana','<p>Drive Aid Ghana is a registered 501 (c)3 Non Profit Organization (Reg. \r\nNo. G34, 700), located in Damongo in the Northern region of Ghana.<br /> our prime MISSION is to Empower rural poor communities through sustainable projects,: \r\nagriculture, Health, Education and environmental  promotion/provision, \r\nespecially through the growth, use and advocacy of the Moringa plant for\r\n poverty reduction, we also engange in artemisia production for malaria control.<br /> Drive Aid Ghana partners with severa<span class=\"text_exposed_show\">l\r\n development partners in each of our target communities to bring about \r\nthe above mentioned mission, among this organization include, World \r\nVision- Damongo, SARI Ghana, New Life School Damongo, Redemption \r\nChildren\'s home and many development oriented organizations in the \r\nnorthern sector of Ghana.<br /> our prime focus is development through partnership and team work, as well as volunteer services.<br /> Drive Aid Ghana hosts volunteers and visitors who wants to have a \r\npersonal experience through our partners as well as give them a hands on \r\nexercise with our projects<br /> you are welcome to join the family!<br /> </span></p>','Drive Aid Ghana, Box 516','Tamale','Ot','233','Ghana','Children and Youth, Community Building and Renewal, Community Organizing / Advocacy, Community Service and Volunteering, Farming and Agriculture, Homelessness','http://www.driveaidghana.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
