INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (1022,'Angels with Paws','<p>\r\n<p>Angels with Paws, 501c3 Public Charity, operates a Limited Intake, mostly cage-free shelter for homeless, abused, and unwanted domestic cats. &nbsp;Providing them with compassion, food, Veterinary and other care, we give them a chance at life and a place to live until we can find homes for them. &nbsp;We require that the animal be returned to us if adopter cannot keep it for any reason. &nbsp;We also serve the greater Metro area and community by educating the public on the importance of spay/neuter pet population control, responsible pet ownership and the cruelty of declawing. &nbsp; &nbsp;We believe that all animals have the right to life. &nbsp; &nbsp;</p>\r\n<p>Angels with Paws is funded by private donations.</p>\r\n</p>','2540 Youngfield St.','Lakewood','Co','80215','United States','Animal Welfare','http://www.angelswithpaws.net','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
