INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (1077,'National Immigration Law Center','<p style=\"margin: 0px 0px 1.71429rem; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; hyphens: manual; word-wrap: normal; line-height: 1.71429; color: #444444; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif;\">Established in 1979, the National Immigration Law Center (NILC) is one of the leading organizations in the U.S. exclusively dedicated to&nbsp;defending and advancing the rights of immigrants with low income.</p>\r\n<p style=\"margin: 0px 0px 1.71429rem; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; hyphens: manual; word-wrap: normal; line-height: 1.71429; color: #444444; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif;\">At NILC, we believe that all people who live in the U.S. should have the opportunity to achieve their full potential. Over the years, we&rsquo;ve been at the forefront of many of the country&rsquo;s greatest challenges when it comes to immigration issues, and we play a major leadership role in addressing the real-life impact of policies that affect the ability of low-income immigrants to prosper and thrive.</p>','3450 Wilshire Blvd. #108 – 62','Los Angeles','Ca','90010','United States','Human Rights and Civil Liberties, Immigration','http://www.nilc.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
