INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (1115,'A New Leaf (Formerly Prehab of Arizona)','<p><span style=\"color: #000000;\"><font color=\"#000000\">\r\n<p>A New Leaf began as a result of community efforts to address the escalating drug problems in public schools. In 1971, Dorothy B. Mitchell and Larry Simmons formulated a service organization based on the PREvention and reHABilitation of troubled youth. PREHAB of Mesa, was established as a nonprofit 501(c)3 in April, later changing its name to A New Leaf. <br /></p>\r\n</font></span>\r\n<p><span style=\"color: #000000;\">A New leaf has been <em>helping families ...changing lives</em> for nearly 40 years with over 25 programs Valley wide including homeless and domestic violence shelters, youth and community programs.</span></p>\r\n</p>\r\n<p><span style=\"color: #000000;\">With more than 300 employees, a financially supportive Foundation and the benefit of over 15,000 volunteer hours a year, A New Leaf provides services to nearly 20,000 individuals annually</span></p>','868 E. University Dr','Mesa','Ar','85203','United States','Multi-Service Community Agency','http://www.turnanewleaf.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (1142,'INTERNATIONAL MEDICAL COPRS','<p>International Medical Corps is a global, humanitarian, nonprofit organization dedicated to saving lives and relieving suffering through health care training and relief and development programs.</p>\r\n<p>Established in 1984 by volunteer doctors and nurses, International Medical Corps is a private, voluntary, nonpolitical, nonsectarian organization. Its mission is to improve the quality of life through health interventions and related activities that build local capacity in underserved communities worldwide. By offering training and health care to local populations and medical assistance to people at highest risk, and with the flexibility to respond rapidly to emergency situations, International Medical Corps rehabilitates devastated health care systems and helps bring them back to self-reliance.</p>\r\n<p></p>','1313 l. ST.  SSuite 220','Washigton','Di','20005','United States','Disaster Relief, International Relief Organization','http://careers.internationalmedicalcorps.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
