INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (1161,'Hunger Nor Thirst, Inc.','<p><span style=\"line-height: 200%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 11pt; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">The mission of Hunger Nor Thirst, Inc. is to combat hunger and provide food to the disadvantage that has been impacted by financial situations as a result of; disability, health, homelessness, disaster, rising cost of living, and unemployment. Our organization will gather, store, and distribute nutritious food items to those in need. </span></p>','3201-3 Forestbrook Dr.','Charlotte','No','28208','','Poverty and Hunger','','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
