INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (1210,'Colorado Juvenile Defender Coaltion','<p>\r\n<p style=\"margin-top: 0in; margin-right: 0in; margin-bottom: 15.0pt; margin-left: 0in; background: white;\"><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;\">The\r\nColorado Juvenile Defender Coalition (&ldquo;CJDC&rdquo;)&nbsp;is a recognized 501(c) (3)\r\nnon-profit organization dedicated&nbsp;to excellence in juvenile defense and\r\nadvocacy, and justice for all children and youth&nbsp;in Colorado.</span></p>\r\n<p style=\"margin-top: 0in; margin-right: 0in; margin-bottom: 15.0pt; margin-left: 0in; background: white;\"><strong><span style=\"text-decoration: underline;\"><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;\">CJDC Core Projects</span></span></strong><strong><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;\">:</span></strong></p>\r\n<p style=\"margin-top: 0in; margin-right: 0in; margin-bottom: 15.0pt; margin-left: 0in; text-align: center; background: white;\" align=\"center\"><strong><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;\">JUVENILE DEFENDER\r\nCENTER</span></strong></p>\r\n<p style=\"margin-top: 0in; margin-right: 0in; margin-bottom: 15.0pt; margin-left: 0in; background: white;\"><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;\">The&nbsp;<strong>Colorado Juvenile\r\nDefender&nbsp;Coalition</strong>&nbsp;seeks to ensure the guarantee of\r\nthe 6th Amendment right to effective assistance of counsel for all children\r\naccused of behavior that would be a crime if committed by an adult.</span></p>\r\n<p style=\"margin-top: 0in; margin-right: 0in; margin-bottom: 15.0pt; margin-left: 0in; background: white;\"><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;\">CJDC\r\nprovides high quality&nbsp;continuing<span>&nbsp;</span></span><a title=\"Legal Education\" href=\"http://cjdc.org/wp/training-and-education/\"><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;; color: windowtext; text-decoration: none; text-underline: none;\">legal education</span></a><span><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;\">&nbsp;</span></span><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;\">seminars and\r\nprovides expansive information and resources for juvenile defense attorneys.</span></p>\r\n<p style=\"margin-top: 0in; margin-right: 0in; margin-bottom: 15.0pt; margin-left: 0in; background: white;\"><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;\">CJDC\r\nsupports the mission and work of the<span>&nbsp;</span></span><a href=\"http://www.njdc.info/\"><strong><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;; color: windowtext;\">National Juvenile Defender Center</span></strong></a><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;\">, which is\r\ncurrently conducting an<span>&nbsp;</span></span><a href=\"http://www.njdc.info/assessments.php\"><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;; color: windowtext; text-decoration: none; text-underline: none;\">assessment</span></a><span><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;\">&nbsp;</span></span><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;\">of Colorado&rsquo;s\r\njuvenile indigent defense delivery system.</span></p>\r\n<p style=\"margin-top: 0in; margin-right: 0in; margin-bottom: 15.0pt; margin-left: 0in; text-align: center; background: white;\" align=\"center\"><strong><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;\">JUVENILE POLICY\r\nCENTER</span></strong></p>\r\n<p style=\"margin-top: 0in; margin-right: 0in; margin-bottom: 15.0pt; margin-left: 0in; background: white;\"><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;\">CJDC\r\nengages in legislative reform efforts thought non-partisan advocacy, community\r\norganizing, and coalition building to ensure justice and fairness for all\r\nchildren and youth.</span></p>\r\n<p style=\"margin-top: 0in; margin-right: 0in; margin-bottom: 15.0pt; margin-left: 0in; background: white;\"><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;\">The<span>&nbsp;</span><strong>Colorado\r\nJuvenile Defender&nbsp;Coalition</strong>&nbsp;is a member of the<span>&nbsp;</span></span><a href=\"http://www.njjn.org/\"><strong><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;; color: windowtext;\">National\r\nJuvenile Justice Network</span></strong></a><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;\">, a consortium of advocacy organizations\r\naround the country engaged in juvenile justice policy.</span></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 10.0pt;\">CJDC proudly released the <strong>RE-DIRECTING JUSTICE </strong>a detailed report\r\nthat addresses t</span><span style=\"font-size: 10.0pt; mso-fareast-font-family: &quot;Times New Roman&quot;;\">he Consequences of Prosecuting Youth as Adults</span><span style=\"font-size: 10.0pt;\"> </span><span style=\"font-size: 10.0pt; mso-fareast-font-family: &quot;Times New Roman&quot;;\">and the Need to Restore Judicial Oversight</span><span style=\"font-size: 10.0pt;\">.</span></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 10.0pt;\">&nbsp;</span></p>\r\n<p style=\"margin-top: 0in; margin-right: 0in; margin-bottom: 15.0pt; margin-left: 0in; background: white;\"><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;\">CJDC&rsquo;s&nbsp;current\r\npolicy focus is on<span>&nbsp;</span></span><a title=\"Direct File\" href=\"http://cjdc.org/wp/direct-file/\"><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;; color: windowtext; text-decoration: none; text-underline: none;\">direct file</span></a><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;\">, the Colorado law\r\nthat used to give prosecutors the power to decide which children are prosecuted\r\nin adult criminal court and or juvenile delinquency court.</span><span style=\"font-family: &quot;Verdana&quot;,&quot;sans-serif&quot;; background: white;\"> </span><strong><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;; background: white;\">THIS LAW CHANGED IN 2012 WITH THE\r\nENACTMENT OF<span>&nbsp;</span></span></strong><a href=\"http://cjdc.org/wp/wp-content/uploads/2012/04/HB-1271_Signed-Copy.pdf\"><strong><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;; color: windowtext; background: white; text-decoration: none; text-underline: none;\">HOUSE BILL 1271</span></strong></a><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;; background: white;\">.&nbsp; The law now limits\r\ndirect file eligibility to youth who are 16 years of\r\nage or older who are accused of the most serious and repeat offenses.&nbsp;\r\nYouth who are direct filed can request a<span>&nbsp;</span></span><em><span style=\"font-size: 10pt; background-color: white; background-position: initial initial; background-repeat: initial initial;\">reverse transfer hearing</span></em><span><span style=\"font-size: 10pt; font-family: Calibri, sans-serif; background-color: white; background-position: initial initial; background-repeat: initial initial;\">&nbsp;and ask a judge to review whether their\r\ncase should remain in adult court or transfer back to juvenile court.</span></span></p>\r\n<p style=\"margin-top: 0in; margin-right: 0in; margin-bottom: 15.0pt; margin-left: 0in; text-align: center; background: white;\" align=\"center\"><strong><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;\">JUVENILE RESOURCE\r\nCENTER</span></strong></p>\r\n<p style=\"margin-top: 0in; margin-right: 0in; margin-bottom: 15.0pt; margin-left: 0in; background: white;\"><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;\">The<span>&nbsp;</span><strong>Colorado\r\nJuvenile Defender Coalition</strong>&nbsp;serves as a clearinghouse of\r\ninformation for youth, families, media, policy makers, and the general public\r\nregarding juvenile defense and juvenile justice issues.</span></p>\r\n</p>','670 Santa Fe Drive','Denver','Co','80204','United States','Children and Youth, Community Organizing / Advocacy, Law and Legal Assistance, Legal Services','http://www.cjdc.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
