Hidden=\"false\"\r\n   UnhideWhenUsed=\"false\" Name=\"Colorful Grid Accent 6\" /> <w:LsdException Locked=\"false\" Priority=\"19\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Subtle Emphasis\" /> <w:LsdException Locked=\"false\" Priority=\"21\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Intense Emphasis\" /> <w:LsdException Locked=\"false\" Priority=\"31\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Subtle Reference\" /> <w:LsdException Locked=\"false\" Priority=\"32\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Intense Reference\" /> <w:LsdException Locked=\"false\" Priority=\"33\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Book Title\" /> <w:LsdException Locked=\"false\" Priority=\"37\" Name=\"Bibliography\" /> <w:LsdException Locked=\"false\" Priority=\"39\" QFormat=\"true\" Name=\"TOC Heading\" /> </w:LatentStyles> </xml><![endif]--> <!--[if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\ntable.MsoNormalTable\r\n	{mso-style-name:\"Table Normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\r\n	mso-para-margin:0in;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:12.0pt;\r\n	font-family:Calibri;}\r\n</style>\r\n<![endif]--> <!--StartFragment-->\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 9.75pt; background-position: initial initial; background-repeat: initial initial;\"><span style=\"font-size: 10.0pt; font-family: Tahoma; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin;\">Reading Partners launched in 2001 with the\r\nmission to expand opportunities for children in underserved communities by\r\nfostering a lifelong love of reading, developing strong literacy skills, and\r\nbuilding the confidence and self-esteem critical to empowerment and community\r\ndevelopment.&nbsp; Reading Partners provides children with robust one-on-one\r\nreading support through a structured, research-based curriculum that engages\r\nstudents and provides basic building blocks to supplement their academic\r\ngrowth. &nbsp;On average, Reading Partners students gain 1.6 months of reading\r\nskills for every month in the program.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 9.75pt; background-position: initial initial; background-repeat: initial initial;\"><span style=\"font-size: 10.0pt; font-family: Tahoma; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin;\">Working in partnership with teachers,\r\nschools, and community volunteers, Reading Partners has grown from serving 100\r\nstudents in 2003 in northern California with a budget of $180,000 to serving\r\nover 2,900 students in California, Washington, D.C., New York, Texas, and\r\nMaryland with a budget of almost $8M.&nbsp; A recipient of significant Social\r\nInnovation Fund funding through the Edna McConnell Clark Foundation, Reading\r\nPartners has plans for continued rapid growth into other regions.&nbsp; For\r\nmore information about Reading Partners, please visit&nbsp;</span><a href=\"http://www.readingpartners.org/\"><span style=\"font-size: 10.0pt; font-family: Tahoma; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; color: windowtext; text-decoration: none; text-underline: none;\">www.readingpartners.org</span></a><span style=\"font-size: 10.0pt; font-family: Tahoma; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin;\">.</span></p>\r\n<!--EndFragment--></p>','106 Linden St, #202 - Headquarters','Oakland','Ca','94607','United States','Education and Academia, English Language Learners (ELL), Service Learning, Service Organization, Teaching, Youth Services','http://www.readingpartners.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
