INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (1260,'LifeSkills','<h1>Our Mission</h1>\r\n<p>Life Skills helps individuals with developmental disabilities -- including autism -- learn, live, work and participate in the community.</p>\r\n<h1>Our Vision</h1>\r\n<p><br /> All people should be treated with dignity and respect.  All people should have choices and control of their own lives.  And, all people can learn, live, work and participate in a community that values their contribution, regardless of their disability.</p>\r\n<h1>Core Values</h1>\r\n<p></p>\r\n<ul>\r\n<li>We put the people we serve first.</li>\r\n<li>We tailor our approach to help each individual with developmental disabilities -- including autism -- live the fullest life possible.</li>\r\n<li>We partner with families and provide them with education and options on how they can help their family members with developmental disabilities live the fullest life possible.</li>\r\n<li>We recognize our direct staff as our most important asset.</li>\r\n<li>We value our staff and provide them with a supportive, engaging and rewarding work experience where we all share a commitment to excellence and continuous learning.</li>\r\n<li>We are good community neighbors and provide objective consultation in support of services, research, and government policies.</li>\r\n<li>We advocate on behalf of individuals with developmental disabilities -- including autism -- to ensure their needs are known. </li>\r\n<li>We practice excellent fiscal management to ensure long-term viability of the services we provide.</li>\r\n<li>We are good stewards of the financial and other support we receive and provide clear information about the results we produce for those we serve to all our funders and supporters.</li>\r\n</ul>','10176 Corporate Square Drive, Suite 100','Saint Louis','Mi','63132','United States','Disability Issues, Social Services','http://www.lifeskills-mo.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
