INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (1310,'East Africa Children\'s Hope','<p><span style=\"font-size: x-small;\">The mission of East Africa Children&rsquo;s Hope is to support vulnerable, orphaned&nbsp;and destitute children in East Africa, with a particular emphasis on supporting ventures encouraging the self-sustainability of organizations led by East Africans. EACH will accomplish its mission through domestic fundraising and the donation of funds to vetted and approved project sites in East Africa.</span></p>','300 West 110th Street','New York','Ne','10026','United States','Children and Youth, Education and Academia, Farming and Agriculture','http://www.eastafricachildrenshope.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
