INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (1443,'Horizon Outreach','<p><strong>\"Giving Everyone A New Start.\"</strong></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 1.1em; line-height: 1.7em; color: #666666;\">Horizon Outreach is a 501 (c) 3 non-profit organization founded in February 2010. Our mission is \"Giving Everyone A New Start.\" We offer various programs that seek to rebuild FAITH, provide HOPE, improve self-sufficiency, transition military veterans to civilian life and prevent homelessness among military and non-families.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 1.1em; line-height: 1.7em; color: #666666;\">Since 2010, Horizon Outreach has connected over 1700 individuals to resources within the community through collaborative partnerships, outreach seminars and referrals to other non-profit, federal, state and local agencies.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 1.1em; line-height: 1.7em; color: #666666;\">Programs&nbsp;<br style=\"box-sizing: border-box;\" /><strong>Horizon Connect</strong>-Community Outreach to provide resources to those in need.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 1.1em; line-height: 1.7em; color: #666666;\"><strong>Horizon FAITH</strong>-Provides supportive services, referrals and housing assistance to all families.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 1.1em; line-height: 1.7em; color: #666666;\"><strong>Horizon Eagle</strong>-Provides strategies to help military veteran fathers overcome the effects of PTSD on their relationships, parenting abilities and employability.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 1.1em; line-height: 1.7em; color: #666666;\"><strong>Horizon Outreach Seminars</strong>-Seminars held throughout the community with partner agencies to link clients to resources.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 1.1em; line-height: 1.7em; color: #666666;\"><strong>Horizon Educate</strong>-Life skills training that increases self-sufficiency and sustainability</p>','256 North Sam Houston Pkwy E. Suite 115.','Houston','Te','77060','United States','Affordable Housing, Community Service and Volunteering, Faith-Based, Family and Parenting, Fathers, Government, Homelessness, Housing, Job Training and Workplace Issues, Multi-Service Community Agency, Network of Nonprofit Organizations, Other Service Organization, Service Learning, Service Organization, Social Enterprise and Economic Development, Teaching, Training, Veterans Issues, Victim Support Services','http://horizonoutreach.org/','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (1444,'Horizon Outreach','<p>Horizon Outreach is a non-profit 501 (c) 3 organization founded in February 2010 by a U.S. Air Force Veteran. Our mission of <em> <strong>&ldquo;Giving <em>Everyone </em>A New Start&rdquo;. </strong></em>We\r\n provide  supportive services and housing to military and  non-military \r\nfamilies. Through our programs we decrease the effects of challenging \r\nlife  situations on the family by providing key resources that: increase\r\n  self-sufficiency, employability in career positions; access to \r\npermanent  affordable housing and overall stability of the family unit. \r\n&nbsp;</p>','256 North Sam Houston Pkwy E. Suite 115.','Houston','Te','77060','United States','Community Service and Volunteering, Disability Issues, Faith-Based, Family and Parenting, Fathers, Foundations, Fundraising, and Philanthropy, Government, Homelessness, Housing, Job Training and Workplace Issues, Mens Issues, Multi-Service Community Agency, Network of Nonprofit Organizations, Other Service Organization, Peace, War, and Conflict   Resolution, Poverty and Hunger, Service Organization, Social Enterprise and Economic Development, Social Services, Veterans Issues','http://horizonoutreach.org/','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
