INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (1457,'Rubicon Programs Inc.','<p><span style=\"color: #000000; font-size: x-small;\">Rubicon&rsquo;s mission is to prepare very low-income people to achieve financial independence and to partner with people with mental illness on their journey of recovery.</span></p>','2500 Bissell Ave.','Richmond','Ca','94804','United States','Housing, Job Training and Workplace Issues, Legal Services, Mental Health, Social Enterprise and Economic Development','http://www.rubiconprograms.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (1475,'Hollywood HEART','<p>HOLLYWOOD HEART is a nonprofit that provides arts opportunities for at-risk\r\n teens and young adults to build confidence and career skills. We are \r\ncommitted to improving the lives of the youth we serve through our \r\nyear-round workshops and annual summer camp for youth impacted by \r\nHIV/AIDS. The organization is founded on the principles of Hope, \r\nEducation, Arts, Recreation, and Teamwork (HEART).</p>\r\n<p></p>\r\n<p>Hollywood <a>HEART</a> was founded in 1995 by David Gale, an \r\nL.A.-based entertainment executive with the dream of inspiring \r\nunder-served youth both locally and abroad. It has been going strong for\r\n 19 years, and Gale hopes to continue to expand the number of youth the \r\norganization serves.</p>','301 E. Colorado Blvd. Suite #430 ','Pasadena ','Ca','91101','United States','Children and Youth','http://www.hollywoodheart.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (1501,'Developing African Youth','<p><span style=\"color: #ffffff; font-family: Arial, Helvetica, adobe-helvetica, \'Arial Narrow\'; font-size: 13px; line-height: 16px; background-color: #fbc965;\">Our mission is to partner and cooperate with local authorities, schools, associations, NGOs and Training centers all over the world in addressing problems associated with climate change, poverty and discrimination. We do this through capacity building; community development, Twinning, and sharing of information. We also support our partners to achieve their goals and objectives in reducing poverty through our specialized services. &nbsp;Above all, we seek to empower--through educational and vocational training--Cameroonian youth and to prevent the spread of HIV/AIDS to this vulnerable group.</span></p>','BP 577 Mankon Bamenda','Bamenda','Ot','237','Cameroon','AIDS/HIV Services, Economic Development, Education and Academia, Environment and Ecology, Foundations, Fundraising, and Philanthropy, International Relations, Poverty and Hunger, Social Enterprise and Economic Development, Social Services, Teaching, Training, Youth Services','http://www.daycam.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
