INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (1536,'Manhattan Charter School','<p style=\"padding: 15px 0px 10px; margin: 0px; line-height: 1.3em; font-size: 11px; background-color: #ededed;\">Manhattan Charter School is a small, independent, public charter elementary school (grades K-5), operating as a 501c3 nonprofit organization. We serve 270 children from Kindergarten &ndash; 5th grade. Founded in 2005, on the diverse, enterprising &amp; historic Lower East Side, it is consistently high-achieving (NYS Charter reviewed &amp; renewed through 2015).&nbsp;Admission is via lottery, with District 1 priority, as required by law.</p>\r\n<p style=\"padding: 15px 0px 10px; margin: 0px; line-height: 1.3em; font-size: 11px; background-color: #ededed;\">MCS2&nbsp;is a second site of MCS and opened fall 2012 also in District 1&nbsp;at 220 Henry Street.&nbsp;MCS2 is beginning with a Kindergarten and First Grade comprised of 96 children and grow by one grade each year until the school serves 270 children students in Kindergarten &ndash; 5<sup style=\"padding: 0px; margin: 0px;\">th</sup>&nbsp;grade. MCS2&nbsp;is a replication of the MCS program.</p>\r\n<p style=\"padding: 15px 0px 10px; margin: 0px; line-height: 1.3em; font-size: 11px; background-color: #ededed;\">Manhattan Charter School delivers rigorous, standards-driven instruction and fosters a culture of high expectations. Manhattan Charter School is committed to providing every child with the tools and support necessary for success. To that end, MCS believes in educating the whole child with a well-rounded liberal arts program beginning in kindergarten. This contributes to the academic success of MCS students, and, more importantly, to their development in general. MCS maintains its commitment to offering music every day to every child. Other enrichment instruction includes French, Art and Physical Education, all beginning in kindergarten.</p>','100 Attorney Street','New York','Ne','10002','United States','Children and Youth, Education and Academia','http://www.manhattancharterschool.org/','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
