INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (1550,'Frontier','<p>Frontier is a gap year, volunteering and adventure travel non-profit NGO which manages a huge range of projects around the world, specialising in conservation, community development, healthcare and loads more.</p>\r\n<p>With over 300 volunteering abroad projects in countries \r\nthroughout Africa, South America, Europe and Australasia, we offer \r\nunlimited adventures and excursions in beautiful locations. We have used\r\n our wealth of experience and knowledge in the field of ethical and gap \r\nyear travel, wildlife conservation, adventure travel and community \r\ndevelopment to ensure that we find you the perfect project. With \r\nFrontier you can be sure that you will get the best projects at the most\r\n competitive prices.&nbsp; You can learn a multitude of skills, discover \r\nhidden talents, challenge your preconceptions, gain qualifications and \r\nmake lifelong friends.</p>\r\n<p>You can contribute to positive change in \r\nthe future of marginalised communities with one of Frontier\'s \r\ndevelopment projects. Teach a class of neglected children in \r\nunder-funded village schools, before adventuring through forests \r\nspotting bush babies and flying foxes, or scuba dive and take part in \r\nmarine conservation in a protected marine eco park. Work towards your \r\nTEFL certificate, making your time with Frontier the perfect combination\r\n of learning and gaining valuable practical experience whilst having an \r\namazing experience in fascinating destinations.</p>\r\n<p>Some of our project categories include:</p>\r\n<ul>\r\n<li><a href=\"http://frontiergap.com/Volunteer/Marine-Conservation.aspx\" target=\"_blank\">Marine Conservation and Diving</a></li>\r\n<li><a href=\"http://frontiergap.com/Volunteer/Wildlife-Conservation.aspx\" target=\"_blank\">Wildlife Conservation</a></li>\r\n<li><a href=\"http://frontiergap.com/Volunteer/Teaching-Abroad.aspx\" target=\"_blank\">Teaching Abroad and TEFL<br /></a></li>\r\n<li><a href=\"http://frontiergap.com/Volunteer/Community-Development.aspx\" target=\"_blank\">Community Development</a></li>\r\n<li><a href=\"http://frontiergap.com/Volunteer/Medical-Volunteering.aspx\" target=\"_blank\">Healthcare and Medicine</a></li>\r\n<li><a href=\"http://frontiergap.com/Volunteer/Animal-Care.aspx\" target=\"_blank\">Animal Care and Welfare</a></li>\r\n<li><a href=\"http://frontiergap.com/Volunteer/Adventure-Travel.aspx\" target=\"_blank\">Ethical Adventure Travel</a><br /></li>\r\n<li><a href=\"http://frontiergap.com/Volunteer/Volunteering-With-Children.aspx\" target=\"_blank\">Volunteering with Children</a></li>\r\n</ul>\r\n<p><a href=\"http://frontiergap.com/Volunteer/Volunteer.aspx\" target=\"_blank\">See the full range of placements on our website</a></p>\r\n<p>Also check out:</p>\r\n<ul>\r\n<li><a href=\"https://www.facebook.com/frontierofficial\" target=\"_blank\">Our Facebook page</a></li>\r\n<li><a href=\"https://twitter.com/frontiergap\" target=\"_blank\">Our Twitter feed</a></li>\r\n<li><a href=\"http://www.youtube.com/frontiergapyeartv\" target=\"_blank\">Our YouTube channel</a></li>\r\n<li><a href=\"http://www.gapyearblog.info/projectnews/\" target=\"_blank\">Our blog and project updates</a><br /></li>\r\n</ul>','Irvine Towers, 18100 Von Karman Avenue','Irvine','Ca','92612','United States','Animal Welfare, Child Care, Children and Youth, Community Building and Renewal, Community Service and Volunteering, Conservation, Environment and Ecology, Health and Medicine, Sports, Recreation, and Leisure, Teaching, Wildlife and Animal Welfare','http://frontiergap.com/','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
