INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (1578,'Musical Instrument Museum','<p>The Musical Instrument Museum (MIM) enriches our world by collecting, \r\npreserving, and making accessible an astonishing variety of musical \r\ninstruments and performance videos from every country in the world. MIM \r\noffers guests a welcoming and fun experience, incomparable interactive \r\ntechnology, dynamic programming, and exceptional musical performances. \r\nMIM fosters appreciation of the world&rsquo;s diverse cultures by showing how \r\nwe innovate, adapt, and learn from each other to create music&mdash;the \r\nlanguage of the soul.</p>','4725 E Mayo Blvd','Phoenix','Ar','85050','United States','Art, Cultural Affairs, Museums and   Historical Societies','http://MIM.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
