INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (1590,'DC Public Opera',NULL,'1400 L Street NW #34048','Washington','Di','20043','United States','Art','http://www.dcpublicopera.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (1591,'DC Public Opera','<p class=\"font_8\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background-color: transparent; line-height: 1.4em; max-width: 99.9000015258789%; text-align: left;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background-color: transparent;\"><span style=\"font-family: arial; font-size: small;\">DC Public Opera is a new, alternative opera company in the Nation\'s Capitol.&nbsp;We believe that opera at its best offers an immediate experience that engages the emotions and imaginations of a diverse audience. Our mission is to present relevant, engaging performances that reflect a 21st-century perspective.</span></span></p>\r\n<p class=\"font_8\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background-color: transparent; line-height: 1.4em; max-width: 99.9000015258789%; text-align: left;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background-color: transparent;\"><span style=\"font-family: arial; font-size: small;\">&#8203;<br /></span></span>\r\n<p><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background-color: transparent;\"><span style=\"font-family: arial; font-size: small;\">As a community-connecting company in search of opera\'s most dynamic possibilities, our productions bring opera out of traditional opera houses and into spaces more immediate to our audiences -- including historical sites, museums and public spaces.</span></span></p>\r\n</p>\r\n<p class=\"font_8\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background-color: transparent; line-height: 1.4em; max-width: 99.9000015258789%; text-align: left;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background-color: transparent;\"><span style=\"font-family: arial; font-size: small;\"> </span></span></p>\r\n<p class=\"font_8\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background-color: transparent; line-height: 1.4em; max-width: 99.9000015258789%; text-align: left;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background-color: transparent;\"><span style=\"font-size: small;\"><span style=\"font-family: arial;\">Our 2014 season features two productions: W. A. Mozart\'s&nbsp;<span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background-color: transparent; font-style: italic;\">Don Giovanni&nbsp;</span>and a staged performance of Franz Schubert\'s&nbsp;<span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background-color: transparent; font-style: italic;\">Goethe-Lieder.&nbsp;</span>Mozart\'s infamous opera about illicit affairs and the abuse of power will take place in the Colonial Room of the&nbsp;Mayflower Hotel -- a glamorous venue steeped in political history. Schubert\'s celebrated art songs will be woven into a dramatic narrative that explores the resonances of the&nbsp;<span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background-color: transparent; font-style: italic;\">Lieder&nbsp;</span>in our contemporary worl</span><span style=\"font-family: arial, helvetica, sans-serif;\">d.</span></span></span></p>','1400 L Street NW #34048','Washington','Di','20043','United States','Art','http://www.dcpublicopera.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
