INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (1626,'Green Lifestyles Network','<h2>MISSION STATEMENT:</h2>\r\n<p>Creating a new vision for media by mirroring the diversity of the \r\nhuman experience while offering sustainable solutions for peaceful \r\nco-existence with all living beings.</p>\r\n<p>Our <strong>philosphy/culture</strong> is that language is a powerful\r\n tool to create and change perceptions and experiences. We therefore \r\nteach, advocate and instruct all our team members in the use of non \r\naggressive communication and instruct our bloggers and content writers \r\nto do so as well.</p>','5858 Wilshire Blvd','Los Angeles','Ca','90038','United States','Energy Conservation and Green Living, Environment and Ecology, Media and Journalism','http://www.greenlifestyles.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
