INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (1634,'Tu Nidito Children & Family Services',NULL,'3922 N. Mountain Avenue','Tucson','Ar','85745','United States','Children and Youth','http://tunidito.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (1635,'Tu Nidito Children & Family Services','<p><strong style=\"padding: 0px; margin: 0px; color: #555555; font-family: Arial; font-size: 12px; line-height: 18px; background-color: #f8f3ed;\">Tu Nidito is dedicated to its mission of creating a community of acceptance, support, and understanding regarding children in grief. It is our vision that no child grieves alone.</strong></p>\r\n<p><span style=\"color: #555555; font-family: Arial; font-size: 12px; line-height: 18px; background-color: #f8f3ed;\">More than 15 years ago, Tu Nidito filled a need in our community by building a successful non-profit agency dedicated to supporting children impacted by serious medical conditions and death. Since then, Tu Nidito has served the needs of our community&rsquo;s children and has experienced phenomenal growth. In our first year of service we provided support to 12 dying children and their families.&nbsp;</span><br style=\"padding: 0px; margin: 0px; color: #555555; font-family: Arial; font-size: 12px; line-height: 18px; background-color: #f8f3ed;\" /><br style=\"padding: 0px; margin: 0px; color: #555555; font-family: Arial; font-size: 12px; line-height: 18px; background-color: #f8f3ed;\" /><span style=\"color: #555555; font-family: Arial; font-size: 12px; line-height: 18px; background-color: #f8f3ed;\">Last year, through programs of individual and group support, Tu Nidito cared for nearly 800 children. Today we remain the only agency in Southern Arizona dedicated to providing a comprehensive continuum of child-centered care to children whose lives have been impacted by serious medical conditions or death.&nbsp; It seems so sensible that children and families would not have to go through these difficult times alone, but without Tu Nidito, many of our families would. There is no other agency that provides on-going support to children who have experienced the death of a parent, sibling or other loved one. There is no other agency that stays with an ill child and their family from time of diagnosis, through all of the changes in prognosis, and if that child&rsquo;s medical condition results in a death, throughout the grieving process.&nbsp;</span><br style=\"padding: 0px; margin: 0px; color: #555555; font-family: Arial; font-size: 12px; line-height: 18px; background-color: #f8f3ed;\" /><br style=\"padding: 0px; margin: 0px; color: #555555; font-family: Arial; font-size: 12px; line-height: 18px; background-color: #f8f3ed;\" /><span style=\"color: #555555; font-family: Arial; font-size: 12px; line-height: 18px; background-color: #f8f3ed;\">There is no other agency that provides support to children who have a parent diagnosed with cancer or other serious medical condition. All of our services are provided at no cost to the families that need us.&nbsp; In 2012, Tu Nidito supported 790 children and their families through seven core programs. Tu Nidito is proud that more than 86% of every dollar donated goes directly to care for Southern Arizona&rsquo;s children in their time of need.</span></p>','3922 N. Mountain Avenue','Tucson','Ar','85745','United States','Children and Youth','http://www.tunidito.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (1636,'Sage Voter',NULL,'1103 E Mercer St Lower','Seattle','Wa','98102','United States','Voting, Democracy, and Civic Engagement','http://sagevoter.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (1637,'Sage Voter','<p><span style=\"font-family: \'Times New Roman\'; font-size: medium;\">Sage Voter exists in order to provide an easier way for voters to make informed decisions about who they choose to represent them in government. It is believed that as a result more interest in politics will develop over all, voting turnout will increase and a greater number of votes will be cast for candidates whose political values truly reflect that of the voter. Additionally, researching the consistency of the politician\'s values with his voting record (if it exists) should help to foster a more honest political system. By taking the focus off party affiliations and more on individual values and honesty, politics can become more positive force and elect officials can focus a bit more on the public service that they are elected and paid for and a bit less on pleasing their respective parties and lobbies.</span></p>','1103 E Mercer St Lower','Seattle','Wa','98102','United States','Voting, Democracy, and Civic Engagement','http://www.sagevoter.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
