INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (1673,'American Humane','<div><strong class=\"header1\"><span style=\"font-size: small;\">Do you want to help us help animals?</span></strong></div>\r\n<div><span style=\"font-size: small;\">For more than a hundred years American Humane has been first in promoting the welfare and safety of animals and strengthening the bond between animals and people. We are first to serve, wherever animals are in need of rescue, shelter, protection or security. Through our innovative leadership initiatives &ndash; from our &ldquo;No Animals Were Harmed&reg;&rdquo; program in Hollywood to broad-based farm and conservation animal welfare certifications, to rapid response rescue and care across the country &ndash; American Humane sets the gold standard as the most visionary and effective animal welfare organization in the nation.</span></div>\r\n<div><span style=\"font-size: small;\"><br /></span></div>\r\n<div><span style=\"font-size: small;\">American Humane is a unique organization that offers challenging career opportunities to its employees. Headquartered in Washington, D.C., with regional offices in Los Angeles, CA and Palm Beach, FL, we offer a friendly, professional atmosphere. American Humane offers equal employment opportunities to all qualified employees and applicants for employment without regard to race, color, religion, national origin, citizenship, marital status, partnership status, parental status, physical or mental disability, age, membership in any labor organization, political affiliation, creed, ancestry, gender, sexual orientation, gender identity, veteran status, or genetic information in accordance with applicable federal, state and local laws</span></div>','1400 16th Street NW, Ste. 360','Washington','Di','20036','United States','Animal Welfare, Conservation, Disaster Relief, Farming and Agriculture, Research and   Science, Veterans Issues, Wildlife and Animal Welfare','http://www.americanhumane.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
