INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (1710,'Positive Community Impact','<p>PCI&rsquo;s mission is to prevent disease, improve community health and promote sustainable development worldwide.</p>\r\n<p><strong>Vision</strong><br /> Motivated by our concern for the world&rsquo;s most vulnerable children, families and communities, PCI envisions a world where abundant resources are shared, communities are able to provide for the health and well-being of their members, and children and families can achieve lives of hope, good health and self-sufficiency.</p>\r\n<p><strong>Strong Roots<br /> </strong>In 1961, a young doctor from San Diego volunteering at a Tijuana clinic saved the lives of two small children who were dying of pneumonia. This experience led Dr. James Turpin to found PCI and forever change the lives of millions of children and families around the world by providing health and hope to those most in need. Since then, the focus of the organization has remained true to its founder: PCI works in vulnerable communities to improve health and create long-term change by helping people help themselves. For 50 years, thousands of dedicated individuals and groups have worked to make this vision a reality.</p>','5151 Murphy Canyon Rd, Suite 320','San Diego','Ca','92123','','Family and Parenting, Farming and Agriculture, Health and Medicine, International Relief Organization','http://www.pciglobal.org/','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
