INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (1718,'Proyecto Pastoral','<p>Proyecto Pastoral at Dolores Mission is a community building organization whose mission is to provide training, education and social services with the Pico- Aliso/Boyle Heights district of East Los Angeles. Proyecto Pastoral coordinates five community based programs.<br />Our Vision<br /><br />The Community is empowered to address evolving challenges and practices community solidarity. Proyecto Pastoral serves as a model for similar communities of empowerment and community participation in self and social transformation.<br />Our History<br /><br />Proyecto Pastoral at Dolores Mission was founded in 1986 by community residents and the California Province of Jesuits. It has grown into a highly effective community - building organization. Proyecto Pastoral is committed to involving local community members in the planning, design and implementation of its programs. One third of the Proyecto Pastoral Board of Directors is comprised by local community residents responding to community identified needs enabling Proyecto Pastoral to make a significant impact in the lives of local families. Anticipating the needs of the community enables Proyecto Pastoral in being an ever evolving organization that whose success lies not only in being dynamic but understanding the real issues. Proyecto Pastoral serves over 2,500 children, youth and families annually through its five programs.<br /><br /></p>','135 North Mission Road','Los Angeles','Ca','90033','United States','Child Care, Children and Youth, Family and Parenting, Job Training and Workplace Issues, Parent Organization, Poverty and Hunger, Social Services, Training','http://www.proyectopastoral.org/','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
