INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (1898,'Gospel Justice Initiative','<p>Our mission is engaging Christ followers to meet the legal and spiritual needs of the poor. &nbsp;Our vision is to see 1,000 gospel justice centers transforming lives in the name of Christ. &nbsp;We accomplish this through thought leadership educating others about the legal needs of the poor in America and the failure of our system in providing justice for all. &nbsp;We partner with like-minded organizations to accomplish systemic change. &nbsp;We equip lawyers and others to join together to provide help and hope to those oppressed by legal injustice. &nbsp;We do this because our Christian faith compels us to do justice, love mercy and walk humbly before our God. &nbsp;We speak up for the rights of the poor and destitute. &nbsp;We love our neighbor and we make a difference in the lives of those who cannot access our legal and government systems.</p>','1750 GRANDSTAND PLACE','ELGIN','Il','60123','United States','Faith-Based, Law and Legal Assistance','http://www.gji.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
