rful Grid Accent 6\" /> <w:LsdException Locked=\"false\" Priority=\"19\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Subtle Emphasis\" /> <w:LsdException Locked=\"false\" Priority=\"21\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Intense Emphasis\" /> <w:LsdException Locked=\"false\" Priority=\"31\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Subtle Reference\" /> <w:LsdException Locked=\"false\" Priority=\"32\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Intense Reference\" /> <w:LsdException Locked=\"false\" Priority=\"33\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Book Title\" /> <w:LsdException Locked=\"false\" Priority=\"37\" Name=\"Bibliography\" /> <w:LsdException Locked=\"false\" Priority=\"39\" QFormat=\"true\" Name=\"TOC Heading\" /> </w:LatentStyles> </xml><![endif]--><!--[if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\"Table Normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin:0cm;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:\"Calibri\",\"sans-serif\";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-fareast-font-family:\"Times New Roman\";\r\n	mso-fareast-theme-font:minor-fareast;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:\"Times New Roman\";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]-->\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12.0pt; line-height: 115%; mso-bidi-font-family: Arial;\" lang=\"EN-US\">Starting a Non-Profit organization is an impressive\r\nway to brace an effectual cause! But often, the mammoth paperwork can be\r\ndiscouraging. At SGI Cares, our non-profit formation division specializes in\r\nestablishing non-profit charitable ventures from the ground-up, and/or drafting\r\nand executing novel programs for existing organizations. We attenuate your\r\nstress by completing your forms for tax-exempt status and help you realize your\r\npassion.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12.0pt; line-height: 115%; mso-bidi-font-family: Arial;\" lang=\"EN-US\">We also offer the best of compliance, management,\r\nbranding and marketing services to cater to the creative and strategic needs of\r\nour clients. SGI Care guarantees legal and brand compliance to fortify your\r\nbrand&rsquo;s look and feel, and uplift communication of professional product\r\ninformation to the consumer<span style=\"background: white;\">. </span>Our digital\r\nmarketing department at Solid Ground Innovations is a full-service agency that\r\nprovides &ldquo;a la carte&rdquo;, part-time, and full-time professional management and\r\nconsulting services. Our clients believe in us to help them comply with\r\nstringent branding and legal guidelines. We know that you simply cannot afford\r\nto fail.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; mso-bidi-font-family: Arial;\" lang=\"EN-US\">Although\r\nmost of our clients are contracted, SGI does offer the above services on a\r\none-time basis or as needed to cater to your specific short and long term\r\nneeds. Always remember, SGI cares for you! To learn more about our work, please\r\nvisit <a href=\"http://www.sgicares.com/sgicares/\"><span style=\"color: windowtext;\">http://www.sgicares.com/sgicares/</span></a> and <a href=\"http://www.sgicares.com/\"><span style=\"color: windowtext;\">http://www.sgicares.com/</span></a> .</span></p>\r\n</p>','227 Florida St','Baton Rouge','Lo','70801','United States','Foundations, Fundraising, and Philanthropy','http://sgicares.com/','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
