INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (2086,'RBSCC Community Empowerment Center','<p>For more than thirty years, the Ridgewood Bushwick Senior Citizens Council, Inc. (RBSCC) has been a beacon of hope, providing crucial social services to Ridgewood, Bushwick and the surrounding communities of Brooklyn and Queens. Since its inception, RBSCC has assessed and monitored the changing needs of the community and has provided a comprehensive system of services to the most needy youth, seniors, and families in New York State. Our mission is to continually seek strategies that uplift and stabilize the community and empower local residents.</p>\r\n<p>The RBSCC Community Empowerment Center addresses long standing social issues in North Brooklyn by developing and managing innovative programs. We offer homelessness prevention, job training and placement through a Career Pathways model, contextualized adult education, legal services, veteran services, and tenant&rsquo;s rights trainings.</p>','90 Beaver Street','Brooklyn','Ne','11206','United States','Affordable Housing, Community Organizing / Advocacy, Homelessness, Housing, Job Training and Workplace Issues, Multi-Service Community Agency, Social Services','http://empowermentcenter.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
