INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (2167,'Seabury Resources for Aging','<p class=\"pageTitle\" style=\"color: #85001a; font-size: 2em; margin-top: 220px;\">Mission, Vision &amp; Values</p>\r\n<p style=\"font-size: 14px;\"><span class=\"redText\" style=\"color: #85001a;\"><strong><span style=\"font-size: xx-small;\">Mission</span></strong></span><strong><span style=\"font-size: xx-small;\"><br /></span></strong><br />Seabury Resources for Aging\'s mission is to provide personalized, affordable services and housing options to help older adults in the greater Washington, DC area live with independence and dignity.</p>\r\n<p class=\"redText\" style=\"color: #85001a; font-size: 14px;\"><strong><span class=\"title\"><span style=\"font-size: xx-small;\">Vision</span></span></strong></p>\r\n<p style=\"font-size: 14px;\">Seabury Resources for Aging will continue to be the trusted community leader in aging services</p>\r\n<p class=\"redText\" style=\"color: #85001a; font-size: 14px;\"><strong><span class=\"title\"><span style=\"font-size: xx-small;\">Values</span></span></strong></p>\r\n<p style=\"font-size: 14px;\"><span class=\"redText\" style=\"color: #85001a;\"><strong>Compassion</strong></span>---our interaction is based on our empathy for those we serve&nbsp;<br /><br /><span class=\"redText\" style=\"color: #85001a;\"><strong>Innovation</strong></span>---our approach is flexible and novel<br /><br /><span class=\"redText\" style=\"color: #85001a;\"><strong>Respect</strong></span>---we value every person as an individual with dignity<br /><br /><span class=\"redText\" style=\"color: #85001a;\"><strong>Cheer</strong></span>---we want our passion to be apparent in all we do, so that it is a joy to work for and with us<br /><br /><span class=\"redText\" style=\"color: #85001a;\"><strong>Loyalty</strong></span>---we are faithful to each other, those that work with us, and those we serve<br /><br /><span class=\"redText\" style=\"color: #85001a;\"><strong>Excellence</strong></span>---we strive to exceed expectations<br /><br /><span class=\"redText\" style=\"color: #85001a;\"><strong>Sustainability</strong></span>---we will meet the needs of the present without compromising our ability to meet the future.</p>','4201 Butterworth Place, NW','Washington','Di','20016','United States','Housing, Seniors and Retirement Issues, Travel and Transportation','http://seaburyresources.org/','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (2168,'Pachamama Alliance','<div>Pachamama Alliance, empowered by our partnership with indigenous people, is dedicated to bringing forth an environmentally sustainable, spiritually fulfilling, socially just human presence on this planet.</div>\r\n<div><br /></div>\r\n<div>Our unique contribution is to generate, and engage people everywhere in, transformational conversations and experiences consistent with this purpose. We weave together indigenous and modern worldviews such that human beings are in touch with their dignity and are ennobled by the magnificence, mystery and opportunity of what is possible for humanity at this time.</div>\r\n<div><br /></div>\r\n<div>We are here to inspire and galvanize the human family to generate a critical mass of conscious commitment to a thriving, just and sustainable way of life on Earth. This is a commitment to transforming human systems and structures that separate us, and to transforming our relationships with ourselves, with one another, and with the natural world.</div>','Presidio Bldg # 1009, P.O. Box 29191','San Francisco','Ca','94129','United States','Communications, Environment and Ecology','http://www.pachamama.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
