INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (2208,'Schizophrenia & Related Disorders Alliance of America (SARDAA)','<p style=\"text-align: justify;\"><strong><span style=\"text-decoration: underline;\">Mission</span></strong></p>\r\n<p style=\"text-align: justify;\"><strong></strong>Schizophrenia and Related Disorders Alliance of America promotes \r\nimprovement in the lives of people with schizophrenia-related illnesses \r\nand their families by providing support, hope, and awareness so that \r\nearly diagnosis, treatment, and community services increase recovery.</p>\r\n<p style=\"text-align: justify;\"><strong><span style=\"text-decoration: underline;\">Vision</span></strong></p>\r\n<p style=\"text-align: justify;\">Our vision is that every person with schizophrenia or a related \r\ndisorder (mental illness involving psychosis) achieves recovery and a \r\nfull life in a compassionate community free of stigma and \r\ndiscrimination.</p>\r\n<p style=\"text-align: justify;\"><strong><span style=\"text-decoration: underline;\">Our Objectives</span></strong></p>\r\n<ul style=\"text-align: justify;\">\r\n<li>To promote hope and recovery for persons with schizophrenia and related disorders.</li>\r\n<li>To eliminate the stigma and myths about schizophrenia.</li>\r\n<li>To raise awareness so that early diagnosis and treatment increase the chance of recovery.</li>\r\n<li>To ensure that consumer-driven and recovery-oriented services are fully accessible.</li>\r\n</ul>\r\n<p style=\"text-align: justify;\"><strong><span style=\"text-decoration: underline;\">Our Programs</span></strong></p>\r\n<ul style=\"text-align: justify;\">\r\n<li>Provide technical support for Schizophrenics Anonymous (SA), a peer \r\nsupport/self-help step program for persons who have schizophrenia or a \r\nrelated illness.</li>\r\n<li>Friends and Family Support Conference Call (FFS), a peer support \r\ngroup for family members and friends of those affected by \r\nschizophrenia-related disorders.</li>\r\n<li>Public education campaigns to increase schizophrenia awareness and early diagnosis, and to eliminate stigma and discrimination.</li>\r\n<li>An online resource library of promising and evidence-based \r\npractices, the latest research, and other information for treatment \r\nprofessionals.</li>\r\n<li>Advocacy at the federal, state and local levels for mental health \r\npolicies and funding that support the recovery of people with \r\nschizophrenia and related disorders.</li>\r\n<li>Information and referral for people with schizophrenia-related \r\ndisorders, their families, professionals and the public including:</li>\r\n</ul>\r\n<ul style=\"text-align: justify;\">\r\n<li>&nbsp;\r\n<ul>\r\n<li>Our website, which provides accurate and current information about the causes of schizophrenia, treatments and recovery tools.</li>\r\n<li>Personal stories of recovery and hope from people with schizophrenia and related disorders</li>\r\n<li>A Speakers Bureau of people with expertise about \r\nschizophrenia-related disorders, including individuals living with the \r\nillness, family members and professionals.</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p style=\"text-align: justify;\"><strong><span style=\"text-decoration: underline;\">What We Do</span></strong></p>\r\n<ul style=\"text-align: justify;\">\r\n<li>Support and train schizophrenics anonymous (SA) groups </li>\r\n<li>Organize conferences and workshops for professionals and consumers </li>\r\n<li>Sponsor weekly schizophrenics anonymous conference call </li>\r\n<li>Sponsor weekly family &amp; friends support conference call </li>\r\n<li>Advocate at federal, state and local levels </li>\r\n<li>Assist in public education campaigns </li>\r\n<li>Provide online resource library </li>\r\n<li>Publish monthly eNewsletter </li>\r\n<li style=\"text-align: justify;\">Provide speaker&rsquo;s bureau for events </li>\r\n</ul>','PO Box 941222','Houston','Te','77094','United States','Communications, Community Organizing / Advocacy, Foundations, Fundraising, and Philanthropy, Health and Medicine, Homelessness, Mental Health, Veterans Issues','http://www.sardaa.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
