INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (2225,'Student Support Specialist I (Bilingual English and Spanish)','<p style=\"margin:0in;margin-bottom:.0001pt;mso-add-space:auto\"><span style=\"font-size: 9pt; font-family: Arial, sans-serif; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">Impact NW is a social service non-profit organization\r\nwhose mission is to help people achieve and maintain self-sufficiency and to\r\nprevent and alleviate the effects of poverty. Impact NW is looking for\r\npassionate individuals that support our mission is to help people prosper\r\nthrough a community of support.<strong><br /> <br /> PROGRAM OVERVIEW: </strong><br /> </span><span style=\"font-size: 10pt; font-family: Helvetica, sans-serif; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">Social support has been identified as an important\r\ncharacteristic of resiliency in youth and is likely to promote academic achievement\r\nand positive educational outcomes for at-risk students. Impact NW&rsquo;s Social\r\nSupport Services for Educational Success program helps troubled teens improve\r\ntheir self control, develop better conflict resolution skills, and communicate\r\nmore effectively with adults and peers. </span><span style=\"font-size: 9pt; font-family: Arial, sans-serif;\"></span></p>\r\n<p style=\"margin:0in;margin-bottom:.0001pt;mso-add-space:auto\">&nbsp;</p>\r\n<p style=\"margin:0in;margin-bottom:.0001pt;mso-add-space:auto\"><strong><span style=\"font-size: 9pt; font-family: Arial, sans-serif;\">JOB&nbsp;SUMMARY</span></strong><span style=\"font-size: 9pt; font-family: Arial, sans-serif;\">: </span></p>\r\n<p style=\"margin:0in;margin-bottom:.0001pt;mso-add-space:auto\"><span style=\"font-size: 9pt; font-family: Arial, sans-serif;\">We currently have an opportunity as a<span style=\"background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"> Student Support Specialist I <strong>(Part Time\r\n&ndash; 32 hours/week)</strong> to</span> provide supportive services to students, between\r\nthe ages of 12-17, who are at risk of dropping out of school, with the goal of\r\nhelping students get back in or remain in school.&nbsp;The Specialist will\r\ncoordinate outreach and case management services with teachers, parents and\r\nother school personnel, along with facilitating skill development classes for\r\nstudents.</span></p>\r\n<p style=\"margin:0in;margin-bottom:.0001pt;mso-add-space:auto\">&nbsp;</p>\r\n<p style=\"margin:0in;margin-bottom:.0001pt;mso-add-space:auto\"><strong><span style=\"font-size:9.0pt;font-family:\r\n&quot;Arial&quot;,&quot;sans-serif&quot;;color:#222222\">Entry Wage:</span></strong><span style=\"font-size:9.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#222222\">&nbsp;$13.77\r\nto $15.99<br /> <br /> Applicants with the following criteria are encouraged to apply:</span></p>\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;margin-left:.5in;\r\nmargin-bottom:.0001pt;mso-add-space:auto;text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-size:9.0pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol;color:#222222\">&middot;<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-size:9.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\ncolor:#222222\">Associate degree or equivalent in social work, child development\r\nor related field</span></p>\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;margin-left:.5in;\r\nmargin-bottom:.0001pt;mso-add-space:auto;text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-size:9.0pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol;color:#222222\">&middot;<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-size:9.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\ncolor:#222222\">At least two years of experience in a human services, social\r\nwork or related field, preferably working with low-income youth</span></p>\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;margin-left:.5in;\r\nmargin-bottom:.0001pt;mso-add-space:auto;text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-size:9.0pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol;color:#222222\">&middot;<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-size:9.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\ncolor:#222222\">Bilingual (English/Spanish)</span></p>\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;margin-left:.5in;\r\nmargin-bottom:.0001pt;mso-add-space:auto;text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-size:9.0pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol;color:#222222\">&middot;<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-size:9.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\ncolor:#222222\">Fa