INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (2300,'Equipment Connections for Children','<p><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><strong>Organization Mission and Values</strong>:</span></p>\r\n<p><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\">Founded\r\n in 2009, <strong>Equipment Connections for Children (ECFC)</strong> is a resource for \r\nfamilies who need adaptive equipment for their child with a disability \r\nand have no other means to obtain the equipment. ECFC receives used \r\nadaptive equipment from families whose child has outgrown it and then \r\ndonates that equipment to another family whose child needs it. All \r\nservices are free of charge. </span></p>\r\n<p><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\">ECFC\r\n is based in Montgomery County, Maryland and serves children in \r\nMaryland, Virginia and the DC metropolitan region.&nbsp; See our website at \r\nhttp://www.equipforchildren.org <br /></span></p>\r\n<p><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><strong>ECFC\'s Mission</strong> is to connect costly adaptive equipment from one child with a \r\ndisability who outgrows the equipment to another child who needs it. </span></p>\r\n<p><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><strong>ECFC\'s Vision</strong> is a world in which all available adaptive equipment is in use by the children with disabilities who need it. </span></p>\r\n<p><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\">We see a world in which: </span></p>\r\n<ul>\r\n<li><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\">Children reach their full potential because they have the adaptive equipment they need to learn, move, play and grow. </span></li>\r\n<li><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\">Families&rsquo; burden of purchasing high cost adaptive equipment is eased. </span></li>\r\n<li><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\">Families\r\n are able to receive multiple pieces of specialized adaptive equipment \r\nto ensure their child has a healthy and full life. </span></li>\r\n<li><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\">With the right adaptive equipment: </span>\r\n<ul>\r\n<li><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\">Children with disabilities live a healthier life. </span></li>\r\n<li><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\">Children have the ability to participate more fully in their family and community life. </span></li>\r\n<li><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\">Families have the ability to participate more fully in community life. </span></li>\r\n<li><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\">Communities benefit because they have participating families and children. </span></li>\r\n</ul>\r\n</li>\r\n</ul>','12909 Barleycorn Terrace','Germantown','Ma','20874','United States','Children and Youth, Disability Issues, Social Services','http://www.equipforchildren.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
