INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (2308,'InFaith','<div class=\"mhl\">InFaith&nbsp;enables called and committed followers of Christ to serve with purpose and passion within our nation&rsquo;s borders. Our ministries, in thirty-three states,&nbsp;exist to introduce people to Jesus and help them get to know Him better. Our methods vary according to the needs of the people we serve. Our field staff serves in children\'s ministry, pastorates, camps, church planting, urban ministries, youth ministry, intercultural ministry, prison ministry, chaplaincies, nursing-home ministry, and other specialized ministries, as God has called e<span class=\"text_exposed_show\">ach one.<br /><br /> Over the years, our mission has been known as First Day Society, Sunday and Adult School Union, American Sunday School Union, and American Missionary Fellowship. Today, we call ourselves \"InFaith\" because everything we do is rooted in our faith in Jesus Christ. <br /><br /> Visit our website for stories and videos from the field, blogs, ministry opportunities, staff profiles, and more.</span></div>','672 Conestoga Road, PO Box 370','Villanova','Pe','19085','United States','Children and Youth, Community Building and Renewal, Community Service and Volunteering, English Language Learners (ELL), Faith-Based, Family and Parenting, Homelessness, Multi-Service Community Agency, Social Services, Teaching','http://infaith.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
