INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (2311,'Oikocredit USA','<p class=\"MsoNormal\"><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;; mso-bidi-font-family: Calibri;\">Oikocredit is\r\none of the world&rsquo;s largest sources of private funding to the microfinance\r\nsector. We finance locally-based microfinance institutions, provide credit to\r\ntrade cooperatives, fair trade organizations and small-to-medium enterprises\r\n(SMEs) in the developing world. We have $890 million in outstanding loans to\r\nover 800 organizations in 63 countries. Nearly $40 million of this comes from\r\nUS investors. With these funds, our project partners dispense loans to the poor\r\nand disadvantaged, with a special emphasis on rural areas and women. Oikocredit\r\nis also at the forefront of social performance management, integrating\r\nenvironmental, social and governance factors into investment decisions.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;; mso-bidi-font-family: Calibri;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;; mso-bidi-font-family: Calibri;\">Oikocredit\r\noffers a dual return to our investors: financial and social. In addition to\r\nearning modest financial returns, investors are secure in the knowledge that\r\ntheir money is being used to fight poverty, promote fair trade and respect our\r\nplanet&rsquo;s natural resources.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;; mso-bidi-font-family: Calibri;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 10.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;; mso-bidi-font-family: Calibri;\">Oikocredit&rsquo;s\r\nWashington, DC office is charged with attracting new investors, engaging with\r\nexisting investors, and educating the public about global poverty alleviation\r\nand economic empowerment. The DC office does not disburse loans.</span></p>','1701 K Street NW, Suite 1201','Washington','Di','20006','United States','Economic Development, Entrepreneurship, Microcredit, Poverty and Hunger, Social Enterprise and Economic Development, Women\'s Issues','http://www.oikocreditusa.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
