INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (2325,'NAMI Maryland','<p class=\"MsoNormal\"><span style=\"color: #888888; font-size: small;\">NAMI Maryland is a statewide organization, with thirteen local\r\naffiliates, dedicated to advocacy for and education of persons with illnesses,\r\ntheir families and the community.&nbsp; NAMI\r\nMaryland advocates for the public and private resources needed to assure the\r\navailability, accessibility and quality of comprehensive mental health services\r\nthroughout the state and for research for causes and cures of&nbsp; mental illness.&nbsp; It also provides consumers and families the\r\neducation needed to successfully live with mental illnesses, educates the\r\ngeneral public about the stigma endured by those with mental illness and\r\nprovides support to families and consumers to help them cope with the\r\nchallenges of mental illness.</span></p>','10630 Little Patuxent Parkway, Suite 475','Columbia','Ma','21044','United States','Mental Health','http://www.namimd.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
