INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (2363,'Allies for Every Child (formerly known as Westside Childrens Center)','<p><span style=\"font-family: Times New Roman; font-size: small;\"> </span></p>\r\n<p style=\"margin: 0in 8.15pt 0pt 8.7pt; text-align: justify; text-indent: 0in; -ms-text-justify: inter-ideograph; punctuation-wrap: simple; mso-line-break-override: restrictions;\"><span style=\"font-size: 10.5pt;\"><span style=\"font-family: Cambria;\">Allies for Every Child (Allies)\r\n(formerly known as Westside Children&rsquo;s Center) exists to give at-risk children\r\nand children living in poverty the foundation they need to increase their life\r\nchoices and lead fulfilling lives. For over 25 years Allies has been providing\r\nthousands of at-risk children and their families with critical, high-quality\r\nearly education programs (including comprehensive Early Head Start services),\r\nfamily strengthening interventions, mental health treatment, foster care and\r\nadoption services, and a range of vital, integrated services, including\r\neducational assessments, disabilities screenings, nutrition, dental and vision\r\nscreenings, and pediatric health consultations.</span></span></p>\r\n<p><span style=\"font-family: Times New Roman; font-size: small;\"> </span></p>','5721 W. Slauson Ave Suite 140','Culver City','Ca','90230','United States','Child Care, Domestic Violence Support Services, Family and Parenting, Multi-Service Community Agency, Social Services','https://www.alliesforeverychild.org/','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
