<w:LsdException Locked=\"false\" Priority=\"73\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" Name=\"Colorful Grid Accent 6\" /> <w:LsdException Locked=\"false\" Priority=\"19\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Subtle Emphasis\" /> <w:LsdException Locked=\"false\" Priority=\"21\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Intense Emphasis\" /> <w:LsdException Locked=\"false\" Priority=\"31\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Subtle Reference\" /> <w:LsdException Locked=\"false\" Priority=\"32\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Intense Reference\" /> <w:LsdException Locked=\"false\" Priority=\"33\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Book Title\" /> <w:LsdException Locked=\"false\" Priority=\"37\" Name=\"Bibliography\" /> <w:LsdException Locked=\"false\" Priority=\"39\" QFormat=\"true\" Name=\"TOC Heading\" /> </w:LatentStyles> </xml><![endif]--><!--[if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\"Table Normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\r\n	mso-para-margin:0in;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:\"Calibri\",\"sans-serif\";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-fareast-font-family:\"Times New Roman\";\r\n	mso-fareast-theme-font:minor-fareast;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:\"Times New Roman\";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]-->Citizens Campaign for the Environment&lt;/b&gt; is\r\nNew York and Connecticut&rsquo;s most effective grassroots environmental organization\r\nwith over 85,000 members and more than 29 years of experience winning campaigns\r\nthat have preserved and improved our air and water quality. Recent successes\r\ninclude the NY Sewage Right to Know Act that create a warning system for when\r\nsewage overflows into our communities and open waterways and the NY Child Safe\r\nPlaying Fields Acts that bans toxic pesticides on school playgrounds and\r\nplaying fields in NY grades K-12.<span style=\"mso-spacerun: yes;\">&nbsp; </span>The\r\ndefeat of Shell Oil\'s (world\'s 2nd largest oil company) proposal to build a\r\nnatural gas facility in Long Island Sound is perhaps our biggest and most\r\nimportant victory to date.<span style=\"mso-spacerun: yes;\">&nbsp; </span>CCE is the\r\norganization leading the charge against Hydrofracking (hydraulic-fracturing)\r\nfor natural gas in Central NY, a major threat to water quality, public health\r\nand agriculture.<span style=\"mso-spacerun: yes;\">&nbsp; </span>We are currently working\r\nto see that clean, renewable resources are the way we build for energy\r\nindependence and sustainabilty!</p>\r\n<p>www.citizenscampaign.org</p>\r\n<p style=\"text-align: center;\">&nbsp;<strong>BE A PART OF THE SOLUTION!</strong>\r\n<p class=\"MsoNormal\" style=\"text-align: left;\">If you are looking for a job, and are concerned about the\r\nfuture of your community and planet, this is an opportunity to not only take\r\naction and have fun, but to get paid for it!</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">Call 315-472-1339 to\r\nschedule your interview in Syracuse</p>\r\n<p class=\"MsoNormal\" style=\"text-align: left;\">Qualifications: We are looking to add highly motivated individuals\r\nwith good communication skills to our already effective and professional staff.\r\nEmail:<span style=\"mso-spacerun: yes;\">&nbsp; </span><a href=\"mailto:jkulczyk@citizenscampaign.org\">kweil@citizenscampaign.org</a></p>\r\n<p class=\"MsoNormal\" style=\"text-align: left;\">Hours: 2-10:30 pm, Monday through Friday.<span style=\"mso-spacerun: yes;\">&nbsp; </span>Part-Time is available for Three Days\r\nMinimum, though the hours are the same.</p>\r\n<p class=\"MsoList\" style=\"margin-bottom: 0.0001pt; text-align: left;\">Pay: $400+/week</p>\r\n<p class=\"MsoNormal\" style=\"text-align: left;\">Benefits: Health insurance, paid vacations and personal days\r\nto employees that show longevity and proficiency with the\r\norganization.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: left;\">Travel opportunities within our nationwide network\r\nof non-profits for environmental and social justice causes.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: left;\"><em><strong><span style=\"mso-bidi-font-family: Mangal;\">&nbsp;&ldquo;We are all connected; to each other, biologically.<span style=\"mso-spacerun: yes;\">&nbsp; </span>To the earth, chemically.<span style=\"mso-spacerun: yes;\">&nbsp; </span>To the universe, atomically.</span></strong></em>\"<span style=\"mso-spacerun: yes;\">&nbsp;&nbsp; </span>-<span style=\"mso-spacerun: yes;\">&nbsp; </span><strong>Neil\r\ndeGrasse Tyson</strong><br /></p>\r\n</p>','2000 Teall ave. Suite 204','Syracuse','Ne','13206','United States','Community Building and Renewal, Community Organizing / Advocacy, Conservation, Energy Conservation and Green Living, Environment and Ecology, Government, Network of Nonprofit Organizations, Politics, Voting, Democracy, and Civic Engagement, Wildlife and Animal Welfare','http://www.citizenscampaign.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
