d reduced reliance on incarceration, and\r\nadvocates for more responsive juvenile and criminal justice policies.</span></span></p>\r\n<span style=\"font-size: small;\"> </span>\r\n<p class=\"MsoNormal\" style=\"mso-pagination: none; tab-stops: 0in .5in 1.0in 1.5in 2.0in 2.5in 3.0in 3.5in 4.0in 4.5in 5.0in 5.5in; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: small;\"><span style=\"font-family: &quot;Palatino Linotype&quot;,&quot;serif&quot;; mso-fareast-font-family: &quot;Arial Unicode MS&quot;; mso-bidi-font-family: &quot;Arial Unicode MS&quot;;\">The\r\nCenter for Community Alternatives mission is to promote reintegrative justice\r\nand a reduced reliance on incarceration through advocacy, services and public\r\npolicy development in pursuit of civil and human rights.</span></span> <span style=\"font-size: small;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 28.0pt; font-family: &quot;Bookman Old Style&quot;,&quot;serif&quot;; mso-fareast-font-family: &quot;Arial Unicode MS&quot;; mso-bidi-font-family: &quot;Arial Unicode MS&quot;; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\"></span></strong></span></p>\r\n</p>','115 E Jefferson St','Syracuse','Ne','13202','United States','AIDS/HIV Services, Drug and Alcohol Treatment, Gang Prevention and Intervention, Human Rights and Civil Liberties, Law and Legal Assistance, Mens Issues, Multi-Service Community Agency, Prison Reform, Race and Ethnicity, Recovery, Addiction, and Abuse, Social Services, Women\'s Issues, Youth Services','http://www.communityalternatives.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
