INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (2491,'Sarah\'s Inn','<p style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 12px; line-height: inherit; font-family: &quot;Noto Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; margin: 1rem 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: #231f20;\"><span style=\"background: transparent; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: #000000;\">Sarah&rsquo;s Inn is a community-based 501(c)(3) non-profit organization whose mission is to improve the lives of those affected by domestic violence and to break the cycle of violence for future generations.&nbsp;Our services and&nbsp;initiatives focus on ending relationship violence through domestic violence crisis&nbsp;<a style=\"background: transparent; border: 1px solid transparent; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; text-decoration-line: none; color: #d99acd; transition: color 0.3s ease-out, border-color 0.3s ease-out;\" title=\"Support and Crisis Intervention\" href=\"http://www.sarahsinn.org/en/what-we-do/support-and-intervention/\">intervention</a>,&nbsp;<a style=\"background: transparent; border: 1px solid transparent; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; text-decoration-line: none; color: #d99acd; transition: color 0.3s ease-out, border-color 0.3s ease-out;\" title=\"Community Engagement\" href=\"http://www.sarahsinn.org/en/what-we-do/community-engagement/\">community education</a>, and violence<a style=\"background: transparent; border: 1px solid transparent; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; text-decoration-line: none; color: #d99acd; transition: color 0.3s ease-out, border-color 0.3s ease-out;\" title=\"Violence Prevention\" href=\"http://www.sarahsinn.org/en/what-we-do/violence-prevention/\">&nbsp;prevention programs</a>&nbsp;for youth.</span><em style=\"background: transparent; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\"></em></p>\r\n<div class=\"MsoNormal\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 12px; line-height: inherit; font-family: &quot;Noto Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: #231f20;\">Founded in 1981 by Oak Park residents, Sarah&rsquo;s Inn works throughout the socioeconomically diverse region of Chicago&rsquo;s West Side neighborhoods and Western suburbs. We believe in hopeful futures for survivors of domestic violence through the strength that comes from a networked and supportive community. The vision of Sarah&rsquo;s Inn is to be a nationally recognized leader for community-based solutions that will end relationship violence.</div>','PO Box 1159','Oak Park','Il','60304','United States','Domestic Violence Support Services','http://www.sarahsinn.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
