INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (2685,'Family Refuge Center','<p class=\"MsoNormal\">Family Refuge Center is a community-based domestic violence project\r\nthat has served Greenbrier, Monroe and Pocahontas Counties in southeastern WV\r\nsince 1979.&nbsp; We are committed to ending\r\nphysical, sexual and emotional abuse in families. We encourage and promote\r\nhealthy family life based on mutual respect and support for all family members,\r\nproviding direct services to victims and developing community awareness and\r\nresponsiveness through our various programs.&nbsp;\r\nThese programs include a temporary shelter, 24 hour hotline, victim\r\nadvocacy, sexual assault crisis intervention and advocacy, community education\r\nand prevention programs, individual and group trauma focused counseling,\r\ncoordinated community response teams that include law enforcement and\r\nprosecution, information and referral services, and two supervised visitation\r\nand exchange centers.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p><span style=\"font-size: 12.0pt; font-family: &quot;Times New Roman&quot;,serif; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">1. Our mission, simply stated, is to end physical,\r\nsexual and emotional abuse in families and to promote healthy family life.&nbsp;&nbsp;</span></p>','P.O.Box 249','Lewisburg','We','24901','','Domestic Violence Support Services, Sexual Abuse Support Services','http://www.familyrefugecenter.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
