INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (2739,'NuPath Children Services','<p><span style=\"font-family: Times New Roman; font-size: small;\"> </span></p>\r\n<p style=\"margin: 0in 0in 0pt; text-align: justify;\"><span style=\"font-family: &quot;Cambria&quot;,&quot;serif&quot;; font-size: 11pt; mso-bidi-font-size: 12.0pt; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin;\">NuPath Children Services is licensed\r\nas a</span><span style=\"font-size: 11pt; mso-bidi-font-size: 12.0pt;\"><span style=\"font-family: Times New Roman;\"> </span></span><span style=\"font-family: &quot;Cambria&quot;,&quot;serif&quot;; font-size: 11pt; mso-bidi-font-size: 12.0pt; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin;\">therapeutic\r\nchild placing agency in the Commonwealth of Virginia that services the needs of\r\nchildren, teens, and young adults. We provide services to children from birth\r\nto 17 years of age, whom have suffered abuse, neglect, have emotional or\r\nphysical challenges or other circumstances which make them unable to live with\r\ntheir family of origin. Children are referred to our program by social services\r\nagencies throughout the Commonwealth of Virginia.&nbsp; </span></p>','8012 Midlothian Tnpk, Suite 102','Richmond','Vi','23235','','Children and Youth, Community Organizing / Advocacy, Community Service and Volunteering, Crime, Safety, and Victims Issues, Family and Parenting, Government, Professional Association, Service Organization, Social Services, Youth Services','http://www.familyfirstchildrenservices.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
