INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (2845,'Textile Arts Center','<p><strong>Textile Arts Center (TAC) is a NYC-based 501(c)3 resource facility dedicated to raising awareness and understanding of textiles through creative educational programs for children and adults. </strong>At TAC, we aspire to unify the textile community and advocate for the handmade by providing accessible, skills-based classes that reinvigorate engagement with traditional crafts. Techniques like weaving, sewing, and dyeing are practical, connective, and process-driven -- common denominators for designers, artists, and creative practitioners around the world. Because these activities are so widely used, they help to foster community and bring creativity back into our daily lives. They are part of our collective history and vital to our ongoing expressions of design, art, and culture. &nbsp;</p>\r\n<p>We appreciate the unique values of textile arts and want to expand opportunities for new practitioners to engage with the medium. Participatory learning is the foundation of our model and enables students from all backgrounds to make meaningful contributions to a growing community of fiber artists. Workshops, courses, events, and special programs at TAC allow professionals and novices alike to explore their creative ingenuity through handcraft processes. By engaging with groups ranging from newcomers to experts, we increase the positive social impact of textile arts and nurture innovations and leadership in the field.&nbsp;</p>','505 Carroll Street','Brooklyn','Ne','11215','United States','Art','http://www.textileartscenter.com','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
