INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (2877,'OPCC','<p><span style=\"font-family: Times New Roman; font-size: small;\"> </span></p>\r\n<p style=\"margin: 0in 0in 0pt; text-align: left; tab-stops: .25in 1.0in;\" align=\"left\"><span style=\"font-family: &quot;Calibri&quot;,sans-serif; font-size: 11pt; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Arial;\"><strong>Agency\r\nPrograms and Services</strong></span></p>\r\n<p><span style=\"font-family: Times New Roman; font-size: small;\"> </span></p>\r\n<p style=\"margin: 1em 0px; line-height: normal;\"><span style=\"font-size: small;\"><span style=\"font-family: Times New Roman;\"><span style=\"mso-bidi-font-family: Arial;\">OPCC </span><span style=\"mso-bidi-font-family: Calibri;\">provides highly\r\neffective, fully integrated services to the most vulnerable and traumatized\r\nmembers of our community who are most in need of assistance &mdash; individuals who\r\nare homeless, dealing with severe mental or physical illness, victims of\r\ndomestic violence, and at-risk youth. </span><span style=\"mso-bidi-font-family: Arial;\"><span style=\"mso-spacerun: yes;\">&nbsp;</span></span><span style=\"mso-bidi-font-family: Calibri;\">We are the only West L.A. - based agency that offers a comprehensive\r\nsystem of care to solve the complex, multi-faceted problems of this diverse\r\npopulation.<span style=\"mso-spacerun: yes;\">&nbsp; </span>We have wide-ranging expertise\r\nand programs that enable us to fully address the unique needs of each\r\nindividual.<span style=\"mso-spacerun: yes;\">&nbsp; </span>OPCC offers seven core\r\nservices: housing, mental health care, medical care, substance addiction\r\ntreatment, domestic violence services, life skills/wellness programs and income\r\nassistance.</span></span></span></p>\r\n<p><span style=\"font-family: Times New Roman; font-size: small;\"> </span></p>\r\n<p style=\"margin: 1em 0px; line-height: normal;\"><span style=\"mso-bidi-font-family: Calibri;\"><span style=\"font-family: Times New Roman; font-size: small;\">&nbsp;</span></span></p>\r\n<p><span style=\"font-family: Times New Roman; font-size: small;\"> </span></p>\r\n<p style=\"margin: 1em 0px; line-height: normal;\"><span style=\"font-family: Times New Roman; font-size: small;\">OPCC&rsquo;s programs and\r\nmodels of service delivery are based on research innovation across multiple\r\nfields that have earned the agency recognition and funding at federal, state,\r\ncounty and city levels.</span></p>\r\n<p><span style=\"font-family: Times New Roman; font-size: small;\"> </span></p>\r\n<p style=\"margin: 1em 0px; line-height: normal;\"><span style=\"font-family: Times New Roman; font-size: small;\">&nbsp;</span></p>\r\n<p><span style=\"font-family: Times New Roman; font-size: small;\"> </span></p>\r\n<p style=\"margin: 1em 0px 12pt; line-height: normal; mso-add-space: auto; mso-pagination: none; mso-layout-grid-align: none;\"><strong><span style=\"mso-bidi-font-family: Calibri;\"><span style=\"font-family: Times New Roman; font-size: small;\">Agency Mission</span></span></strong></p>\r\n<p><span style=\"font-family: Times New Roman; font-size: small;\"> </span></p>\r\n<p style=\"margin: 1em 0px 12pt; line-height: normal; mso-add-space: auto; mso-pagination: none; mso-layout-grid-align: none;\"><span style=\"mso-bidi-font-family: Calibri;\"><span style=\"font-family: Times New Roman; font-size: small;\">OPCC is a community-supported\r\norganization in which staff, volunteers, and clients work together with mutual\r\nrespect to address the effects of poverty, abuse, neglect and discrimination.\r\nThe agency&rsquo;s programs are designed to empower people to access the resources\r\nthey need to ensure their survival, end their victimization, and improve their\r\nquality of life. OPCC provides a common ground for our diverse community to\r\neffect public policy and advocate for responsive human services.</span></span></p>\r\n<p><span style=\"font-family: Times New Roman; font-size: small;\"> </span></p>','1453 16th Street','Santa Monica','Ca','90404','','Affordable Housing, Domestic Violence Support Services, Homelessness, Housing, Mental Health, Multi-Service Community Agency, Poverty and Hunger, Shelter/Emergency Shelter, Social Services','http://www.opcc.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
