INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (2941,'One To World','<p class=\"MsoNormal\" align=\"left\">One To World brings future leaders \r\nfrom around the world together with Americans - one to one - sharing \r\nsimilarities and appreciating differences to build cultural \r\nunderstanding across the globe.</p>\r\n<p class=\"MsoNormal\" align=\"left\">We \r\nbelieve world peace begins when individuals from different cultures \r\nexchange perspectives, face to face, in an open and engaging forum.&nbsp;</p>\r\n<p class=\"MsoNormal\" align=\"left\">One\r\n To World is designated by the U.S. Department of State as the official \r\ncoordinator of Fulbright enrichment programs in the greater New York \r\narea. In addition to working with Fulbright grantees, One To World \r\npromotes connections with the 65,000 self-sponsored international \r\nstudents studying in the greater New York area.</p>\r\n<div></div>\r\n<p class=\"MsoNormal\" align=\"left\">These\r\n outstanding representatives of their countries have much to teach us, \r\nand much to gain from knowing us better. By offering a constant stream \r\nof meaningful face-to-face interactions in American homes, schools, \r\nbusinesses, and institutions, One To World creates goodwill, peaceful \r\ninteractions, and mutual understanding across borders.</p>','285 West Broadway, Ste 450','New York','Ne','10013','','Communications, Community Service and Volunteering, Cultural Affairs, Education and Academia, Higher Education','http://www.one-to-world.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
