INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (3065,'IFF','<p>IFF is a mission-driven lender, real estate consultant, and developer that helps communities thrive by creating opportunities for low-income communities and people with disabilities. Key to our success has been a deep sense of purpose, a broad perspective, and a relentless focus on achieving positive results. Social return can coincide with financial return.</p>\r\n<p>Across the Midwest, we help clients from every sector, including human service agencies, health centers, schools, housing developers, and grocery stores. Our staff of over 70 professionals works from our Chicago headquarters, and we also serve the Midwest from four regional offices: Milwaukee, Wisconsin; St. Louis, Missouri; Indianapolis, Indiana; and Detroit, Michigan. We are a U.S. Department of the Treasury certified community development financial institution (CDFI), a member of the Federal Home Loan Bank of Chicago and the Opportunity Finance Network, and a past recipient of the $5.5 million Wells Fargo NEXT award for Opportunity Finance.</p>\r\n<p>IFF is the largest nonprofit CDFI in the Midwest and one of only a few nationally to earn the CARS AAA+1 rating. Since 1988, we have made over $450 million in loans, leveraged $1.4 billion in community investments, and grown our total managed assets to $300 million.</p>','1 N LaSalle Street, Suite 700','Chicago','Il','60602','United States','Affordable Housing, Charter School, Child Care, Community Building and Renewal, Economic Development, Energy Conservation and Green Living, Housing, Research and   Science, Social Services','http://www.iff.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
