INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (3080,'Acadia Center','<p>Acadia Center is a non-profit, research and advocacy organization committed to advancing the clean energy future. Acadia Center is at the forefront of efforts to build clean, low carbon and consumer friendly economies. Acadia Center provides accurate and reliable information, and offers a real-world and comprehensive approach to problem solving through innovation and collaboration.</p>\r\n<p>Acadia Center staff is based in offices in Boston, MA; Providence, RI; Hartford, CT; New York, NY; Rockport, ME; and Ottawa, ON, Canada, with additional staff in Maine and the Vermont/New Hampshire area. Acadia Center researches, develops and advocates innovative policies that tackle the region&rsquo;s environmental challenges while promoting sustainable economies. Acadia Center&rsquo;s Climate and Energy Analysis Center (CLEAN) fills a needed role for targeted, reliable data and policy analysis. Acadia Center has a unique capacity to combine a wide range of data sources, complex technical research, and economic analysis into useful information for policy makers, the media and the public.</p>\r\n<p>Our work is highly regarded among non-profits, business, consumers, public officials and the media and is used widely to help advance clean energy and climate solutions at the state, regional and federal levels. Acadia Center has received Charity Navigator&rsquo;s highest 4 Star rating for fiscal management and devotion of revenues to program work.</p>','PO Box 583','Rockport','Ma','4856','United States','Energy Conservation and Green Living, Environment and Ecology','http://www.acadiacenter.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
