INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (3155,'4C Council','<p>The Community Child Care Council of Santa Clara County (4Cs) is proud\r\n to serve the community of the greater Silicon Valley, for 45 years.</p>\r\n<p>4Cs is a non-profit, community-based agency that provides a variety \r\nof comprehensive services and serves as the community child care link \r\nfor families, child care professionals, and most recently Senior \r\nNutrition to those who live and work in Santa Clara County, California.</p>\r\n<p>Our programs include:</p>\r\n<p>Child Care Resource and Referral<br /> Subsidized Child Care Programs<br /> Child Care Food Program<br /> Family Child Care Home Education Network<br /> Child Care Initiative Project<br /> Kaleidescope<br /> Health and Safety Training and Reimbursement Program<br /> TrustLine<br /> Senior Nutrition Program</p>','150 River Oaks Parkway','San Jose','Ca','95134','','Child Care','','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
