INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (3170,'Narenj Tree Foundation','<p style=\"padding: 0px; margin: 0px 0px 15px; box-sizing: border-box; color: #555555; font-family: \'Ideal Sans SSm A\', \'Ideal Sans SSm B\', \'Trebuchet MS\', sans-serif; font-size: 16px; line-height: 22px;\">Narenj Tree Foundation is a nonprofit organization that was founded in November 2013 to assist refugees in need.&nbsp;</p>\r\n<p style=\"padding: 0px; margin: 0px 0px 15px; box-sizing: border-box; color: #555555; font-family: \'Ideal Sans SSm A\', \'Ideal Sans SSm B\', \'Trebuchet MS\', sans-serif; font-size: 16px; line-height: 22px;\">The mission of Narenj Tree Foundation is to provide emergency humanitarian assistance to displaced communities. We achieve our mission by shipping clothing, food, medical equipment, personal hygiene products and other essential supplies to refugees from areas affected by disaster.&nbsp;</p>\r\n<p style=\"padding: 0px; margin: 0px 0px 15px; box-sizing: border-box; color: #555555; font-family: \'Ideal Sans SSm A\', \'Ideal Sans SSm B\', \'Trebuchet MS\', sans-serif; font-size: 16px; line-height: 22px;\">In just one year since its inception, Narenj Tree shipped 14 containers of essential supplies to refugee camps where many displaced communities have limited resources.&nbsp;</p>','101 Schuylkill Avenue Unit 2','Norristown','Pe','19401','United States','International Relief Organization','http://www.narenjtree.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
