INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (3269,'Woodbourne Center','<div class=\"col-xs-24 col-sm-18\">\r\n<h1><span style=\"font-family: arial; font-size: x-small;\">Our Mission &ndash; Our Promise</span></h1>\r\n<span style=\"font-family: arial; font-size: x-small;\"> </span>\r\n<p><span style=\"font-family: arial; font-size: x-small;\">The Nexus mission statement conveys a powerful message about what we \r\ndo as an organization. It is our commitment to serve youth, families, \r\nand the community. Our work at Nexus creates ripples of positive change \r\nthat strengthens kids, families, and communities for generations to \r\ncome.</span></p>\r\n<span style=\"font-family: arial; font-size: x-small;\"> </span>\r\n<h2 style=\"clear: both;\"><span style=\"font-family: arial; font-size: x-small;\"> Our Cornerstones &ndash; The foundation of all Nexus programming<br /></span> <span style=\"font-family: arial; font-size: x-small;\"><span class=\"small\" style=\"text-align: center;\"> <strong> <span class=\"siteLI milleLacsLI\">Honesty</span> <span class=\"siteLI gerardLI\">Responsibility</span> <span class=\"siteLI indianOaksLI\">Courage</span> <span class=\"siteLI onargaLI\"> Care\r\n    &amp; Concern </span> </strong> </span></span></h2>\r\n<span style=\"font-family: arial; font-size: x-small;\"> </span>\r\n<p><span style=\"font-family: arial; font-size: x-small;\">Our commitment to our cornerstone values is unwavering. It is what \r\ndistinguishes us from other providers. Our culture-rich programming \r\nincorporates the cornerstone values into language, behavior, and \r\nrepeated design features throughout our sites to reinforce these values \r\nin treatment. They serve as a constant reminder that sets the standard \r\nby which we live and work.</span></p>\r\n<span style=\"font-family: arial; font-size: x-small;\"> </span>\r\n<h2><span style=\"font-family: arial; font-size: x-small;\"> Honesty</span></h2>\r\n<span style=\"font-family: arial; font-size: x-small;\"> Be truthful and genuine with self and others. </span>\r\n<h2><span style=\"font-family: arial; font-size: x-small;\">Responsibility</span></h2>\r\n<span style=\"font-family: arial; font-size: x-small;\"> Step up and do the right thing. </span>\r\n<h2><span style=\"font-family: arial; font-size: x-small;\">Courage</span></h2>\r\n<span style=\"font-family: arial; font-size: x-small;\"> Face fear and take action. Make the right decision, regardless of the outcome. </span>\r\n<h2><span style=\"font-family: arial; font-size: x-small;\">Care &amp; Concern</span></h2>\r\n<span style=\"font-family: arial; font-size: x-small;\"> Demonstrate genuine interest, compassion, and support.</span></div>\r\n<p><span style=\"font-family: arial; font-size: x-small;\">https://www.nexustreatment.org/sites/Woodbourne/video/Woodbourne.mp4</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','1301 Woodbourne Ave','Baltimore','Ma','21239','United States','Mental Health, Network of Nonprofit Organizations, Other Service Organization, Service Organization, Social Services, Youth Services','http://www.nexustreatment.org/sites/woodbourne/about/index','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
