INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (3337,'Clean Water Action','<p class=\"MsoNoSpacing\"><span style=\"font-size: small;\">Clean Water Action works to ensure that Minnesota has\r\nclean and safe water now and for generations to come.&nbsp; As the state chapter of national Clean Water\r\nAction, we organize for the fundamental policies needed to improve the quality\r\nof our water and our lives.&nbsp; We work in\r\nalliance to address environmental, social and economic justice issues that\r\narise from environmental problems.&nbsp; We\r\nfoster active citizen leadership and organize affected communities to create\r\npolitical institutions that preserve and enhance our shared environmental\r\nlegacy.</span></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: small;\">&nbsp;</span></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: small;\">MN CWA was founded with the following goals in mind:</span></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: small;\">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Build\r\nthe strength, cooperation and diversity of the environmental movement in\r\nMinnesota;</span></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: small;\">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Be a\r\nstrong voice at the legislature and government agencies while holding them\r\naccountable;</span></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: small;\">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Elect\r\nand recruit strong environmental candidates to public office;</span></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: small;\">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Provide\r\norganizing, technical assistance, training and information to member groups.</span></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: small;\">&nbsp;</span></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: small;\">We are one of the most effective environmental\r\norganizations in the country because of our ability to organize and mobilize\r\nour member base.</span></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: small;\">&nbsp;</span></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: small;\">Ongoing Campaigns:</span></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: small;\">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Clean\r\nand Safe Water</span></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: small;\">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Transition\r\nto Safe and Clean Energy</span></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: small;\">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Rural\r\nCommunities\' Health and Environment</span></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: small;\">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Environmental\r\nJustice</span></p>\r\n<p></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: small;\">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Chemical\r\nPolicy Reform</span></p>','330 2nd Ave. S. STE 420','Minneapolis','Mi','55401','United States','Community Organizing / Advocacy, Energy Conservation and Green Living, Environment and Ecology, Foundations, Fundraising, and Philanthropy, Voting, Democracy, and Civic Engagement','http://cleanwateraction.org/','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
