INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (3339,'Thirdway','<p><span style=\"color: #283542; font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">Third&nbsp;Way&nbsp;is a national think tank that champions modern center-left ideas. Our agenda is built on the bedrock belief that for political movements to succeed in our political system, they must relentlessly reimagine their policies, strategies, and coalitions. We are fighting for&nbsp;</span><span style=\"box-sizing: border-box; font-weight: 700; color: #283542; font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">opportunity</span><span style=\"color: #283542; font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">, so everyone has the chance to earn a good life; progress on social issues, so all have the&nbsp;</span><span style=\"box-sizing: border-box; font-weight: 700; color: #283542; font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">freedom</span><span style=\"color: #283542; font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">&nbsp;to live the lives they choose; and&nbsp;</span><span style=\"box-sizing: border-box; font-weight: 700; color: #283542; font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">security</span><span style=\"color: #283542; font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">, so we are protected from the global threats of the 21</span><span style=\"box-sizing: border-box; line-height: 0; position: relative; vertical-align: baseline; top: -0.4rem; margin-left: 0.2rem; color: #283542; font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\">st</span><span style=\"color: #283542; font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">&nbsp;century.&nbsp;</span></p>','1025 Connecticut Ave NW','Washington','Di','20036','United States','Politics','http://www.thirdway.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
