INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (3465,'SHAPE Community Center ','<p><span style=\"color: #555555; font-family: \'Open Sans\', serif; font-size: 14px; line-height: 20px;\">As one of the most visible and involved community centers in Greater Houston, SHAPE has led the way toward justice, equal opportunity, human rights and institution building in the city, state, nation and the world. Because of its deep commitment to the community, SHAPE has actively sought ways to oppose injustice and to improve the community for all people.</span></p>\r\n<p><span style=\"color: #555555; font-family: \'Open Sans\', serif; font-size: 14px; line-height: 20px;\">SHAPE (Self-Help for African People through Education) Community Center was founded in 1969. Today, the Center provides many programs and activities that serve as tools to strengthen families and communities including:</span></p>\r\n<p><span style=\"color: #555555; font-family: \'Open Sans\', serif; font-size: 14px; line-height: 20px;\">&bull; After School /Summer Enrichment Program, with youth and family guidance and counseling </span></p>\r\n<p><span style=\"color: #555555; font-family: \'Open Sans\', serif; font-size: 14px; line-height: 20px;\">&bull; Parenting Support Program </span></p>\r\n<p><span style=\"color: #555555; font-family: \'Open Sans\', serif; font-size: 14px; line-height: 20px;\">&bull; Annual Pan-African Cultural Festival </span></p>\r\n<p><span style=\"color: #555555; font-family: \'Open Sans\', serif; font-size: 14px; line-height: 20px;\">&bull; Annual Kwanzaa Celebrations </span></p>\r\n<p><span style=\"color: #555555; font-family: \'Open Sans\', serif; font-size: 14px; line-height: 20px;\">&bull; Fruit &amp; Vegetable Cooperative, 1st Saturday of every month </span></p>\r\n<p><span style=\"color: #555555; font-family: \'Open Sans\', serif; font-size: 14px; line-height: 20px;\">&bull; Elder\'s Institute of Wisdom Gathering, each Tuesday and Thursday </span></p>\r\n<p><span style=\"color: #555555; font-family: \'Open Sans\', serif; font-size: 14px; line-height: 20px;\">&bull; Wholistic Health Program (Food &amp; Nutrition) </span></p>\r\n<p><span style=\"color: #555555; font-family: \'Open Sans\', serif; font-size: 14px; line-height: 20px;\">&bull; Children and Senior Adults Computer Classes </span></p>\r\n<p><span style=\"color: #555555; font-family: \'Open Sans\', serif; font-size: 14px; line-height: 20px;\">&bull; Legal Assistance Clinics / Consultations</span></p>\r\n<p><span style=\"color: #555555; font-family: \'Open Sans\', serif; font-size: 14px; line-height: 20px;\"> &bull; Forums for Community Issues </span></p>\r\n<p><span style=\"color: #555555; font-family: \'Open Sans\', serif; font-size: 14px; line-height: 20px;\">&bull; Voter Registration / Mobilization </span></p>\r\n<p><span style=\"color: #555555; font-family: \'Open Sans\', serif; font-size: 14px; line-height: 20px;\">&bull; Annual Freedom Tour (Retracing the Civil Rights Movement) </span></p>\r\n<p><span style=\"color: #555555; font-family: \'Open Sans\', serif; font-size: 14px; line-height: 20px;\">&bull;Math Tutorials </span></p>\r\n<p><span style=\"color: #555555; font-family: \'Open Sans\', serif; font-size: 14px; line-height: 20px;\">&bull;Death Penalty Abolition Movement (Advocacy) </span></p>\r\n<p><span style=\"color: #555555; font-family: \'Open Sans\', serif; font-size: 14px; line-height: 20px;\">&bull; Home Site for the Association of Black Social Workers </span></p>\r\n<p><span style=\"color: #555555; font-family: \'Open Sans\', serif; font-size: 14px; line-height: 20px;\">&bull; Association of Black Social Psychologists </span></p>\r\n<p><span style=\"color: #555555; font-family: \'Open Sans\', serif; font-size: 14px; line-height: 20px;\">&bull; Sisters of SHAPE. </span></p>\r\n<p><span style=\"color: #555555; font-family: \'Open Sans\', serif; font-size: 14px; line-height: 20px;\">These are just a few of the many programs that have been housed at SHAPE Community Center. While there are core programs at SHAPE, many programs and activities change to meet the changing needs of the community that we serve. Our primary focus continues to be programs and activities that are geared to youth, family and the revitalization and strengthening of the family and the community. </span></p>\r\n<p><span style=\"color: #555555; font-family: \'Open Sans\', serif; font-size: 14px; line-height: 20px;\">For over 44 years, SHAPE has survived the ebbs and flows of the civil rights movement. SHAPE\'s journey from a small organization to one of international scope mirrors the transition of its leadership. The outreach, which began locally, has now gained national and international attention. As a result, SHAPE was honored in Washington, D.C., along with 26 others, for efforts in combating drugs, in the early nineties. SHAPE was involved with the organizing of the Million Man March, the Million Family March and the Millions More Movement where hundreds of families were transported from Harris County and the Gulf Coast Area to Washington, D.C. to join these historic events. </span></p>\r\n<p><span style=\"color: #555555; font-family: \'Open Sans\', serif; font-size: 14px; line-height: 20px;\">For its efforts in improving the quality of life for children, family and the community as a whole, SHAPE has received over 450 awards through the years, including the Jefferson Award, the MLK Humanitarian Award, the UNCF Leadership in the Minority Community Award, the Mickey Leland Humanitarian Award, Metropolitan Transit Authority Outstanding Community Service Award and the State of Texas Substance Abuse Prevention Award, along with many others.&nbsp;</span></p>','3815 Live Oak','Houston','Te','77004','United States','Children and Youth, Community Organizing / Advocacy, Family and Parenting, Human Rights and Civil Liberties, Legal Services, Network of Nonprofit Organizations, Teaching, Voting, Democracy, and Civic Engagement, Women\'s Issues, Youth Services','http://www.shape.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
