INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (3589,'NLCA  Foundation','<div class=\"n module-type-header diyfeLiveArea \">\r\n<h1><span style=\"font-family: arial; font-size: small;\"><span class=\"diyfeDecoration\">NLCA FOUNDATION Encourages Greater Opportunity for All&nbsp;&nbsp;&nbsp;</span></span></h1>\r\n<span style=\"font-family: arial; font-size: small;\"> </span></div>\r\n<div class=\"n module-type-htmlCode diyfeLiveArea \"></div>\r\n<p><span style=\"font-family: arial; font-size: small;\"> </span><span style=\"font-family: arial; font-size: small;\"> </span></p>\r\n<p><span style=\"font-family: arial; font-size: small;\"><span style=\"font-size: 14.3px;\">First and foremost our Non profit \r\ngoal is to make a difference in as many people\'s lives as possible. We \r\nstrive to do as much as possible to support disadvantaged\r\nhigh school students by assisting them to graduate career ready so they \r\nmay make a positive impact in the communities they serve.</span></span></p>\r\n<p><span style=\"font-family: arial; font-size: small;\"><br /></span></p>\r\n<p><span style=\"font-family: arial; font-size: small;\">Our proposition is to is to assist in the advancement of the future \r\nprofessional within the professional beauty industry and its culture to \r\nsustain expertise, health and wellbeing for all. We seek\r\nto do as much as possible to support sustainablility of our professional\r\n community and opportunity for all by making a positive impact in the \r\ncommunities we serve. We do this by establishing\r\ndefinative research of each segment and expertise, while focusing on \r\neducation, health and wellness and on relative and enviornmental \r\ninitiatives.</span></p>\r\n<p><span style=\"color: #00007f;\"> <span style=\"font-family: Georgia,serif; font-size: x-small;\"><span style=\"font-size: 42px;\"><span style=\"font-size: 56px;\"><span style=\"font-size: 32px;\"><span style=\"font-size: 36px;\"><span style=\"font-size: 12px;\"><span style=\"font-size: 14px;\"><span style=\"font-size: 13px;\"><span style=\"font-size: 12px;\"><span style=\"font-size: 13px;\"><span style=\"font-size: 13px;\"><span style=\"font-size: 13px;\"><span style=\"font-size: 10px;\"><span style=\"font-size: 14px;\"><span style=\"font-size: 10px;\"><span style=\"font-size: 11px;\"><span style=\"font-size: 14px;\"><span style=\"font-size: 11px;\"><span style=\"font-size: 11px;\"><span style=\"font-size: 11px;\"><span style=\"font-size: 11px;\"><span style=\"font-size: 11px;\"><span style=\"font-size: 10px;\"><span style=\"font-size: 11px;\"><span style=\"font-size: 11px;\"><span style=\"font-size: 11px;\"><span style=\"font-size: 11px;\"><span style=\"font-size: 12px;\"><span style=\"font-size: 8px;\"><span style=\"font-size: 11px;\"><span style=\"font-size: 11px;\"><span style=\"font-size: 14px;\"><span style=\"font-size: 9px;\"><span style=\"font-size: 12px;\"></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span><span style=\"font-size: x-small;\"><span style=\"font-family: Georgia,serif; color: #00007f;\"><span style=\"font-family: Georgia,serif; color: #00007f;\"><span style=\"font-size: 12px;\"><span style=\"font-size: 12px;\"></span></span></span></span></span></p>','7925 W Russell Rd','Las Vegas','Ne','89140','United States','Foundations, Fundraising, and Philanthropy','http://www.nlcafoundation.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
