INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (3591,'National Latino Cosmetology Association','<h2><span style=\"font-family: arial; font-size: small;\">Purpose</span></h2>\r\n<p><span style=\"font-family: arial; font-size: small;\"> </span></p>\r\n<p><span style=\"font-family: arial; font-size: small;\">Our purpose is to support the beauty industry by providing \r\neducational and career development resources to the beauty professional \r\nand future professional, while also serving as a business resource and \r\nadvocate for business owners, manufacturers, and distributors in the \r\nbeauty industry.</span></p>\r\n<p><span style=\"font-family: arial; font-size: small;\"> </span></p>\r\n<h2><span style=\"font-family: arial; font-size: small;\">Value</span></h2>\r\n<p><span style=\"font-family: arial; font-size: small;\"> </span></p>\r\n<p><span style=\"font-family: arial; font-size: small;\">Our vision is connecting the beauty business and industry to the \r\nLatino market and a network for professional and business development.</span></p>','7925 W Russell Rd','Las Vegas','Ne','89140','United States','Professional Association','http://www.NLCAmerican.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
