INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (3621,'Beverly Bootstraps','<p class=\"MsoNormal\"><strong><span style=\"font-family: &quot;Palatino Linotype&quot;,&quot;serif&quot;; mso-bidi-font-family: &quot;Times New Roman&quot;; color: #8c8279;\">Mission</span></strong></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: &quot;Palatino Linotype&quot;,&quot;serif&quot;; mso-bidi-font-family: &quot;Times New Roman&quot;; color: #8c8279;\">Beverly Bootstraps\r\nCommunity Services, Inc. provides critical resources to families and\r\nindividuals so they may achieve self-sufficiency. &nbsp;We offer emergency and long-term assistance\r\nincluding: access to food, housing stability, adult and youth education,\r\ncounseling and advocacy.&nbsp; We are\r\ncommunity funded and supported.&nbsp; </span></p>\r\n<p class=\"MsoNormal\"><strong><span style=\"font-family: &quot;Palatino Linotype&quot;,&quot;serif&quot;; mso-bidi-font-family: &quot;Times New Roman&quot;; color: #8c8279;\">Vision Statement</span></strong></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: &quot;Palatino Linotype&quot;,&quot;serif&quot;; mso-bidi-font-family: &quot;Times New Roman&quot;; color: #8c8279;\">Beverly Bootstraps\r\nCommunity Services envisions creating and delivering a model program that\r\nempowers our clients to tackle the root causes and inter-connected issues of\r\nfood insecurity, financial instability, and shortfalls in education and job\r\nskills.&nbsp; </span></p>\r\n<p class=\"MsoNormal\"><strong><span style=\"font-family: &quot;Palatino Linotype&quot;,&quot;serif&quot;; mso-bidi-font-family: &quot;Times New Roman&quot;; color: #8c8279;\">Philosophy</span></strong></p>\r\n<p></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: &quot;Palatino Linotype&quot;,&quot;serif&quot;; mso-bidi-font-family: &quot;Times New Roman&quot;; color: #8c8279;\">&ldquo;Feed people fish, feed\r\nthem for a day. &nbsp;Teach them how to fish\r\nand feed them for life&rdquo; describes Beverly Bootstraps&rsquo; philosophy. &nbsp;While the agency addresses clients in crisis\r\nwith emergency assistance such as food, heat assistance, temporary housing and\r\nreferrals to other services, the greater mission is to offer clients an opportunity\r\nto gain skills that lead to self-sufficiency.</span></p>','371 Cabot Street','Beverly','Ma','1915','United States','Multi-Service Community Agency','http://www.beverlybootstraps.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
