INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (3682,'Deborah Ross Ministries','<div style=\"color: #171717; font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: center; background-color: #c6a152;\"><strong><span style=\"color: #6e5300; font-family: georgia; font-size: 14pt; text-decoration: underline;\">Complete Mission Statement</span></strong></div>\r\n<div style=\"color: #171717; font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: center; background-color: #c6a152;\"><span style=\"font-family: georgia; font-size: 14pt;\"><span style=\"color: #6e5300;\">Strengthening families by encouraging all people to stand strong in their faith, even in the face of adversity, according to God\'s Word, so that a godly heritage will be passed from one generation to another.</span></span></div>\r\n<div style=\"color: #171717; font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: center; background-color: #c6a152;\"><span style=\"font-family: georgia; font-size: 14pt;\">&nbsp;</span></div>\r\n<div style=\"color: #171717; font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: center; background-color: #c6a152;\"><span style=\"font-family: georgia; font-size: 14pt;\"><span style=\"color: #a9a9a9;\">&tilde;&tilde;&tilde;&tilde;&tilde;&tilde;&tilde;&tilde;&tilde;&tilde;&tilde;&tilde;&tilde;&tilde;&tilde;&tilde;&tilde;&tilde;&tilde;&tilde;&tilde;</span></span></div>\r\n<div style=\"color: #171717; font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: center; background-color: #c6a152;\">&nbsp;</div>\r\n<div style=\"color: #171717; font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: center; background-color: #c6a152;\"><span style=\"color: #222245; font-family: georgia; font-size: 14pt; text-decoration: underline;\"><strong>Vision Statement</strong></span></div>\r\n<div style=\"color: #171717; font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: center; background-color: #c6a152;\">&nbsp;</div>\r\n<div style=\"color: #171717; font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: center; background-color: #c6a152;\">&nbsp;</div>\r\n<div style=\"color: #171717; font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: center; background-color: #c6a152;\"><span style=\"color: #222245; font-family: georgia; font-size: 14pt;\">At Deborah Ross Ministries (DRM), Inc., our vision is to open God\'s Word to all that have ears to hear. We are an evangelistic ministry committed to delivering messages of faith, hope and love that transcend cultural, generational, and denominational boundaries. Simply said, DRM is on a mission to \"Strengthen Families; Encourage Faith; and Preach the Gospel.\"<br /><br />We believe that God wants individuals and families made whole through salvation in His Son, Jesus Christ. More specifically, we believe that God\'s word has the power to: Restore Families and Broken Relationships; Prevent Divorce; Break Bondage\'s of Addiction; Reverse the Curse of Poverty; Heal the Sick; Lead God\'s Children Out of Worldly Mundane Lifestyles; Deliver Emotional and Spiritual Healing; and Give Life Eternal!<br /><br />By illuminating scriptures that teach life transforming principles and by imparting an atmosphere of faith that cultivates fertile ground for miracles, Deborah Ross Ministries, Inc., and its Remnant supporters boldly proclaim God\'s promises to the nations!</span></div>\r\n<div style=\"color: #171717; font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: center; background-color: #c6a152;\">&nbsp;</div>','P.O. Box 2186','Indian Trail','No','28079','United States','Faith-Based','http://www.DeborahRossMinistries.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
