INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (3696,'House of Blues Music Forward Foundation','<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;\">We\r\nbelieve in youth. And we believe in music. We bring music into the lives of\r\nyoung people to build skills that increase their confidence, character, and\r\nconnection to the world around them. Founded\r\nin 1993 as an independent nonprofit organization, we are dedicated to fostering\r\nunity and creating opportunity for youth through music. </span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;; mso-bidi-font-weight: bold;\">&nbsp;</span></p>\r\n<p></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;; mso-bidi-font-weight: bold;\">By working with partners in all of our House of\r\nBlues communities, we </span><span style=\"font-size: 11.0pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;\">educate\r\nyouth about the role of music in cultural/social change; invest in music\r\neducation; create performance opportunities for emerging musicians; and inspire\r\nyoung people with practical experience in the music industry. &nbsp;</span></p>','7060 Hollywood Blvd, Floor 2','Los Angeles','Ca','90028','United States','Art, Youth Services','http://www.hobmusicforward.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
