INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (3706,'University Settlement','<p style=\"box-sizing: border-box; margin: 0px 0px 1.313em; color: #7a7a7a; font-family: Lato, \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 16px; line-height: 27.2000007629395px;\">University Settlement is a neighborhood center that provides social services to residents of the Broadway-Slavic Village neighborhood in southeast Cleveland. Headquartered at 4800 Broadway Avenue, the agency operates three facilities and hosts 10 major programs that serve children, families, and seniors.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 1.313em; color: #7a7a7a; font-family: Lato, \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 16px; line-height: 27.2000007629395px;\">The mission of University Settlement is to foster strong and independent individuals and families by providing innovative, valued, and collaborative services that meet the evolving needs of the Broadway-Slavic Village community.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 1.313em; color: #7a7a7a; font-family: Lato, \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 16px; line-height: 27.2000007629395px;\">This mission is guided by the following principles:</p>\r\n<p style=\"box-sizing: border-box; margin: 0px; color: #7a7a7a; font-family: Lato, \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 16px; line-height: 27.2000007629395px;\">&bull; A community-centric orientation to our programs and services<br style=\"box-sizing: border-box;\" />&bull; Having our &ldquo;feet in the street&rdquo; to encourage authentic community engagement and on-going community dialogue<br style=\"box-sizing: border-box;\" />&bull; Aligning our programs and services to address current and pressing community needs and being nimble so as to be able to adjust our offerings in line with evolving community needs<br style=\"box-sizing: border-box;\" />&bull; Building our visibility in the community to be as accessible as possible to those we strive to partner with and serve<br style=\"box-sizing: border-box;\" />&bull; Operating with a collaborative spirit</p>','4800 Broadway Ave','Cleveland','Oh','44127','United States','Multi-Service Community Agency, Social Services, Youth Services','http://www.universitysettlement.net','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
