INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (3777,'UCPLA','<p><span style=\"font-family: Times New Roman; font-size: small;\"> </span></p>\r\n<p style=\"margin: 0in 0in 0pt; text-align: justify;\"><span style=\"color: black; font-family: &quot;Times New Roman&quot;,serif;\"><span style=\"font-size: small;\">UCP of Los Angeles, Ventura and Santa Barbara Counties (UCPLA)\r\noffers over 40 programs and services in five counties, ranging from residential\r\nand day programs to advocacy and family support services. These include adult\r\nday activity and learning centers; affordable, accessible apartments,\r\naccompanied by supported living counselors; group homes with full activities\r\nand nursing staff; children&rsquo;s programs; advocacy; and&nbsp;</span><strong><span style=\"font-size: small;\">RESPITALITY</span></strong><span style=\"font-size: small;\">,\r\ngiving parents a much needed break. By adding&nbsp;</span><strong><span style=\"font-size: small;\">UCP WORK, Inc.</span></strong><span style=\"font-size: small;\">&nbsp;to\r\nour family in 2001, UCPLA&rsquo;s services expanded into Santa Barbara County. Then\r\nwith the addition of&nbsp;</span><strong><span style=\"font-size: small;\">UCP Wheels for Humanity</span></strong><span style=\"font-size: small;\">&nbsp;in 2007, UCPLA&rsquo;s\r\nimpact was elevated to a global level.</span></span></p>\r\n<p><span style=\"font-family: Times New Roman; font-size: small;\"> </span></p>\r\n<p style=\"margin: 0in 0in 0pt; text-align: justify;\"><span style=\"color: black; font-family: &quot;Times New Roman&quot;,serif;\"><span style=\"font-size: small;\">&nbsp;</span></span></p>\r\n<p><span style=\"font-family: Times New Roman; font-size: small;\"> </span></p>\r\n<p style=\"margin: 0in 0in 0pt; text-align: justify;\">&nbsp;</p>\r\n<p><span style=\"color: black; font-family: &quot;Times New Roman&quot;,serif;\">\r\n<p style=\"margin: 0in 0in 0pt; text-align: justify;\">&nbsp;</p>\r\n<span style=\"font-size: small;\">\r\n<p style=\"margin: 0in 0in 0pt; text-align: justify;\">UCPLA has an annual global budget of $43 mill and is one of the\r\nlargest organizations in California serving individuals with all developmental\r\ndisabilities.</p>\r\n<p style=\"margin: 0in 0in 0pt; text-align: justify;\">&nbsp;</p>\r\n<p style=\"margin: 0in 0in 0pt; text-align: justify;\"><strong><span style=\"text-decoration: underline;\"><span style=\"color: #262626; font-family: &quot;Times New Roman&quot;,serif;\">Chief Operating Officer Job Summary:</span></span></strong></p>\r\n<p style=\"margin: 0in 0in 0pt; text-align: justify;\"><span style=\"color: #262626; font-family: &quot;Times New Roman&quot;,serif; font-size: 12pt; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-fareast-theme-font: minor-fareast; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Provides\r\nthe leadership, management, and vision necessary to ensure the organization has\r\nthe proper operational controls, administrative, and reporting procedures, and\r\npeople systems in place to effectively grow the agency and to ensure financial\r\nstrength and operating efficiency.&nbsp; Directly responsible to the Chief\r\nExecutive Officer for overseeing the administration and day-to-day operation of\r\nfour (4) adult day programs, twenty-one (21) group homes, and CLS/ILS/SLS\r\nprograms and the services provided at each per licensing regulations and best\r\npractices.&nbsp; Provides direct supervision, training, and development to\r\nDirectors of Client Services and Human Resources. The position accomplishes\r\nthis through a respectful, constructive, and energetic style, guided by the\r\nobjectives of the organization</span></p>\r\n</span>\r\n<p style=\"margin: 0in 0in 0pt; text-align: justify;\">&nbsp;</p>\r\n</span></p>\r\n<p style=\"margin: 0in 0in 0pt; text-align: justify;\">&nbsp;</p>\r\n<p style=\"margin: 0in 0in 0pt; text-align: justify;\">&nbsp;</p>\r\n<p style=\"margin: 0in 0in 0pt; text-align: justify;\">&nbsp;</p>\r\n<p><span style=\"font-family: Times New Roman; font-size: small;\"> </span></p>','6430 Independence Ave','Woodland Hills','Ca','91367','United States','Disability Issues','','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
