INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (3835,'Homeownership Preservation Foundation','<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-bottom: .0001pt; mso-add-space: auto; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">&middot;<span style=\"font-stretch: normal; font-size: 7pt; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]-->The Homeownership Preservation Foundation was\r\nestablished in 2003, is a national nonprofit organization dedicated to reducing\r\nforeclosures and preserving homeownership.</p>\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-bottom: .0001pt; mso-add-space: auto; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">&middot;<span style=\"font-stretch: normal; font-size: 7pt; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]-->HPF cornerstone service is the Homeowner&rsquo;s HOPE\r\nHotline, 888-995-HOPE &ndash; which is a key component of the outreach and assistance\r\neffort for at-risk homeowners.&nbsp;</p>','7645 Lyndale Av S, Ste 250','Minneapolis','Mi','55423','United States','Affordable Housing, Housing','http://www.995hope.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
