INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (4036,'Neighborhood Bike Works','<p><strong>MISSION</strong></p>\r\n<p>The mission of <strong><a href=\"http://www.neighborhoodbikeworks.org/\" target=\"_blank\">Neighborhood Bike Works</a></strong> is to inspire youth and strengthen Philadelphia communities by providing equitable access to bicycling and bike repair through education, recreation, leadership and career-building opportunities.</p>\r\n<p><strong>OUR WORK</strong></p>\r\n<p>We run a suite of youth and adult programs all designed to encourage more people to ride and maintain their bikes. Our work uses bikes to bring about positive change: personal growth, community building, and learning. To learn more about our youth programs, check out our <a href=\"http://www.neighborhoodbikeworks.org/youth-programs\" target=\"_blank\">Youth Programs</a> page.</p>\r\n<p>In addition to running year-round programs for youth, NBW also opens its space to adults and families. At our <a href=\"http://www.neighborhoodbikeworks.org/bike-shop\" target=\"_blank\">Community Bike Shop</a>, we sell quality refurbished used bikes, new parts, and accessories. You can stop into the Community Bike Shop to test ride a refurbished bike or grab a new lock, helmet, or another accessory.</p>\r\n<p>For lifelong learners, we run Bike Church, a DIY bike shop and an Adult Bike Repair Class. To learn more about these programs, check out our <a href=\"http://www.neighborhoodbikeworks.org/adult-programs/bike-church\" target=\"_blank\">Bike Church</a> and <a href=\"http://www.neighborhoodbikeworks.org/adult-programs/adult-bike-repair\" target=\"_blank\">Adult Bike Repair Class</a> pages.</p>\r\n<p>All sales in our shop support our free and low-cost programs.</p>','3943 Lancaster Ave.','Philadelphia','Pe','19104','United States','Children and Youth, Conservation, Energy Conservation and Green Living, Environment and Ecology, Sports, Recreation, and Leisure, Travel and Transportation, Youth Services','http://www.neighborhoodbikeworks.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
