INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (4086,'SAGA Innovations','<p class=\"MsoNormal\"><span class=\"textexposedshow\"><span style=\"font-size: 12pt; font-family: Arial, sans-serif; color: #141823; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">SAGA Innovations\r\nis a nonprofit organization dedicated to transforming\r\nAmerican public education. SAGA drives the expansion of the nationally\r\nrecognized innovation of high-dosage, intensive daily tutoring, where tutoring\r\nis a part of the regular school day for students as a scheduled class period.\r\nWe partner with district public schools to provide students the opportunity to\r\nwork with a qualified, engaging tutor who tailors instruction to the needs of\r\ntwo students at a time.</span></span></p>\r\n<p></p>\r\n<p class=\"MsoNormal\"><span class=\"textexposedshow\"><span style=\"font-size: 12pt; font-family: Arial, sans-serif; color: #141823; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">Our objective\r\nisn\'t just to change the lives of students, but to transform American public\r\neducation.</span></span></p>','10 Laudhold Road','Newton','Ma','2458','United States','Children and Youth, Education and Academia, Other Service Organization, Service Learning, Service Organization, Social Services, Teaching, Youth Services','http://www.sagainnovations.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
