INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (4144,'Rape Victim Advocates','<div class=\"et_pb_text et_pb_bg_layout_light et_pb_text_align_left\" style=\"-webkit-font-smoothing: antialiased; margin: 0px 0px 15px; padding: 0px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; width: auto; color: #5d5d5d; font-family: Georgia, times, serif; line-height: 28px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">\r\n<h2 style=\"-webkit-font-smoothing: antialiased; margin: 10px 0px 15px; padding: 0px; border: 0px; outline: 0px; font-size: 32px; vertical-align: baseline; color: #1e1e1e; line-height: 1.125; font-weight: 400; font-family: proxima-nova, Helvetica, Arial, Lucida, sans-serif; background: transparent;\">Mission</h2>\r\n<p style=\"-webkit-font-smoothing: antialiased; margin: 0px 0px 22px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; line-height: 1.7em; background: transparent;\">Rape Victim Advocates (RVA) is an independent, not-for-profit organization dedicated to the healing and empowerment of sexual assault survivors through non-judgmental crisis intervention counseling, individual and group counseling, and medical and legal advocacy in the greater Chicago metropolitan area.</p>\r\n<p style=\"-webkit-font-smoothing: antialiased; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; line-height: 1.7em; background: transparent;\">RVA provides public education and institutional advocacy in order to improve the treatment of sexual assault survivors and to effect positive change in policies and public attitudes toward sexual assault.</p>\r\n</div>\r\n<div class=\"et_pb_text et_pb_bg_layout_light et_pb_text_align_left\" style=\"-webkit-font-smoothing: antialiased; margin: 0px 0px 15px; padding: 0px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; width: auto; color: #5d5d5d; font-family: Georgia, times, serif; line-height: 28px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">\r\n<h2 style=\"-webkit-font-smoothing: antialiased; margin: 10px 0px 15px; padding: 0px; border: 0px; outline: 0px; font-size: 32px; vertical-align: baseline; color: #1e1e1e; line-height: 1.125; font-weight: 400; font-family: proxima-nova, Helvetica, Arial, Lucida, sans-serif; background: transparent;\">Vision</h2>\r\n<p style=\"-webkit-font-smoothing: antialiased; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; line-height: 1.7em; background: transparent;\">RVA envisions a world where prevention efforts and global awareness of sexual violence expose rape myths, remove stigmas, eliminate rape and support all people as equal members of society.</p>\r\n</div>\r\n<div class=\"et_pb_text et_pb_bg_layout_light et_pb_text_align_left\" style=\"-webkit-font-smoothing: antialiased; margin: 0px 0px 15px; padding: 0px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; width: auto; color: #5d5d5d; font-family: Georgia, times, serif; line-height: 28px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">\r\n<h2 style=\"-webkit-font-smoothing: antialiased; margin: 10px 0px 15px; padding: 0px; border: 0px; outline: 0px; font-size: 32px; vertical-align: baseline; color: #1e1e1e; line-height: 1.125; font-weight: 400; font-family: proxima-nova, Helvetica, Arial, Lucida, sans-serif; background: transparent;\">Values</h2>\r\n<p style=\"-webkit-font-smoothing: antialiased; margin: 0px 0px 22px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; line-height: 1.7em; background: transparent;\">As we continue to work on the behalf of the survivors of sexual assault, we, the board and staff of Rape Victim Advocates are committed to:</p>\r\n<ul style=\"-webkit-font-smoothing: antialiased; margin: 0px; padding: 0px 0px 23px 16px; border: 0px; outline: 0px; vertical-align: baseline; line-height: 26px; background: transparent;\">\r\n<li style=\"-webkit-font-smoothing: antialiased; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\">Providing consistent, comprehensive and victim-centered services which address the needs of the populations we serve</li>\r\n<li style=\"-webkit-font-smoothing: antialiased; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\">Promoting a healthy, stable, and financially diverse workplace that encourages and supports staff</li>\r\n<li style=\"-webkit-font-smoothing: antialiased; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\">Working with marginalized and disempowered communities</li>\r\n<li style=\"-webkit-font-smoothing: antialiased; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\">Demanding accountability for individuals and institutions who have a responsibility to serve the community</li>\r\n<li style=\"-webkit-font-smoothing: antialiased; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\">Promoting prevention efforts to de-stigmatize and de-mythify sexual violence</li>\r\n<li style=\"-webkit-font-smoothing: antialiased; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\">Strive to support each person involved in this movement and to understand intersections of all oppressions and how they contribute to a rape culture.</li>\r\n</ul>\r\n</div>','Rape Victim Advocates','Chicago','Il','60601','United States','Community Organizing / Advocacy, Community Service and Volunteering, Crime, Safety, and Victims Issues, Law and Legal Assistance, Legal Services, LGBTQ, Mens Issues, Mental Health, Multi-Service Community Agency, Sexual Abuse Support Services, Social Services, Victim Support Services, Women\'s Issues, Youth Services','http://www.rapevictimadvocates.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
