INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (4190,'Defy Ventures','<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt;\"><span style=\"font-family: \'Times New Roman\', serif;\">Defy Ventures is an\r\nentrepreneurship, employment and leadership training program and start-up\r\nincubator for people with criminal histories. Our mission is to transform the\r\nlives of business leaders and people with criminal histories through their\r\ncollaboration along the entrepreneurial journey. Defy leverages the innate\r\nentrepreneurial talents of former drug dealers and gang leaders to create new\r\nlegal, profitable business ventures and careers. Key to our success is the\r\nmeaningful engagement of 3,000+ private sector leaders as mentors. As a result,\r\nDefy&rsquo;s entrepreneurs-in-training (&ldquo;EITs&rdquo;)&mdash;who carry the stigma of being amongst\r\nAmerica&rsquo;s &ldquo;biggest failures&rdquo;&mdash;are now </span><em style=\"font-family: \'Times New Roman\', serif;\">defying\r\nthe odds</em><span style=\"font-family: \'Times New Roman\', serif;\"> as inspirational businesspeople, parents, and community leaders.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt;\">&nbsp;</p>','901 Mission St.','San Francisco','Ca','94103','United States','Economic Development, Entrepreneurship, Prison Reform','','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
