INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (4233,'Catholic Big Sisters and Big Brothers','<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: arial; font-size: x-small;\">Since 1902, the mission of the Catholic Big\r\nSisters and Big Brothers has been to address the challenges facing youth living\r\nin New York City&rsquo;s low-income neighborhoods by providing one-to-one community\r\nbased mentoring services, supported by family counseling and skill learning\r\nprograms.&nbsp; We seek to improve the lives\r\nof children of all faiths, empowering them to recognize, reach for and achieve\r\ntheir full potential as self-sufficient adults.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: arial; font-size: x-small;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"text-decoration: underline;\"><span style=\"font-family: arial; font-size: x-small;\">Vision </span></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: arial; font-size: x-small;\">We envision a strong and growing Catholic Big\r\nSisters and Big Brothers where all our Littles graduate from high school and\r\ncontinue on to college or some other form of post high school education or\r\ncareer training. After successfully graduating from college, they embark on\r\nsuccessful careers and become purposeful, contributing and compassionate adults\r\nand remain connected to the agency by becoming mentors, donors, advisors, and\r\nactive members of the alumni association.</span></p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left: 0in; text-align: justify;\"><span style=\"font-family: arial; font-size: x-small;\">&nbsp;</span></p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left: 0in; text-align: justify;\"><span style=\"font-family: arial; font-size: x-small;\">We further envision CBSBB as an agency\r\nwith a strong, clear, cohesive&nbsp; organizational\r\nculture in which all stakeholders (Board, staff, Littles, Bigs and family\r\nmembers) share a common understanding of our mission, vision and core values\r\nand can, in their own words,&nbsp; articulate\r\nour mission, vision, values&nbsp; and what\r\nmakes us unique as a mentoring organization. We see a CBSBB known throughout\r\nNew York as a model program; a place where individuals, policy makers,\r\nfoundations and other agencies visit when they want to learn how to do\r\nmentoring at its most effective.&nbsp; </span></p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left: 0in; text-align: justify;\"><span style=\"font-family: arial; font-size: x-small;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"text-decoration: underline;\"><span style=\"font-family: arial; font-size: x-small;\">Values </span></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: arial; font-size: x-small;\">We believe that all our decisions should\r\npositively impact the holistic growth of our Littles.&nbsp; Within this context:</span></p>\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-bottom: 10.0pt; mso-add-space: auto; text-indent: -.25in; line-height: 115%; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: arial; font-size: x-small;\"><span style=\"line-height: 115%;\">&middot;<span style=\"font-stretch: normal; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><strong><span style=\"text-decoration: underline;\"><span style=\"line-height: 115%;\">we value</span></span></strong><span style=\"line-height: 115%;\"> the transformative power of long-term,\r\ncommunity-based mentoring relationships between a Big and a Little.</span></span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom: 10.0pt; mso-add-space: auto; text-indent: -.25in; line-height: 115%; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: arial; font-size: x-small;\"><span style=\"line-height: 115%;\">&middot;<span style=\"font-stretch: normal; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><strong><span style=\"text-decoration: underline;\"><span style=\"line-height: 115%;\">we value</span></span></strong><span style=\"line-height: 115%;\"> the necessity of partnering with\r\nfamilies who are instrumental in understanding our Littles and in fostering\r\ninterdependent relationships.</span></span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom: 10.0pt; mso-add-space: auto; text-indent: -.25in; line-height: 115%; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: arial; font-size: x-small;\"><span style=\"line-height: 115%;\">&middot;<span style=\"font-stretch: normal; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><strong><span style=\"text-decoration: underline;\"><span style=\"line-height: 115%;\">we value</span></span></strong><span style=\"line-height: 115%;\"> acquiring skills that lead to success\r\nin all areas of our lives, and view learning as a continuous, lifelong pursuit.</span></span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom: 10.0pt; mso-add-space: auto; text-indent: -.25in; line-height: 115%; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: arial; font-size: x-small;\"><span style=\"line-height: 115%;\">&middot;<span style=\"font-stretch: normal; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><strong><span style=\"text-decoration: underline;\"><span style=\"line-height: 115%;\">we value</span></span></strong><span style=\"line-height: 115%;\"> promoting equality through\r\nself-reflection, open dialogue, and understanding difference in order to uphold\r\nthe dignity and worth of all individuals.</span></span></p>\r\n<p></p>\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-bottom: 10.0pt; mso-add-space: auto; text-indent: -.25in; line-height: 115%; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: arial; font-size: x-small;\"><span style=\"line-height: 115%;\">&middot;<span style=\"font-stretch: normal; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><strong><span style=\"text-decoration: underline;\"><span style=\"line-height: 115%;\">we value</span></span></strong><span style=\"line-height: 115%;\"> an organiz</span></span><span style=\"line-height: 115%;\"><span style=\"font-family: arial; font-size: x-small;\">ation built on trust,\r\ntransparency and integrity where all voices are encouraged, listened to, and\r\nappreciated.</span><span style=\"font-family: Helvetica, sans-serif;\"></span></span></p>','137 East 2nd Street, 2nd Floor','New York','Ne','10009','United States','Children and Youth, Family and Parenting, Parent Organization, Youth Services','http://www.cbsbb.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
