INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (4410,'Salem Art Association','<p>\r\n<h1 class=\"entry-title\" style=\"border: 0px; margin: 0px 0px 0.1em; outline: 0px; padding: 0px 40px 0.1em 0px; vertical-align: baseline; word-wrap: break-word; font-size: 18px; clear: both; background: transparent;\">About SAA</h1>\r\n</p>\r\n<div class=\"entry-content cf\" style=\"border: 0px; margin: 0px; outline: 0px; padding: 1.625em 0px 0px; vertical-align: baseline; word-wrap: break-word; zoom: 1; color: #444444; font-family: \'Helvetica Neue\', Helvetica, sans-serif; font-size: 13.3000001907349px; line-height: 19.9500007629395px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">\r\n<h3 style=\"border: 0px; margin: 0px 0px 0.7em; outline: 0px; padding: 0px; vertical-align: baseline; word-wrap: break-word; clear: both; background: transparent;\">Mission</h3>\r\n<p style=\"border: 0px; margin: 0px 0px 1.5em; outline: 0px; padding: 0px; vertical-align: baseline; word-wrap: break-word; background: transparent;\">The mission of the Salem Art Association is to&nbsp;actively engage the community in the appreciation of the arts through contemporary art exhibitions and events, arts education for youth and adults, and the preservation and interpretation of our shared cultural heritage.</p>\r\n<h3 style=\"border: 0px; margin: 0px 0px 0.7em; outline: 0px; padding: 0px; vertical-align: baseline; word-wrap: break-word; clear: both; background: transparent;\">Vision</h3>\r\n<p style=\"border: 0px; margin: 0px 0px 1.5em; outline: 0px; padding: 0px; vertical-align: baseline; word-wrap: break-word; background: transparent;\">The Salem Art Association (SAA) envisions a vibrant and connected community that harnesses the power of the arts and heritage to expand creativity and improve lives.</p>\r\n</div>','600 Mission Street SE','Salem','Or','97302','United States','Art','http://salemart.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
