INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (4449,'Palos Verdes Peninsula Land Conservancy','<p style=\"margin: 5px 0px 10px; padding: 0px; line-height: 1.5; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 12px; color: #9a6533; background-color: #e1ebf5;\"><strong>The mission of the Palos Verdes Peninsula Land Conservancy (PVPLC) is to \"<em>preserve land and restore habitat for the education and enjoyment of all</em>.\"</strong></p>\r\n<p style=\"margin: 5px 0px 10px; padding: 0px; line-height: 1.5; color: #525252; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 12px; background-color: #e1ebf5;\">The Conservancy preserves undeveloped land as open space for historical, educational, ecological, recreational and scenic purposes. Since its founding in 1988, the Conservancy has successfully preserved 1,600 acres of open space on the Palos Verdes Peninsula.</p>\r\n<p style=\"margin: 5px 0px 10px; padding: 0px; line-height: 1.5; color: #525252; font-family: Verdana, Geneva, Arial, Helvetica, sans-serif; font-size: 12px; background-color: #e1ebf5;\">The Conservancy\'s vision is the creation and management of large blocks of natural open space where visitors may enjoy peaceful solitude, where children and adults can learn about the natural environment, and where native plants and animals can thrive.</p>','916 Silver Spur Rd.','Rolling Hills Estates','Ca','90274','United States','Conservation, Environment and Ecology','http://www.pvplc.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
