INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (4556,'Rogerson Communities','<p><span style=\"font-family: Times New Roman; font-size: small;\"> </span><span style=\"font-family: &quot;Gill Sans MT&quot;,&quot;sans-serif&quot;; font-size: 12pt; font-weight: normal;\"><br /> </span><span style=\"font-family: &quot;Gill Sans MT&quot;,&quot;sans-serif&quot;; font-size: 12pt;\"><strong>About\r\nRogerson Communities:</strong></span><span style=\"font-family: &quot;Gill Sans MT&quot;,&quot;sans-serif&quot;; font-size: 12pt; font-weight: normal;\"><br /> With over 150 years of experience, Rogerson<a name=\"_GoBack\"></a> Communities </span><span style=\"background: white; font-family: &quot;Gill Sans MT&quot;,&quot;sans-serif&quot;; font-size: 12pt; font-weight: normal; mso-bidi-font-family: Arial;\">has grown to provide a network of\r\ninnovative, accessible, affordable housing and services for elders, persons\r\nwith disabilities, and the working poor in the Greater Boston area. </span><span style=\"font-family: &quot;Gill Sans MT&quot;,&quot;sans-serif&quot;; font-size: 12pt; font-weight: normal;\"><span style=\"mso-spacerun: yes;\">&nbsp;</span>This is an opportunity to join a\r\nteam that pioneered Adult Day Health programs that support elderly and\r\nlow-income men and women by enhancing dignity, self-reliance and vitality.\r\nRogerson Communities is committed to providing the people it serves the highest\r\nquality of care and is looking for individuals who share this vision.</span><span style=\"font-family: &quot;Gill Sans MT&quot;,&quot;sans-serif&quot;; font-size: 12pt;\"><strong> <br /> <br /> </strong></span></p>\r\n<p><span style=\"font-family: Times New Roman; font-size: small;\"> </span></p>','1 Florence Street','Roslindale','Ma','2131','United States','Affordable Housing','http://rogerson.org/','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
