INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (4588,'Carlisa, Inc.','<p>Carlisa Inc. is a 501c3 non-profit food organization that&rsquo;s been feeding the hungry and needy in America from 2002. Lisa Eleze Thomas Mc-Millan, founder of Carlisa Inc. was personally a victim of hunger all through her student life and knew how divine it felt like when one shared their food and blessings with another. And it was 1995 when she vowed to herself that &lsquo;nobody should ever have to worry about having enough to eat&rsquo; thereafter. Lisa started her community service in her hometown Brewton, Al by preparing and delivering hot lunches for the elderly and the disabled. As she became more aware of the hunger crisis that prevailed in society, she also started a Rolling Grocery Store on her van and delivered essential groceries and vegetables to people who couldn&rsquo;t afford them. She also started offering a free feeding program in her restaurant and started Brewton&rsquo;s first Thanksgiving Day and Christmas Day dinners. Then came into existence, Carlisa Inc. in 2002, a non-profit food bank, in fact Brewton&rsquo;s first food bank to be open to the public seven days a week. Along with feeding the senior and disabled citizens of Brewton, Carlisa Inc. also provides hot lunches for students in college campuses of major American universities including the Jefferson Davis Community College four days a week. To know more about our non-profit food bank and to make donations, visit <a href=\"http://www.pleasebelievepeoplearehungry.com/\">http://www.pleasebelievepeoplearehungry.com/</a> and <a href=\"http://www.pleasebelievepeoplearehungry.com/blog/\">http://www.pleasebelievepeoplearehungry.com/blog/</a>.</p>','1198 Old Castleberry Road','Brewton','Al','36426','United States','Poverty and Hunger','http://www.pleasebelievepeoplearehungry.com/','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
