INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (4674,'The Center for Arts Education','<p>The Center for Arts Education (CAE) is committed to ensuring that \r\nevery child in every New York City public school has equal access to a \r\nwell-rounded education of which the arts are a central component.</p>\r\n<p>We work to achieve this mission through school and community \r\nprograms, professional development, parent engagement, and advocacy.&nbsp;</p>\r\n<p>CAE offers a comprehensive platform that includes model programs in \r\nall arts disciplines, professional research, and policy recommendations \r\nthat inform the conversation about arts education at every level from \r\nthe classroom to the Capitol.</p>','266 W. 37th Street ','New York','Ne','10018','United States','Art, Children and Youth, Education and Academia','http://centerforartsed.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
