INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (4739,'Traveling Stories','<p style=\"font-family: Nunito; font-size: 18px; line-height: 28.8px; margin: 0px 0px 1em 0.5in; color: #777777;\">We are Traveling Stories, a 501c3 nonprofit organization that specializes in creating experiences where families fall in love with reading!&nbsp;</p>\r\n<p style=\"font-family: Nunito; font-size: 18px; line-height: 28.8px; margin: 0px 0px 1em 0.5in; color: #777777;\">We believe books are a necessity, not a luxury, and that strong literacy skills are the most empowering gift we can give someone. &nbsp;Our StoryTent programs deliver a sustainable, family-focused solution for improving literacy rates before the 4th grade.</p>\r\n<p style=\"font-family: Nunito; font-size: 18px; line-height: 28.8px; margin: 0px 0px 1em 0.5in; color: #777777;\">We cultivate a joy of learning, and a sense that reading is pleasurable. We are experts at making reading fun!</p>','1761 Hotel Circle South, Suite 225','San Diego','Ca','92108','United States','Education and Academia','http://travelingstories.org/','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
