INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (4788,'The Tandana Foundation','<p>The Tandana Foundation is a non-profit organization that offers intercultural volunteer opportunities, scholarships, and support for small community projects in highland Ecuador and Mali\'s Dogon Country. &nbsp;Tandana coordinates volunteer programs that offer visitors to Ecuador or Mali the unique opportunity to be guests rather than tourists, to form intercultural friendships, to experience a rich indigenous culture, and to make a difference in the lives of new friends. &nbsp;Its scholarship program allows rural Ecuadorian students to continue their secondary and higher education. &nbsp;Its community projects support villagers in Mali and Ecuador as they realize their dreams of improving their communities. &nbsp;</p>\r\n<p>The Tandana Foundation is not about \"helping the poor unfortunates\" or imposing a developmentalist worldview or any particular religion. &nbsp;Rather, our goal is to create and nurture real and responsible relationships among people of different cultures. &nbsp;Giving and receiving are inherent parts of those relationships, and contributing to community projects is a great way to make friends. &nbsp;Any foreigner who has worked in an Ecuadorian minga (community work day) knows how that works on the ground! &nbsp;We come to learn and to share.</p>\r\n<p>Tandana comes from a Kichwa root meaning \"to gather together\" or \"to unite\" and represents the spirit of our work. &nbsp;\"Tandana is to unite together, be together, struggle together. This is what you have done and what you are doing. &nbsp;Tandana is not a sleeping word or a dead word. &nbsp;It is a living word,\" explained our friend Matias Perugachi.</p>\r\n<p>The Tandana Foundation has no religious or political affiliation, and we welcome all to participate in a spirit of respect and joining together. &nbsp;Tantanakushunshik, as we say in Ecuador.</p>\r\n<div><br /></div>','2933 Lower Bellbrook Rd','Spring Valley','Oh','45370','United States','Community Building and Renewal, Environment and Ecology, Health and Medicine, Higher Education, International Relations, Social Enterprise and Economic Development','http://www.tandanafoundation.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
