INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (4818,'LA Community Outreach Center','<p><span class=\"rvts16\"><span>LACOC needs your help to help us help others in the community and in the surrounding areas. your donations are what make LACOC a resource to those who have little resouces to get the things they are in need of.&nbsp;</span></span><span>Any donation be&nbsp;it clothing, food, monetary or perhaps in-kind donations would be greatly appreciated by LACOC and by those who look to us for a helping hand. we truly appreciate any assistance you have to offer with great&nbsp;gratitude. Be blessed&nbsp;</span></p>\r\n<p><span>please call us for more infomation 323-755-7800&nbsp;</span><span class=\"rvts16\"><strong><em><span><span><span>ALL DONATIONS ARE TAX DEDUCTABLE</span></span></span></em></strong></span></p>','10121 S VERMONT AVE','Los Angeles','Ca','90044','','Homelessness','','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
