INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (4822,'Alliance of the SouthEast (ASE)','<p style=\"border: 0px; font-family: arimo-1, arimo-2, sans-serif; font-size: 15px; margin: 0px 0px 1.625em; outline: 0px; padding: 0px; vertical-align: baseline; color: #373737; line-height: 24.375px;\">ASE builds the capacity of leaders, organizers, and associations that carry out community and social change. We envision a powerful grassroots base that impacts decision makers and wins real improvements in our neighborhoods.</p>\r\n<p style=\"border: 0px; font-family: arimo-1, arimo-2, sans-serif; font-size: 15px; margin: 0px 0px 1.625em; outline: 0px; padding: 0px; vertical-align: baseline; color: #373737; line-height: 24.375px;\"><span style=\"font-family: inherit; font-size: medium; font-style: inherit; font-weight: inherit;\">ASE carries out this mission by:</span></p>\r\n<p style=\"border: 0px; font-family: arimo-1, arimo-2, sans-serif; font-size: 15px; margin: 0px 0px 1.625em; outline: 0px; padding: 0px; vertical-align: baseline; color: #373737; line-height: 24.375px;\"><span style=\"font-family: inherit; font-size: medium; font-style: inherit; font-weight: inherit;\">*Building a strong alliance of active faith-based institutions, community organizations, schools, businesses, and individuals</span></p>\r\n<p style=\"border: 0px; font-family: arimo-1, arimo-2, sans-serif; font-size: 15px; margin: 0px 0px 1.625em; outline: 0px; padding: 0px; vertical-align: baseline; color: #373737; line-height: 24.375px;\"><span style=\"border: 0px; font-family: inherit; font-size: medium; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">*Hosting listening sessions to ensure that issues of concern to constituents are campaigns that are prioritized</span></p>\r\n<p style=\"border: 0px; font-family: arimo-1, arimo-2, sans-serif; font-size: 15px; margin: 0px 0px 1.625em; outline: 0px; padding: 0px; vertical-align: baseline; color: #373737; line-height: 24.375px;\"><span style=\"border: 0px; font-family: inherit; font-size: medium; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">*Establishing the leadership skills necessary for members to take power for themselves</span></p>\r\n<p style=\"border: 0px; font-family: arimo-1, arimo-2, sans-serif; font-size: 15px; margin: 0px 0px 1.625em; outline: 0px; padding: 0px; vertical-align: baseline; color: #373737; line-height: 24.375px;\"><span style=\"border: 0px; font-family: inherit; font-size: medium; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">*Giving members the tools and support necessary to win&nbsp;projects that they build and lead from start to finish</span></p>\r\n<p style=\"border: 0px; font-family: arimo-1, arimo-2, sans-serif; font-size: 15px; margin: 0px 0px 1.625em; outline: 0px; padding: 0px; vertical-align: baseline; color: #373737; line-height: 24.375px;\"><span style=\"border: 0px; font-family: inherit; font-size: medium; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">*Partnering with organizations in other regions and participating in city-wide&nbsp;events that are relevant to our cause</span></p>','9204 S Commercial Ave, Ste 301','Chicago','Il','60617','United States','Community Organizing / Advocacy','http://www.asechicago.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
