INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (4875,'Della\'s House of Giving','<h2 style=\"box-sizing: border-box; color: #a91e22; margin: 0em 0px 1.1em; font-family: Oswald, Arial, Helvetica, sans-serif; font-weight: 400; font-size: 23px; line-height: 27px;\">OUR MISSION IS TO REDUCE HUNGER AND TO INCREASE LITERACY RATES AMONG CHILDREN.</h2>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; color: #0a0a0a; font-family: \'PT Sans\', Arial, Helvetica, sans-serif; font-size: 16px; line-height: 20px;\">&nbsp;<span style=\"color: #00518c; font-family: Oswald, Arial, Helvetica, sans-serif; font-size: 23px; line-height: 27px;\">FACTS</span></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; color: #0a0a0a; font-family: \'PT Sans\', Arial, Helvetica, sans-serif; font-size: 16px; line-height: 20px;\">&bull; 15.8 million children lived in food-insecure households in 2013<br style=\"box-sizing: border-box;\" />&bull;&nbsp;Students who do not read proficiently by the 3rd&nbsp;grade are 4 time more likely to drop out of school</p>\r\n<h2 style=\"box-sizing: border-box; color: #a91e22; margin: 0em 0px 1.1em; font-family: Oswald, Arial, Helvetica, sans-serif; font-weight: 400; font-size: 23px; line-height: 27px;\"><span style=\"box-sizing: border-box; color: #00518c;\">HELP US HELP CHILDREN</span></h2>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; color: #0a0a0a; font-family: \'PT Sans\', Arial, Helvetica, sans-serif; font-size: 16px; line-height: 20px;\">1 in 5 children go to bed hungry and 1 in 4 children in America grow up without learning how to read. Your donation helps us to help children who are in desperate need of food and reading resources.</p>\r\n<h2 style=\"box-sizing: border-box; color: #a91e22; margin: 0em 0px 1.1em; font-family: Oswald, Arial, Helvetica, sans-serif; font-weight: 400; font-size: 23px; line-height: 27px;\"><span style=\"box-sizing: border-box; color: #00518c;\">DONATE</span></h2>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; color: #0a0a0a; font-family: \'PT Sans\', Arial, Helvetica, sans-serif; font-size: 16px; line-height: 20px;\">Studies show that proper nutrition improves a child&rsquo;s behavior, school performance, and overall cognitive development. A healthy eating environment teaches children good nutrition and the elements of a proper diet, which can have positive effects on children&rsquo;s eating habits and physical well-being throughout life</p>','1308 Conant Street','Dallas','Te','75207','United States','Children and Youth','','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
