INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (4895,'We Love Neighbor, Inc.','<p class=\"MsoNormal\" style=\"background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><strong><span style=\"font-size: 10.0pt; font-family: &quot;Inconsolata&quot;,serif; color: #333333; letter-spacing: 0pt;\">WLN&rsquo;s mission\r\nis twofold:</span></strong><span style=\"font-size: 10.0pt; font-family: &quot;Inconsolata&quot;,serif; color: #333333; letter-spacing: 0pt;\"><br /> We train disadvantaged, at-risk youth the automotive repair and maintenance\r\nmechanics skills required to bring cars in desperate need of repair to\r\nwell-functioning, useful vehicles. The training provided offers a start to a\r\nproductive and satisfying career. The repaired cars are then auctioned to raise\r\nfunds to rent our space and purchase automotive parts.</span></p>\r\n<p class=\"MsoNormal\" style=\"background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span style=\"font-size: 10.0pt; font-family: &quot;Inconsolata&quot;,serif; color: #333333; letter-spacing: 0pt;\">Our trained mechanics\r\noffer free or discounted car repair and maintenance to those in need.</span></p>\r\n<p style=\"transition: all 0.3s linear; box-sizing: border-box; color: #333333; font-family: Inconsolata; font-size: 13px;\"></p>\r\n<p style=\"background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><strong><span style=\"font-size: 10.0pt; font-family: &quot;Inconsolata&quot;,serif; color: #333333;\">Mission Statement:<br /> </span></strong><span style=\"font-size: 10.0pt; font-family: &quot;Inconsolata&quot;,serif; color: #333333;\">We are comprised of volunteers: Joining together to, providing\r\nhope, care and service to others, a bridge between people and their local\r\ncommunities, so they may regain present and future independence. Our program\r\nhelps disadvantaged, at-risk youth to become all that God created them to be\r\nthrough a 3 month training program in basic automotive repair and maintenance\r\nskills, academic remediation, and job readiness and life management skills. At\r\nthe same time, we offer discounted automotive repair and maintenance services\r\nto the needy members of the community.</span></p>','P.O. Box 2212','Germantown','Ma','20875','United States','Community Organizing / Advocacy, Community Service and Volunteering, Training','http://www.wlni.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
