INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (4994,'Global Youth Connect','<p>&nbsp;</p>\r\n<p class=\"font_7\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: 0px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 15px; line-height: normal; font-family: din-next-w01-light, din-next-w02-light, din-next-w10-light, sans-serif; color: #2f2e2e; pointer-events: auto;\">Founded in 1999 by young leaders from both the USA and post-genocide countries like Guatemala and Bosnia-Herzegovina, Global Youth Connect advances human rights by empowering young activists from around the globe to meet face-to-face, exchange ideas and take action together in collaboration with grassroots NGOs, policy makers, and other stakeholders.</p>\r\n<p class=\"font_7\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: 0px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 15px; line-height: normal; font-family: din-next-w01-light, din-next-w02-light, din-next-w10-light, sans-serif; color: #2f2e2e; pointer-events: auto;\">&nbsp;</p>\r\n<p class=\"font_7\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: 0px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 15px; line-height: normal; font-family: din-next-w01-light, din-next-w02-light, din-next-w10-light, sans-serif; color: #2f2e2e; pointer-events: auto;\">Global Youth Connect&rsquo;s programs provide young leaders (ages 14-35) from a wide range of ethnic, national, economic and religious backgrounds with opportunities to learn more about human rights and enhance their ability to take action on pressing human rights issues.</p>\r\n<p class=\"font_7\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: 0px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: bold; font-stretch: normal; font-size: 15px; line-height: normal; font-family: din-next-w01-light, din-next-w02-light, din-next-w10-light, sans-serif; color: #2f2e2e; pointer-events: auto;\">&nbsp;</p>','P.O. Box 1342','New York','Ne','10159','United States','Human Rights and Civil Liberties, International Relations','http://www.globalyouthconnect.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
