INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (5044,'Historic Bethlehem Museums & Sites','<p><strong style=\"color: #333333; font-family: Helvetica, Arial, Verdana; font-size: 14px; line-height: 20px;\">Mission Statement:</strong></p>\r\n<p><span style=\"color: #333333; font-family: Helvetica, Arial, Verdana; font-size: 14px; line-height: 20px;\">The mission of Historic Bethlehem Museums and Sites is to bring history to life by educating the public about Bethlehem&rsquo;s rich heritage, by preserving historic sites and by collecting, preserving and exhibiting historical and artistic objects that can be used to tell the stories of Bethlehem&rsquo;s people.</span></p>\r\n<p style=\"margin: 0px 0px 10px; color: #333333; font-family: Helvetica, Arial, Verdana; font-size: 14px; line-height: 20px;\"><strong>Vision Statement:</strong></p>\r\n<p style=\"margin: 0px 0px 10px; color: #333333; font-family: Helvetica, Arial, Verdana; font-size: 14px; line-height: 20px;\">Historic Bethlehem Partnership will establish itself as the premier historical organization in our region by presenting, powerfully and credibly, three centuries of Bethlehem&rsquo;s unique history. Well maintained buildings and sites, collections that are accessible through exhibits and for research, and educational programs designed to engage diverse members of the community will engender a sense of place that connects one generation to another, showing the zeal and commitment of Bethlehem&rsquo;s Moravian founders and the strength and foresight of our industrial community in forging our American nation.</p>','74 West Broad Street, Suite 260','Bethlehem','Pe','18018','United States','Museums and   Historical Societies','http://historicbethlehem.org/','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
