INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (5121,'World Music Institute, Inc.','<blockquote style=\"color: #222222; font-family: arial, sans-serif; font-size: 13px;\">\r\n<div dir=\"ltr\">\r\n<div class=\"gmail_default\">\r\n<div class=\"gmail_default\">\r\n<div class=\"gmail_default\" style=\"font-family: tahoma, sans-serif;\"><strong>World Music Institute (WMI)&nbsp;</strong>is a nonprofit organization dedicated to presenting the best in traditional and contemporary world music and dance to foster greater understanding and appreciation of the world\'s cultural traditions. In its 30-year history, WMI has presented more than 1,500 concerts and events featuring artists from more than 100 countries from all continents. Through powerful programming and membership opportunities, WMI is creating a movement that promotes awareness and engagement of other cultures, building a vibrant community of individuals from all walks of life who enjoy learning and discovering the rich diversity of artistic expression from cultures around the globe.</div>\r\n</div>\r\n</div>\r\n</div>\r\n</blockquote>','68 Jay Street, Suite 201','Brooklyn','Ne','11201','United States','Art, Community Building and Renewal, Cultural Affairs, Education and Academia, International Relations, Race and Ethnicity','http://www.worldmusicinstitute.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
