INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (5168,'Goodwill of Southern New England ','<p style=\"font-family: Poppins; font-size: 12px; vertical-align: baseline; margin: 0px 0px 20px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-align: justify; line-height: 16px; color: #444444;\">Goodwill of Southern New England is a progressive, community-based organization committed to its mission to enhance employment, educational, social and recreational opportunities for people with disabilities and other challenges in the south-central Connecticut and Rhode Island.</p>\r\n<p style=\"font-family: Poppins; font-size: 12px; vertical-align: baseline; margin: 0px 0px 20px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-align: justify; line-height: 16px; color: #444444;\">Goodwill of Southern New England also owns and operates 13 secondhand retail stores and 1 outlet throughout south-central and eastern Connecticut. All proceeds from store sales directly support the mission of Goodwill of Southern New England. The stores also provide employment to Goodwill of Southern New England&rsquo;s clients with disabilities and other special needs.</p>','432 WASHINGTON AVE','NORTH HAVEN','Co','6473','United States','Disability Issues, Mental Health, Multi-Service Community Agency, Prison Reform','http://www.goodwillsne.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
