INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (5171,'East Oakland Youth Development Center','<p style=\"margin: 0px 0px 22px; color: #646464; font-family: museo-sans, sans-serif; font-size: 16px; line-height: 22.4px;\"><span style=\"color: #0c0c0c;\">At EOYDC, we provide youth and young adults (ages 5-24) with the tools and training necessary to become responsible citizens and dynamic leaders. Young people are able to develop through a vast range of high-quality programming spanning arts, wellness, education, and careers.&nbsp;</span></p>\r\n<p style=\"margin: 0px 0px 22px; color: #646464; font-family: museo-sans, sans-serif; font-size: 16px; line-height: 22.4px;\"><span style=\"color: #0c0c0c;\">As a part of our work-based learning program, we employ students&nbsp;in many of the Center\'s functional roles. In doing so, we also create a cascading mentorship model that allows students to hone and exercise leadership skills, while gaining work experience a greater sense of community.</span></p>\r\n<p style=\"margin: 0px 0px 22px; color: #646464; font-family: museo-sans, sans-serif; font-size: 16px; line-height: 22.4px;\"><span style=\"color: #0c0c0c;\">By offering a tax deductible financial gift, you can help EOYDC serve hundreds of young people in the Oakland community.</span></p>\r\n<p style=\"margin: 0px 0px 22px;\"><span style=\"font-family: museo-sans, sans-serif; color: #646464;\"><span style=\"font-size: 16px; line-height: 22.4px;\">https://eoydc.networkforgood.com/projects/7641-everyday-giving</span></span></p>','8200 International Blvd.','Oakland','Ca','94621','United States','Youth Services','http://www.eoydc.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
