INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (5317,'RISE San Luis Obispo County','<h2 style=\"font-size: 18px; margin: 10px 0px; font-family: \'Open Sans\', sans-serif; line-height: 21px; color: #a73b29; text-rendering: optimizeLegibility; padding-top: 8px; text-transform: uppercase;\"><strong>VISION</strong></h2>\r\n<p style=\"margin: 0px 0px 10px; font-size: 16px; font-family: Arial, Helvetica, sans-serif; color: #222222; line-height: 22.4px;\">A world free of sexual and intimate partner violence.</p>\r\n<h2 style=\"font-size: 18px; margin: 10px 0px; font-family: \'Open Sans\', sans-serif; line-height: 21px; color: #a73b29; text-rendering: optimizeLegibility; padding-top: 8px; text-transform: uppercase;\"><strong>MISSION</strong></h2>\r\n<p style=\"margin: 0px 0px 10px; font-size: 16px; font-family: Arial, Helvetica, sans-serif; color: #222222; line-height: 22.4px;\">Transform the lives of sexual and intimate partner violence survivors, their families and the community through services and education that promote safety, healing and empowerment.</p>\r\n<h2 style=\"font-size: 18px; margin: 10px 0px; font-family: \'Open Sans\', sans-serif; line-height: 21px; color: #a73b29; text-rendering: optimizeLegibility; padding-top: 8px; text-transform: uppercase;\"><strong>GUIDING PRINCIPLES</strong></h2>\r\n<ul style=\"margin: 0px 0px 10px 25px; padding: 0px; color: #222222; font-family: sans-serif; font-size: 16px; line-height: 22.4px;\">\r\n<li style=\"line-height: 20px;\">People have a basic human right to live free of sexual and intimate partner violence.</li>\r\n<li style=\"line-height: 20px;\">Sexual and intimate partner violence is preventable.</li>\r\n<li style=\"line-height: 20px;\">Everyone has a role and responsibility in doing this work.</li>\r\n<li style=\"line-height: 20px;\">Sexual and intimate partner violence exists within a system of oppression.</li>\r\n<li style=\"line-height: 20px;\">Advocacy, education, prevention, and public policy are the keys to social change.</li>\r\n<li style=\"line-height: 20px;\">Collaboration and alliance building are essential to successful anti-violence work.</li>\r\n<li style=\"line-height: 20px;\">Diversity and safe, accessible services are fundamental to creating social change and ending sexual and intimate partner violence.</li>\r\n<li style=\"line-height: 20px;\">The voices of survivors drive our work; we empower them to make choices for themselves while providing compassionate services, dignity, privacy, and respect.</li>\r\n</ul>','1030 Vine Street','Paso Robles','Ca','93446','United States','Domestic Violence Support Services, Sexual Abuse Support Services, Shelter/Emergency Shelter','http://www.riseslo.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
