INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (5486,'L\'Arche Cleveland','<p style=\"border: 0px; margin: 0px 0px 22px; padding: 0px; vertical-align: baseline; color: #3f3f3f; font-family: Arial, Helvetica, Verdana, sans-serif; font-size: 14px; line-height: 22px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">We are people, with and without intellectual disabilities, sharing life in communities belonging to an International Federation. Mutual relationships and trust in God are at the heart of our journey together. We celebrate the unique value of every person and recognize our need of one another.</p>\r\n<h1 style=\"border: 0px; margin: 0px 0px 10px; padding: 0px; vertical-align: baseline; font-weight: normal; color: #ff7f00; font-size: 22px; line-height: 24px; font-family: Arial, Helvetica, Verdana, sans-serif; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">Our Mission Is To:</h1>\r\n<ul style=\"border: 0px; margin: 0px 0px 22px 20px; padding: 0px; vertical-align: baseline; color: #3f3f3f; font-family: Arial, Helvetica, Verdana, sans-serif; font-size: 14px; line-height: 22px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">\r\n<li style=\"border: 0px; margin: 0px; padding: 0px; vertical-align: baseline; background: transparent;\">Make known the gifts of people who have intellectual disabilities, revealed through mutually transforming relationships;</li>\r\n<li style=\"border: 0px; margin: 0px; padding: 0px; vertical-align: baseline; background: transparent;\">Foster and environment in community that responds to the changing needs of our members while being faithful to the core values of our founding story; and</li>\r\n<li style=\"border: 0px; margin: 0px; padding: 0px; vertical-align: baseline; background: transparent;\">Engage in our diverse cultures, working together toward a more human society.</li>\r\n</ul>','11811 Shaker Blvd. Suite 116','Cleveland','Oh','44120','United States','Community Building and Renewal, Disability Issues, Faith-Based, Health and Medicine, Human Rights and Civil Liberties, Network of Nonprofit Organizations, Other Religious Organization, Social Services','http://www.larchecleveland.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
