INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (5501,'Community Housing Partnership','<p class=\"Default\" style=\"text-align: justify;\"><span style=\"font-family: \'Gotham Rounded Book\';\"><span style=\"font-size: small;\">Community Housing Partnership&rsquo;s mission is\r\nto help homeless people secure housing and become self-sufficient.\r\n&nbsp;Community Housing Partnership is an outcome focused nonprofit that\r\nfulfills its mission by developing and managing high quality permanent housing\r\nand providing services to homeless individuals, seniors and families to help\r\nthem rebuild their lives and break the cycle of homelessness. Community Housing\r\nPartnership is financially stable with an annual operating budget of\r\napproximately $25 million. The organization has an outstanding staff of over\r\n280 people, over half of whom were once homeless.</span></span></p>\r\n<p></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: small;\"><span style=\"font-family: \'Gotham Rounded Book\';\">During\r\nthe past four years, Community Housing Partnership reorganized its operations\r\nto better manage its growth and to refocus its services on long term impacts\r\nand outcomes. CHP is currently undertaking a repositioning of its programs and\r\nservices to align with a newly developed &ldquo;theory of change&rdquo; model that will be\r\nimplemented over the next four to six years, with the support of a committed\r\nfoundation. The agency is moving towards a data driven culture and will be\r\nintroducing/developing a performance management system for both staff\r\nperformance and outcome achievement. For more information, visit </span><a href=\"http://www.chp-sf.org/\"><span style=\"font-family: \'Gotham Rounded Book\';\">www.chp-sf.org</span></a></span><span style=\"font-family: \'Gotham Rounded Book\';\"><span style=\"font-size: small;\">.</span><span style=\"font-size: 9pt;\"></span></span></p>','20 Jones Street','San Francisco','Ca','94102','United States','Affordable Housing','http://www.chp-sf.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (5502,'Nicaragua Nonprofit Network','<h4 class=\"rtecenter\" style=\"margin: 0px; padding: 0px; text-align: center; color: #525252; font-family: \'PT Sans\';\"><span style=\"font-size: medium;\">The NNN is here to provide a common sustainable platform where all non-profit organizations, non-government organizations, government entities, and individual volunteers helping Nicaragua can share knowledge, resources, experiences, and&nbsp;accomplishments.</span></h4>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: medium;\">If you are a nonprofit organization that does ANY type of work in Nicaragua, we invite you to register with us at www.nnn.sitewiredprojects.info</span></p>','PO box 3366 ','Boulder','Co','80309','United States','Network of Nonprofit Organizations','http://www.nicaraguanonprofitnetwork.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
