INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (5558,'Parents Step Ahead','<p class=\"MsoNormal\" style=\"margin-top: 0in; margin-right: 1.0in; margin-bottom: .0001pt; margin-left: 1.0in;\"><span style=\"font-size: 12.0pt; mso-fareast-font-family: Arial; position: relative; top: -.5pt; mso-text-raise: .5pt;\">PSA\r\nis a 501-C3 nonprofit organization established in 2006 by Lupita Colmenero,\r\nPublisher of El Hispano News, the oldest and most influential Spanish language\r\nnewspaper in North Texas, serving the Hispanic community since 1986. Rather\r\nthan just reporting alarming statistics about the challenges underserved\r\ncommunities face, Colmenero worked to create a program <em>&ldquo;to recognize, educate, enable and empower parents to take a proactive\r\nrole in the educational and personal development of their children.&rdquo;</em>&nbsp; The nonprofit organization seeks to remedy\r\nthe growing lack of awareness in education plaguing parents, especially\r\ndisadvantaged parents, which is putting their children at a significant educational\r\ndisadvantage.&nbsp;</span></p>','2102 Empire Central','Dallas','Te','75325','United States','Education and Academia','','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
