INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (5597,'Literacy Volunteers of Central CT','<p><span style=\"font-family: arial;\">About Us</span></p>\r\n<p><span style=\"font-family: arial;\">Since 1978, Literacy Volunteers of Central CT (LVCC) has offered adults free tutoring to improve their English reading and writing skills. Each year we serve approximately 400 persons, individually and in small group settings, including parent and child groups.</span></p>\r\n<p><span style=\"font-family: arial;\">We rely on 200 dedicated and caring individuals to provide the tutoring and support our students need to reach their goals. Many of our volunteers tell us that being a Literacy Volunteer is the best thing they have ever done. Not only are they helping others, but their lives are greatly enriched through the relationships they develop with their students. Several times a year, we offer high quality tutor training in many central Connecticut locations.&nbsp;</span></p>\r\n<p>The results of improved literacy are demonstrated in the successes of our students this past year:</p>','20 High St','New Britain','Co','6051','United States','Education and Academia','','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
