INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (5708,'ARTS San Antonio','<div class=\"span8  module_cont module_normal_padding module_text_area\">\r\n<div class=\"module_content\">\r\n<p style=\"text-align: left;\"><span style=\"font-size: x-small;\"><strong>ARTS San Antonio&rsquo;s mission is to entertain, enrich and educate the people of San Antonio and South Texas.</strong></span><span style=\"font-size: x-small;\"><br /><br /><strong>Our beliefs and core values</strong><br /><br />We believe that performing-arts experiences are integral to the development and well-being of people in all communities.<br /><br />We\r\n aspire to enrich the cultural heritage, elevate the reputation, and \r\nmagnify the potential of our citizens and community by joining San \r\nAntonians with world-class artists.<br /><br />We seek to inspire our \r\naudiences by bringing exceptional and meaningful arts experiences to the\r\n people, stages, and classrooms of San Antonio. <br /><br />We present the \r\nhighest-quality performing arts and arts education in a manner that \r\nrepresents our values of accessibility, collaboration, diversity, \r\nexcellence, and financial responsibility.</span></p>\r\n</div>\r\n</div>','418 10th Street','San Antonio','Te','78215','United States','Art','http://www.artssa.org/','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
