INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (5753,'Clinic by the Bay','<p style=\"padding-top: 0px; margin-top: 0px; margin-bottom: 3px; padding-bottom: 6px; color: #898989; font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 22px;\">Clinic by the Bay is San Francisco\'s&nbsp;<a style=\"text-decoration: inherit;\" href=\"http://www.volunteersinmedicine.org/\"><strong><span style=\"color: #00ccff;\">Volunteers in Medicine</span></strong></a>&nbsp;clinic -- the 82nd VIM clinic in the country and the first in Northern California. Clinic by the Bay is a volunteer-powered free health clinic for the working uninsured. Our patients reside in&nbsp;<strong>San Francisco and San Mateo Counties</strong>.&nbsp; As part of the national network of Volunteers in Medicine clinics, we engage retired and practicing doctors, nurses, and non-medical volunteers to provide compassionate, high quality health care, free of charge.</p>','4877 Mission St','San Francisco','Ca','94112','United States','Community Service and Volunteering, Health and Medicine','http://www.clinicbythebay.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
