INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (5832,'Friends of the Multnomah County Library','<p class=\"text-align-center\" style=\"text-align: left; word-wrap: break-word; margin-top: 0px; font-family: \'Work Sans\'; font-size: 17px; line-height: 27.2px;\">Friends of the Multnomah County Library (FOL) advocates for and supports our outstanding<a style=\"color: #e18905; text-decoration: none; word-wrap: break-word; background: transparent;\" href=\"http://multcolib.org/\">&nbsp;public library</a>. We provide supplemental funding for library programs and services, and sponsor activities which engage people who value our library.</p>\r\n<p class=\"text-align-center\" style=\"text-align: left; word-wrap: break-word; font-family: \'Work Sans\'; font-size: 17px; line-height: 27.2px;\">The money raised by Friends of the Library directly funds the&nbsp;<a style=\"color: #e18905; text-decoration: none; word-wrap: break-word; background: transparent;\" href=\"https://multcolib.org/book-groups/pageturners\" target=\"_blank\">Pageturners book groups</a>&nbsp;at all library branches, National Library Workers Day events, the Adult Summer Reading program, and other vital library initiatives. We have a long history of&nbsp;<a style=\"color: #e18905; text-decoration: none; word-wrap: break-word; background: transparent;\" href=\"https://www.friends-library.org/history\">advocacy</a>&nbsp;in addition to funding library programs and services.&nbsp;</p>','1020 SW Taylor St, Ste 439','Portland','Or','97205','United States','Library or Resource Center','https://www.friends-library.org/store','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
