INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (5846,'AASLD','<p><strong>Vision<br /></strong>To Prevent and Cure Liver Disease<br /><strong><br />Mission<br /></strong>To advance and disseminate the science and practice of hepatology, and to promote liver health and quality patient care</p>\r\n<p>AASLD is the leading organization of scientists and health care professionals committed to preventing and curing liver disease. AASLD was founded in 1950 by a small group of leading liver specialists (including Hans Popper, Leon Schiff, Fred Hoffbauer, Cecil Watson, Jesse Bollman, and Sheila Sherlock, to name a few) to bring together those who had contributed to the field of hepatology.</p>\r\n<p>AASLD has grown to an international society responsible for all aspects of hepatology, and our annual meeting, The Liver Meeting&reg;, has grown in attendance from 12 to more than 9,500 physicians, surgeons, researchers, and allied health professionals from around the world.</p>\r\n<p>Hepatology has been recognized as a discipline only in the last few decades, and AASLD played a seminal and unifying role in focusing interest on hepatological problems, as well as the founding of other hepatological societies.</p>\r\n<p>AASLD sponsors two topical conferences each year in clinical, basic, hepatitis, or pediatric hepatology. Our three journals &ndash; HEPATOLOGY, Liver Transplantation, and Clinical Liver Disease &ndash; provide the latest research findings for hepatology and surgery of the liver.</p>\r\n<p>AASLD\'s membership includes ALL professionals dedicated to hepatobiliary discoveries and patient care. Mentoring, the sharing of knowledge, and dedication to professional growth and development are among the core values of AASLD and its members.</p>','1001 N Fairfax St STE 400','Alexandria','Vi','22314','United States','Professional Association','http://www.aasld.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
