INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (5971,'BUILD','<p style=\"padding: 0px; margin: 0px 0px 1.5rem; box-sizing: border-box; color: #555555; font-family: \"><span style=\"font-family: arial; font-size: x-small;\">Founded in 1999, BUILD uses entrepreneurship-based, experiential learning to ignite the potential of youth in under-resourced communities and equip them for high school, college and career success. BUILD\'s unique program offers students a four year entrepreneurship experience designed to reinforce the Common Core, develop 21st Century Skills and motivate student engagement in school. Starting in 9th grade, BUILD students work with their peers and community mentors to develop business ideas, pitch to funders and launch real businesses. As they journey through high school, BUILD provides students with support in navigating the college application process and the opportunity to explore college and career options, while expanding their businesses or opting into community internships.</span></p>\r\n<p style=\"padding: 0px; margin: 0px 0px 1.5rem; box-sizing: border-box; color: #555555; font-family: \"><span style=\"font-family: arial; font-size: x-small;\">BUILD currently serves over 1,500 high school students at programs located in the San Francisco Bay Area; Washington, DC; and Boston, MA and will begin operations in New York City in 2015. Over the next ten years, BUILD will strategically expand its operations to serve at least ten regions across the country, leading more students to graduate from high school prepared for future success each year.</span></p>\r\n<p style=\"padding: 0px; margin: 0px 0px 1.5rem; box-sizing: border-box; color: #555555; font-family: \"><span style=\"font-family: arial; font-size: x-small;\">BUILD is made up of a diverse, results driven and passionate team who believe in the potential of every student and the power of entrepreneurship-based, experiential learning to transform the education landscape. We work in a collaborative environment where perseverance, flexibility, cross-cultural understanding and an entrepreneurial spirit are encouraged and celebrated. For more information, please visit&nbsp;<a style=\"padding: 0px; margin: 0px; box-sizing: border-box; color: #0080cc; text-decoration: none; word-break: break-word;\" href=\"http://www.build.org/\">www.build.org</a>.</span></p>','2385 Bay Road','Redwood City','Ca','94063','United States','Community Organizing / Advocacy, Education and Academia, Youth Services','http://www.build.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
