INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (6009,'Forests Forever','<p>Forests Forever was founded in 1989 during the historic campaign to save the Headwaters ancient redwood forest in Humboldt County, California. Our efforts helped galvanize the broad-based public awareness and outcry that led to that and other forest victories across the state. For more than 25 years we have been rallying Californians in defense of the state&rsquo;s 17 million acres of woodland ecosystems and watersheds. We engage in year-round education, grassroots organizing and executive-branch and legislative advocacy.</p>','1936 University Avenue, Suite 160','Berkeley','Ca','94704','United States','Environment and Ecology, Politics','http://forestsforever.org/','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
