INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (6046,'The Tenacious Group','<div>\r\n<p style=\"text-align: left;\"><span style=\"font-family: verdana;\"><span style=\"font-size: 14px; -webkit-text-stroke-width: initial;\">Founded\r\n in 1996, The Tenacious Group, Inc. a non-profit organization created to\r\n empower purpose thinking. Purpose Thinking motivates a person to&nbsp;</span><span style=\"font-size: 14px;\">believe</span><span style=\"font-size: 14px; -webkit-text-stroke-width: initial;\">&nbsp;in&nbsp;</span><span style=\"font-size: 14px;\">their</span><span style=\"font-size: 14px; -webkit-text-stroke-width: initial;\">&nbsp;unique strengths,&nbsp;</span><span style=\"font-size: 14px;\">capabilities</span><span style=\"font-size: 14px; -webkit-text-stroke-width: initial;\">&nbsp;and\r\n potential. Since its inception The Tenacious Team has spoken face to \r\nface to over 350,000 students on school campuses and classrooms,&nbsp;</span><span style=\"font-size: 14px;\">hundreds</span><span style=\"font-size: 14px; -webkit-text-stroke-width: initial;\">&nbsp;of teachers, youth specialists, professional athletes &amp; coaches.&nbsp;</span></span></p>\r\n<p style=\"text-align: justify; font-size: 12px; -webkit-text-stroke-color: #000000; -webkit-text-stroke-width: initial;\"><span style=\"-webkit-text-stroke-width: initial; font-size: 14px; font-family: verdana;\">Statistics reveal 3 out 4 people are trying to find&nbsp;</span><span style=\"-webkit-text-stroke-width: initial; font-size: 14px; font-family: verdana;\">their</span><span style=\"-webkit-text-stroke-width: initial; font-size: 14px; font-family: verdana;\">&nbsp;</span><span style=\"-webkit-text-stroke-width: initial; font-size: 14px; font-family: verdana;\">purpose</span><span style=\"-webkit-text-stroke-width: initial; font-size: 14px; font-family: verdana;\">&nbsp;in life. When a person lives&nbsp;</span><span style=\"-webkit-text-stroke-width: initial; font-size: 14px; font-family: verdana;\">without a sense of purpose&nbsp;they&nbsp;</span><span style=\"-webkit-text-stroke-width: initial; font-size: 14px; font-family: verdana;\">will\r\n not have the proper attitude to assess future opportunities, will lack \r\nresiliency skills needed to overcome setbacks, and tools needed to \r\ndevelop a roadmap for success.&nbsp;</span></p>\r\n<p style=\"text-align: justify; font-size: 12px; -webkit-text-stroke-color: #000000; -webkit-text-stroke-width: initial;\"><span style=\"text-align: left; font-size: 14px; font-family: verdana;\">We\r\n firmly believe there are hundreds of gifts &amp; abilities within each \r\nyoung person and many more incredible exploits to accomplish.&nbsp;</span></p>\r\n<div><span style=\"font-family: verdana;\"> </span></div>\r\n<p><span style=\"font-size: 14px; text-align: justify; -webkit-text-stroke-width: initial;\">The\r\n Tenacious Group, Inc. instills hope and purpose with their unique \r\nmotivational Train-the-Trainer Services, School Resources, Respect the \r\nDesk Fine Art Movement and Upcoming Documentary \"Making of a Gangsta\"<br /></span></p>\r\n</div>','190 Martha Street','San Jose','Ca','95127','United States','Gang Prevention and Intervention','http://www.thetenaciousgroup.com','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
