INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (6066,'Breckenridge Music Festival','<p>To provide premier musical and related arts experiences on a year-round basis in Summit County.</p>\r\n<p>To produce diverse programming, including a classical orchestral summer series; a non-classical performance series; a winter performance series; and diverse musical experiences including in-home concerts of chamber music and ongoing educational programs.</p>\r\n<p>The Breckenridge Music Festival strives to be a valued partner of the County&rsquo;s towns and businesses, in making a high-quality and far-reaching impact on the quality of life in our community for residents and visitors alike.</p>\r\n<p>The Breckenridge Music Festival invites over 40 professional musicians from around the world to participate in one of the Town&rsquo;s most beloved annual events. The unique Festival welcomes locals and visitors alike to enjoy classical, jazz, blues, rock, and other mixed genres.</p>','201 S. Ridge St., PO Box 1254','Breckenridge','Co','80424','United States','Art','http://www.breckenridgemusicfestival.com','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
