Fragment--></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: sans-serif; font-size: x-small;\">Founded in 1990, The Steppingstone Foundation is a\r\nnot-for-profit organization that develops and implements programs that prepare\r\nunderserved students for educational opportunities that lead to college\r\nsuccess. Based on the premise that, regardless of circumstance, children can\r\nachieve at high levels with effective preparation and support, Steppingstone\r\nprograms emphasize rigorous standards and achieve meaningful results. </span></p>\r\n<p><!--EndFragment--></p>\r\n<p>&nbsp;</p>','1 Appleton Street, 4th Floor','Boston','Ma','2116','United States','Children and Youth, Education and Academia, Higher Education, Teaching, Youth Services','http://www.tsf.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (6156,'Mile High Youth Corps','<p>We are a youth development organization that creates tranformational triple-impact on youth, communities, and the environment. We bring young people from diverse life experiences together to learn, work hard, and grow in service and their own development.&nbsp;</p>\r\n<p>Corpsmembers create meaningful impact in communities, explore who they are as individuals, experience diverse perspectives, pursue education, and grow to embrace service as a way of life. Corpsmembers earn a wage and can pursue high school diplomas or GED\'s while serving community in one of our four tracks. Land conservation, Energy and Water Conservation, YouthBuild -Construction, Health and Welness. Corpsmembers are eligible for Americorps education awards.&nbsp;</p>','1801 Federal Blvd.','Denver','Co','80204','United States','Conservation, Energy Conservation and Green Living, Environment and Ecology, Multi-Service Community Agency, Service Organization, Training, Youth Services','http://1801 Federal Blvd.','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
