INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (6159,'Global Bioethics Initiative','<p><em style=\"box-sizing: border-box; font-family: &quot;PT Sans&quot;;\"><strong style=\"box-sizing: border-box;\"><span style=\"font-size: x-small;\">Global Bioethics Initiative (GBI) is dedicated to fostering public awareness and understanding of bioethical issues, and to exploring solutions to bioethical challenges.<span style=\"color: #ffffff;\">c</span></span></strong></em></p>\r\n<p><em style=\"box-sizing: border-box; font-family: &quot;PT Sans&quot;;\"><strong style=\"box-sizing: border-box;\"><span style=\"color: #ffffff; font-size: x-small;\">hallenges.</span></strong></em></p>\r\n<p><span style=\"color: #747474; font-family: &quot;PT Sans&quot;; box-sizing: border-box;\"><strong><span style=\"font-size: small;\">Focus issues include:</span></strong></span></p>\r\n<p><strong><span style=\"font-size: x-small;\"><br /></span></strong></p>\r\n<p><strong><span style=\"font-size: x-small;\">Neuroscience and Mental Illness</span></strong></p>\r\n<p><strong><span style=\"font-size: x-small;\">Ethics of Transplantation</span></strong></p>\r\n<p><strong><span style=\"font-size: x-small;\">End of Life and Palliative Care</span></strong></p>\r\n<p><strong><span style=\"font-size: x-small;\">Aiging and Regenerative Medicine</span></strong></p>\r\n<p>&nbsp;</p>\r\n<div class=\"fusion-two-third fusion-layout-column fusion-column-last fusion-spacing-yes about-excerpt\" style=\"box-sizing: border-box; position: relative; float: left; margin: 10px 0px 20px; width: 1204.08px; padding-left: 60px; color: #747474; font-family: &quot;PT Sans&quot;; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;\">\r\n<div class=\"fusion-column-wrapper\" style=\"box-sizing: border-box;\">\r\n<div class=\"fusion-title title fusion-sep-none fusion-title-size-one fusion-border-below-title\" style=\"box-sizing: border-box; display: block; flex-wrap: nowrap; align-items: center; margin: 0px 0px 31px; overflow: hidden;\">\r\n<h1 style=\"box-sizing: border-box; margin: 0px; flex-grow: 0; padding: 0px; line-height: 1.4; font-family: &quot;Antic Slab&quot;; font-weight: 400; letter-spacing: 0px; color: #333333;\"><strong style=\"box-sizing: border-box;\"><span style=\"font-size: x-small;\">Goals</span></strong></h1>\r\n</div>\r\n<div class=\"excerpt\" style=\"box-sizing: border-box;\">\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px;\"><strong style=\"box-sizing: border-box;\"><span style=\"font-size: x-small;\">GBI has established four goals to achieve its mission:</span></strong></p>\r\n<ul style=\"box-sizing: border-box;\">\r\n<li style=\"box-sizing: border-box;\"><strong style=\"box-sizing: border-box;\"><span style=\"font-size: x-small;\">To promote interdisciplinary research and provide the public with information pertaining to bioethical issues</span></strong></li>\r\n<li style=\"box-sizing: border-box;\"><strong style=\"box-sizing: border-box;\"><span style=\"font-size: x-small;\">To engage a broader audience in public debates on emerging medical technologies and their potential impact</span></strong></li>\r\n<li style=\"box-sizing: border-box;\"><strong style=\"box-sizing: border-box;\"><span style=\"font-size: x-small;\">To collaborate with policy makers, including those at the United Nations (UN) and its agencies to identify solutions to global health problems</span></strong></li>\r\n<li style=\"box-sizing: border-box;\"><strong style=\"box-sizing: border-box;\"><span style=\"font-size: x-small;\">To encourage international debates at the intersection of health, biotechnology and medicine</span></strong></li>\r\n</ul>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px;\"><span style=\"font-size: x-small;\">&nbsp;</span></p>\r\n</div>\r\n<div class=\"excerpt\" style=\"box-sizing: border-box;\">\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px;\"><strong style=\"box-sizing: border-box;\"><span style=\"font-size: x-small;\">GBI is a member of the&nbsp;<a style=\"box-sizing: border-box; text-decoration: none; color: #1e73be;\" rel=\"external noopener noreferrer\" href=\"https://academicimpact.un.org/\" target=\"_blank\">United Nations Academic Impact&nbsp;(UNAI)</a>, a global initiative that aligns institutions of higher education with the United Nations in furthering the realization of the purposes and mandate of the organization through activities and research in shared culture of intellectual social responsibility.</span></strong></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px;\"><strong style=\"box-sizing: border-box;\"><span style=\"font-size: x-small;\">GBI has been associated with the&nbsp;<a class=\"external\" style=\"box-sizing: border-box; text-decoration: none; color: #1e73be;\" rel=\"external noopener noreferrer\" href=\"http://esango.un.org/civilsociety/showProfileDetail.do?method=showProfileDetails&amp;profileCode=646673\" target=\"_blank\">United Nations Department of Public Information (DPI)</a>&nbsp;since December 2014. DPI aims at facilitating the exchange of information and the development of partnerships within the United Nations as well as with nonprofit organizations around the world. Many of the issues addressed by GBI, including reproductive rights, human organ trafficking, and the ethics of population aging, are important to other United Nations and United Nations-affiliated agencies.</span></strong></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px;\"><span style=\"font-size: x-small;\"><strong style=\"box-sizing: border-box;\">The Committee on Non-Governmental Organizations nominated Global Bioethics Initiative for&nbsp;<a style=\"box-sizing: border-box; text-decoration: none; color: #1e73be;\" rel=\"external noopener noreferrer\" href=\"http://csonet.org/?menu=100\" target=\"_blank\">Special Consultative Status</a>&nbsp;with the&nbsp;<a style=\"box-sizing: border-box; text-decoration: none; color: #1e73be;\" rel=\"external noopener noreferrer\" href=\"http://www.un.org/en/ecosoc/about/\" target=\"_blank\">Economic and Social Council&nbsp;(ECOSOC)</a>, the United Nation&rsquo;s central platform for debate, reflection, and innovative thinking on sustainable development. GBI is one of only a few organizations to receive such a status. In this capacity, GBI will be able to offer policy recommendations directly to those who craft and initiate legislation and participate in intergovernmental meetings of the United Nations.</strong><strong style=\"box-sizing: border-box;\"></strong></span></p>\r\n</div>\r\n<div class=\"fusion-title title fusion-sep-none fusion-title-size-one fusion-border-below-title\" style=\"box-sizing: border-box; display: block; flex-wrap: nowrap; align-items: center; margin: 0px 0px 31px; overflow: hidden;\">\r\n<h1 style=\"box-sizing: border-box; margin: 0px; flex-grow: 0; padding: 0px; line-height: 1.4; font-family: &quot;Antic Slab&quot;; font-weight: 400; letter-spacing: 0px; color: #333333;\"><strong style=\"box-sizing: border-box;\"><span style=\"font-size: x-small;\">Activities</span></strong></h1>\r\n</div>\r\n<div class=\"excerpt\" style=\"box-sizing: border-box;\">\r\n<ul style=\"box-sizing: border-box;\">\r\n<li style=\"box-sizing: border-box;\"><strong style=\"box-sizing: border-box;\"><span style=\"font-size: x-small;\">GBI organizes panel discussions, conferences, and summer school programs to facilitate public understanding of current bioethical issues. For information about events&nbsp;<a style=\"box-sizing: border-box; text-decoration: none; color: #1e73be;\" href=\"http://globalbioethics.org/upcmnevents/\">click here</a>.</span></strong></li>\r\n<li style=\"box-sizing: border-box;\"><strong style=\"box-sizing: border-box;\"><span style=\"font-size: x-small;\">GBI leverages the knowledge and experience of experts and other professionals in government, academia, and private industry, as well as its Board and Advisory Board members.</span></strong></li>\r\n</ul>\r\n<h1 style=\"box-sizing: border-box; margin-top: 0.67em; margin-bottom: 0.67em; font-family: &quot;Antic Slab&quot;; font-weight: 400; line-height: 1.4; letter-spacing: 0px; color: #333333; text-align: left;\"><strong style=\"box-sizing: border-box;\"><span style=\"font-size: x-small;\">Location</span></strong></h1>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px;\"><strong style=\"box-sizing: border-box;\"><span style=\"font-size: x-small;\">With offices at 777 UN Plaza, 5<sup style=\"box-sizing: border-box;\">th</sup>&nbsp;Floor, New York, New York, 10017, GBI overlooks the United Nations headquarters in New York City.</span></strong></p>\r\n</div>\r\n<div class=\"fusion-button-wrapper\" style=\"box-sizing: border-box; display: inline;\"><a class=\"fusion-button button-flat button-square button-medium button-custom button-2\" style=\"box-sizing: border-box; text-decoration: none; color: #1e73be; display: inline-block; position: relative; outline: 0px; zoom: 1; border: 0px solid #ffffff; text-align: center; text-transform: uppercase; font-weight: 400; cursor: pointer; transition: all 0.2s; padding: 11px 23px; line-height: 16px; font-family: &quot;PT Sans&quot;; letter-spacing: 0px; background: #1e73be; width: auto; border-radius: 0px;\" href=\"http://globalbioethics.org/about/#\" target=\"_self\"><span style=\"font-size: x-small;\"><em class=\"fa fa-external-link button-icon-left\" style=\"box-sizing: border-box; margin-right: 10px; display: inline-block; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; font-stretch: normal; line-height: 1; font-family: FontAwesome; text-rendering: auto; -webkit-font-smoothing: antialiased; transition: all 0.2s; color: #ffffff;\"></em><span class=\"fusion-button-text\" style=\"box-sizing: border-box; transition: all 0.2s; color: #ffffff;\">COLLABORATIONS</span></span></a></div>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','777 UN Plaza, 5th Floor','New York','Ne','10017','United States','Education and Academia','http://www.globalbioethics.org, www.summerprogram.globalbioethics.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
