INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (6294,'Pajama Program',NULL,'114 East 39th Street, Ground Floor','New York','Ne','10016','United States','Children and Youth','http://pajamaprogram.org/','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (6295,'Pajama Program','<p style=\"padding: 0px; margin: 0px 0px 1.5rem; box-sizing: border-box; color: #555555; font-family: &quot;Ideal Sans SSm A&quot;, &quot;Ideal Sans SSm B&quot;, &quot;Trebuchet MS&quot;, sans-serif; font-size: 16px;\">Every child has the right to a good night. Yet, thousands of children across the United States will go to sleep tonight and their bedtime will be missing something. They may be feeling alone and afraid, in a bed that isn&rsquo;t theirs, in a shelter that isn&rsquo;t a home or with families who wish they could give them more.<br style=\"padding: 0px; margin: 0px; box-sizing: border-box;\" /></p>\r\n<p style=\"padding: 0px; margin: 0px 0px 1.5rem; box-sizing: border-box; color: #555555; font-family: &quot;Ideal Sans SSm A&quot;, &quot;Ideal Sans SSm B&quot;, &quot;Trebuchet MS&quot;, sans-serif; font-size: 16px;\">At Pajama Program, we know that this doesn&rsquo;t have to be their story. We know that we can do something that not only validates their worth and shows them love, but that also transforms their nights and their days. By offering the&nbsp;magical gifts of pajamas and books, we bring a caring bedtime ritual into their lives. Changing out of their clothes and into&nbsp;warm, cozy pajamas&nbsp;lets them shed the stresses of their day, trading them for feelings of warmth and hope. With enchanting stories, their imaginations are opened, helping them to dream again. These unconditional gifts fill them with love and a feeling of being cared for, transitioning them to bedtime and delivering a good night &mdash;&nbsp;preparing them for a good day that leads to a better life.</p>','114 East 39th Street, Ground Floor','New York','Ne','10016','United States','Children and Youth','http://pajamaprogram.org/','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
