INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (6344,'Total Family Care Coalition','<p></p>\r\n<p style=\"margin: 0px; line-height: 150%;\"><span style=\"margin: 0px; line-height: 150%; font-size: 12pt;\">Our mission, &ldquo;Helping to\r\nkeep families together&rdquo; and our aim is to strengthen families within their\r\ncommunities, by empowering families and individuals to find the services and\r\nresources they need. We provide integrated support in the areas of mental\r\nhealth and substance abuse, education, housing and legal aid. We put our\r\nsuccess down to starting from the strengths of the families we serve, instead\r\nof the problems they have faced. We use peer-led education and\r\nresilience-building programs to help families find their voice. We work\r\ntirelessly to break generational cycles of hardship in families and\r\ncommunities, while improving the overall system of care in the District.</span></p>\r\n<p style=\"margin: 0px; line-height: 150%;\">&nbsp;</p>\r\n<p style=\"margin: 0px; line-height: 150%;\"></p>\r\n<p style=\"margin: 0px; line-height: 150%;\"><span style=\"margin: 0px; line-height: 150%; font-size: 12pt;\">We are a family-run\r\norganization providing dependable peer support and advocacy services across the\r\nDistrict of Columbia. Our vision is of peer-informed and seamless service\r\nprovision across the District. We help families grow and thrive, regardless of\r\nage, background or income. We believe lasting and personal change emerges\r\nthrough family unity. Every day, we work side-by-side with our families, youths\r\nand communities to make sure that we\'re giving our best to assist with their needs.</span></p>\r\n<p style=\"margin: 0px; line-height: 150%;\"><strong></strong><em></em></p>\r\n<p><strong></strong><em></em></p>','1214 I ST SE','WASHINGTON','Di','20003','United States','Community Organizing / Advocacy, Family and Parenting, Mental Health, Multi-Service Community Agency, Parent Organization','http://WWW.totalfamilycarecoalltion.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
