INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (6407,'Social Outreach Media, Inc.',NULL,'9620 Grand Isle Lane','las vegas','Ne','89144','United States','Communications','http://www.SocialOutreachMedia.us','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (6408,'Social Outreach Media, Inc.','<h3>If you&rsquo;re a nonprofit or non-governmental organization (NGO), we want to work with you. You have a great story and wish more people knew about it. So do they. We&rsquo;ll help you build that bridge between mission and audience.\r\n<p>&nbsp;</p>\r\n<p>Let&rsquo;s collaborate in the most effective way possible. Together, we&rsquo;ll create a visual impact that inspires people and empowers them to advocate on your behalf.</p>\r\n</h3>\r\n<h3><em><a href=\"mailto:%20Steve@SocialOutreachMedia.us?subject=Further Information\"> Contact:  Steve@SocialOutreachMedia.us </a></em></h3>\r\n<p><a href=\"mailto:%20Steve@SocialOutreachMedia.us?subject=Further Information\"></a></p>\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-sm-4\">\r\n<h3><em>Success/Inspirational Stories</em></h3>\r\n<p>Nothing generates buzz better than a story about a changed life or someone who benefited from your organization.</p>\r\n<p>Present an honest success story that includes bumps in the road as well as the ultimate impact of your efforts.</p>\r\n</div>\r\n<div class=\"col-sm-4\">\r\n<h3><em>Issues and Advocacy</em></h3>\r\n<p>There&rsquo;s nothing better than an engaged, excited and passionate donor/activist that&rsquo;s willing to champion your cause and influence a community for good.</p>\r\n<p>Make sure your issues and agenda are shareable; visually showing people you&rsquo;ve helped; those who are still suffering; and the impact you&rsquo;re having on the community or the world.</p>\r\n</div>\r\n<div class=\"col-sm-4\">\r\n<h3><em>Fundraising Campaigns</em></h3>\r\n<em></em>\r\n<p>Be likeable and yet be humble. Promote your agenda in moderation.</p>\r\n<p>Potential supporters and donors get bored and/or restless with showoffs, preachy posters or over-sharers</p>\r\n<br /><br /><br /><br /></div>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>\r\n<h2>Social Outreach Packages</h2>\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-sm-4\">\r\n<h3><em>All-inclusive Video Outreach </em></h3>\r\n<p>Videos of volunteers building a house or driving a school bus to collect school supply donations can be incredibly persuasive.</p>\r\n<p>We provide a complete, one-stop-shop, \"turnkey approach\", using our award-winning production team, to promote your visual/multi-media branding image.</p>\r\n<p>This includes: creative consultation, producer on-site with creative team,  multiple high-definition cameras, custom graphics, internet -ready digital files, and distribution support<br /></p>\r\n</div>\r\n<div class=\"col-sm-4\">\r\n<h3><em>Director/Producer + Videographer </em></h3>\r\n<p>We utilizes a documentary film style approach to connect audiences with your story. By combining strong narrative with creative filmmaking techniques, this style is uniquely suited to communicate your most important brand messaging.</p>\r\n<p>A fast-paced, high-energy video highlighting the most exciting aspects of your event in the form of a visual montage. The package includes custom graphics, dynamic music, and web-ready files optimized for social media sharing and fundraising events.</p>\r\n</div>\r\n<div class=\"col-sm-4\">\r\n<h3><em>Strategic Media/Internet Planning </em></h3>\r\n<p>Video production and communications strategy for associations takes both research and creativity.</p>\r\n<p>Tell us where you need to go, and let&rsquo;s work together to get you there. Open communication and collaboration during each stage ensures that the video production process runs smoothly.</p>\r\n<br /><br /></div>\r\n</div>\r\n<img src=\"data:image/png;base64,\" width=\"1080\" alt=\"\" height=\"25\" /></div>\r\n<h2>&Agrave; la carte Optional Premium Services</h2>\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-sm-4\">\r\n<h3><em> Special Effects Video Editor </em></h3>\r\n<p>This includes such eye-appealing visuals as 3D motion, video overlays, and animation working with Adobe\'s After Effects and other related software.</p>\r\n</div>\r\n<div class=\"col-sm-4\">\r\n<h3><em>On-Camera Talent</em></h3>\r\n<p>Sometimes, an on-camera interviewer is appropriate. Our roster of talented announcers, newscasters, and celebrity hosts.</p>\r\n</div>\r\n<div class=\"col-sm-4\">\r\n<h3><em>Narrative/Script Writing </em></h3>\r\n<p>When required, we provide professonal media script-writing services which works directly with your own in-house writers.</p>\r\n</div>\r\n<div class=\"col-sm-4\">\r\n<h3><em> Narrative/Voice-over Talent </em></h3>\r\n<p>For those presentations which require a voice-over or a narrative, we offer a variety of air talent to fit all needs and requirements.</p>\r\n</div>\r\n<div class=\"col-sm-4\">\r\n<h3><em>Legal and IP Media Clearances</em></h3>\r\n<p>It is extremely important obtain the consent of anyone appearing in a video presentation.  Our legal staff will obtain their consent on paper with a personal release form.  We also obtain m parental consent for children under 18.</p>\r\n<p>We will also review any pending production contracts as well as ensuring compliance with copyright law (including music usage), rights to privacy and rights of publicity.</p>\r\n</div>\r\n<div class=\"col-sm-4\">\r\n<h3><em>Copyright/Trademark Protection</em></h3>\r\n<p>Upon request, we will review and register your intellectual property rights that are created and/or originated under the terms of the video production.</p>\r\n<p>We will also assist in licensing the use of such intellectual property rights to thirid parties, such as local televison stations, internet TV, group presentations, web sites, etc.</p>\r\n</div>\r\n</div>\r\n<br /></div>','9620 Grand Isle Lane','las vegas','Ne','89144','United States','Communications','http://www.socialoutreachmedia.us','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
