INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (6512,'Bridge of Faith','<p class=\"MsoNormal\">Mission Statement; The\r\nBridge of Faith (BOF) strives to change the generational cycle and status-quo\r\nthat exists for girls who were victims of inadequate parenting and the results\r\nof the foster care experience. We provide a safe HOME (Home, Opportunity Meets\r\nEmancipation), emotional support, and life-skills to girls who have aged out of\r\nfoster care and women facing homelessness. Bridge of Faith makes a positive\r\nimpact by helping women to become women of purpose within their communities.&nbsp;</p>','PO BOx 9108','Whittier','Ca','90608','United States','Housing','http://www.bridgeoffaith.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
