INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (6526,'Sheltering Arms Children and Family Services','<p><em><span style=\"font-size: 12.0pt; line-height: 107%; font-family: &quot;Calibri&quot;,sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-theme-font: minor-latin; mso-bidi-theme-font: minor-latin; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Sheltering\r\nArms (formerly Episcopal Social Services) strengthens the education, wellbeing,\r\nand development of high-need children, adults, and families across the New York\r\nmetro area. We serve nearly 20,000 people a year from the South Bronx to Far\r\nRockaway. Through compassion, innovation, and partnership, we respond to our\r\ncommunity\'s greatest needs and enable individuals to reach the greatest heights\r\nof their potential. Joining our team is an opportunity to collaborate with\r\nhundreds of dedicated colleagues who represent diverse backgrounds and talents\r\nas we work together to make a measurable impact for our neighbors in need.\r\nEvery role at Sheltering Arms brings with it new opportunities for advancement\r\nand development so that team members can achieve their professional goals while\r\nhelping others reach for theirs.</span></em></p>','305 Seventh Ave','New York','Ne','10001','United States','Multi-Service Community Agency','http://305 Seventh Ave','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
