INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (6529,'Charity','<p class=\"MsoNormal\"><strong><em><span style=\"font-size: 12.0pt; line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; mso-fareast-font-family: &quot;Times New Roman&quot;; color: #0b5394;\">Dear Beloved,</span></em></strong></p>\r\n<p class=\"MsoNormal\"><strong><em><span style=\"font-size: 12.0pt; line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; mso-fareast-font-family: &quot;Times New Roman&quot;; color: #0b5394;\">&nbsp;</span></em></strong></p>\r\n<p class=\"MsoNormal\"><strong><em><span style=\"font-size: 12.0pt; line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; mso-fareast-font-family: &quot;Times New Roman&quot;; color: #0b5394;\">My name is Shilvock Dora, I am 59 Years old I am from Texas USA.\r\nLast year I experienced restlessness and sleepless nights so my Doctor in New\r\nYork sent me on a general Medical Checkup at the Methodist hospital and I was\r\nfinally diagnosed to have cancer of the Lungs.</span></em></strong></p>\r\n<p class=\"MsoNormal\"><strong><em><span style=\"font-size: 12.0pt; line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; mso-fareast-font-family: &quot;Times New Roman&quot;; color: #0b5394;\">&nbsp;My late husband&rsquo;s brother\r\nwanted me dead so that he will inherit all my wealth and that of my late\r\nHusband suffered to build because we don\'t have a child. As a Christian I\r\nrather donate my money to the less privilege, orphanage homes and the Church\r\nthan allow wicked people to take all when I die. I like impacting positively on\r\nthe welfare of the less privileged, destitute, the orphans and perhaps, the\r\nelderly requires a great deal of sincerity, love and care&nbsp; and most importantly fear of God, as well as\r\nto a very large extent, patient on the part of the particular individuals\r\nbehind the initiative. Charity organization, also known as non-governmental\r\norganization is inadvertently, a very important result-oriented platform\r\nthrough which the desired and sustainable turning around of the lives of the\r\nneedy in the society can be guaranteed. To a very large extent, it is a\r\nrealistic instrument designed with the aim of rendering certain free services\r\nin the area of education, financial assistance and medical services for\r\ndifferent categories of such individuals so as to give them a sense of\r\nbelonging</span></em></strong></p>\r\n<p class=\"MsoNormal\"><strong><em><span style=\"font-size: 12.0pt; line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; mso-fareast-font-family: &quot;Times New Roman&quot;; color: #0b5394;\">&nbsp;</span></em></strong></p>\r\n<p class=\"MsoNormal\"><strong><em><span style=\"font-size: 12.0pt; line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; mso-fareast-font-family: &quot;Times New Roman&quot;; color: #0b5394;\">Lately I discovered that my late husband&rsquo;s relation know about\r\nthe deposited money and they are happy that I will soon die so that they can\r\ntake the money for their own selfish interest , On this note I decided to give\r\nthis claim information to you before I pass on to glory.</span></em></strong></p>\r\n<p class=\"MsoNormal\"><strong><em><span style=\"font-size: 12.0pt; line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; mso-fareast-font-family: &quot;Times New Roman&quot;; color: #0b5394;\">&nbsp;</span></em></strong></p>\r\n<p class=\"MsoNormal\"><strong><em><span style=\"font-size: 12.0pt; line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; mso-fareast-font-family: &quot;Times New Roman&quot;; color: #0b5394;\">I will furnish you with all the details that will assist you in\r\nclaiming the Funds deposited with the security Company. We deposited the total\r\nof US$5,600.000.00 (Five million Six Hundred Thousand united states dollars) in\r\ncash&nbsp; with the security company in USA.As\r\nsoon as you accept my offer I will direct you to my family Lawyer here in New\r\nYork, who will assist you for&nbsp; the money\r\ntransfer processes into your bank account without any delay .</span></em></strong></p>\r\n<p class=\"MsoNormal\"><strong><em><span style=\"font-size: 12.0pt; line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; mso-fareast-font-family: &quot;Times New Roman&quot;; color: #0b5394;\">&nbsp;</span></em></strong></p>\r\n<p class=\"MsoNormal\"><strong><em><span style=\"font-size: 12.0pt; line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; mso-fareast-font-family: &quot;Times New Roman&quot;; color: #0b5394;\">I need assurance from you that even when I die, you will not use\r\nthe money wrongly and will do your best to have this fund transfer to you from\r\nthe bank in USA. I will die happily if I know you will use my funds in a manner\r\npleasing to humanity and God when you receive the fund. I have to rest now due\r\nto my unusual weakness. Please pray for me and respond urgently to my message\r\nso that I can be able to conclude the inheritance Hand over Authorization\r\nbefore I die.</span></em></strong></p>\r\n<p class=\"MsoNormal\"><strong><em><span style=\"font-size: 12.0pt; line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; mso-fareast-font-family: &quot;Times New Roman&quot;; color: #0b5394;\">&nbsp;</span></em></strong></p>\r\n<p class=\"MsoNormal\"><strong><em><span style=\"font-size: 12.0pt; line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; mso-fareast-font-family: &quot;Times New Roman&quot;; color: #0b5394;\">I anxiously await your response my dear. Please Kindly reply to\r\nmy private email address: </span></em></strong><a href=\"mailto:shilvockdora@gmail.com\"><strong><em><span style=\"font-size: 12.0pt; line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; mso-fareast-font-family: &quot;Times New Roman&quot;;\">shilvockdora@gmail.com</span></em></strong></a><strong><em><span style=\"font-size: 12.0pt; line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; mso-fareast-font-family: &quot;Times New Roman&quot;; color: #0b5394;\"> and send your\r\ndetails,</span></em></strong></p>\r\n<p class=\"MsoNormal\"><strong><em><span style=\"font-size: 12.0pt; line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; mso-fareast-font-family: &quot;Times New Roman&quot;; color: #0b5394;\">Best Regards,</span></em></strong></p>\r\n<p></p>\r\n<p class=\"MsoNormal\"><strong><em><span style=\"font-size: 12.0pt; line-height: 115%; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; mso-fareast-font-family: &quot;Times New Roman&quot;; color: #0b5394;\">Shilvock Dora</span></em></strong></p>','#23 avenue','New York','Ne','10010','','Community Service and Volunteering','','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
