INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (6540,'Clean Water Action MN','<p></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 9.0pt; mso-bidi-font-size: 11.0pt;\">Clean\r\nWater Action works to empower people to take action to protect America\'s\r\nwaters, build healthy communities, and to make democracy work for all of us.</span></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 9.0pt; mso-bidi-font-size: 11.0pt;\">&nbsp;</span></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 9.0pt; mso-bidi-font-size: 11.0pt;\">With\r\nover 1 million members nationwide, Clean Water Action is at the forefront of\r\ngrassroots efforts to protect our nation&rsquo;s environment and public health. Clean\r\nWater Action offices work locally to sustain and improve environmental\r\nstandards, preserve our invaluable natural resources and promote democratic\r\nprocesses in which the voice of the citizens determines the policy that affects\r\nour communities and quality of life. For 45 years Clean Water Action has\r\nsucceeded in winning some of the nation\'s most important environmental\r\nprotections through grassroots organizing, expert policy research and political\r\nadvocacy focused on holding elected officials accountable to the public.</span></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 9.0pt; mso-bidi-font-size: 11.0pt;\">&nbsp;</span></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 9.0pt; mso-bidi-font-size: 11.0pt;\">The\r\nMinnesota state chapter of Clean Water Action was founded with the following\r\ngoals in mind:</span></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 9.0pt; mso-bidi-font-size: 11.0pt;\">-Build\r\nthe strength, cooperation and diversity of the environmental movement in\r\nMinnesota;</span></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 9.0pt; mso-bidi-font-size: 11.0pt;\">-Successfully\r\nlobby at the legislature and government agencies;</span></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 9.0pt; mso-bidi-font-size: 11.0pt;\">-Recruit\r\nand elect strong environmental candidates to public office;</span></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 9.0pt; mso-bidi-font-size: 11.0pt;\">-Provide\r\norganizing and technical assistance, training and information to coalition\r\ngroups.</span></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 9.0pt; mso-bidi-font-size: 11.0pt;\">&nbsp;</span></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 9.0pt; mso-bidi-font-size: 11.0pt;\">Ongoing\r\nCampaigns:</span></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 9.0pt; mso-bidi-font-size: 11.0pt;\">-Clean\r\nand Safe Drinking Water</span></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 9.0pt; mso-bidi-font-size: 11.0pt;\">-Transition\r\nto Safe and Clean Energy</span></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 9.0pt; mso-bidi-font-size: 11.0pt;\">-Rural\r\nCommunities\' Health and Environment</span></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 9.0pt; mso-bidi-font-size: 11.0pt;\">-Environmental\r\nJustice</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 6.75pt; line-height: normal; background: white;\"></p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 9.0pt; mso-bidi-font-size: 11.0pt;\">-Chemical\r\nPolicy Reform</span></p>\r\n<p>&nbsp;</p>','330 2nd Ave S STE 420','Minneapolis','Mi','55401','United States','Energy Conservation and Green Living, Environment and Ecology, Human Rights and Civil Liberties, Politics','http://cleanwateraction.org/','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
