INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (6668,'North East Medical Services (NEMS) ','<p>North East Medical Services (NEMS) is one of the largest community health centers in the United States targeting the medically underserved Asian population. Based in San Francisco, the non-profit community health center offers comprehensive health care services to a variety of patients, a majority of whom are uninsured or low income. NEMS offers linguistically-competent and culturally-sensitive health care services in many languages and dialects, including Cantonese, Mandarin, Toishan, Vietnamese, Burmese, Korean, Spanish, and Hindi.&nbsp;</p>\r\n<p>Our Mission: To provide affordable, comprehensive, compassionate and quality health care services in a linguistically competent and culturually sensitive manner to improve the health and well-being of our community.&nbsp;</p>\r\n<p>&nbsp;</p>','1520 Stockton Street','San Francisco','Ca','94133','United States','Health and Medicine','http://www.nems.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
