INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (6759,'Project Morry','<p class=\"MsoNormal\"><a name=\"_Hlk481134797\"><span style=\"font-size: small;\">Project Morry is a comprehensive, year\r\nround youth development organization dedicated to empowering children from\r\nunder-resourced communities to envision a positive future.&nbsp; Our nine year commitment to each child seeks\r\nto close the opportunity gap through<span style=\"color: #0a0a0a; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> a combination of academic enrichment and support, an exceptional summer camp\r\nexperience, and one-on-one mentoring</span>.&nbsp; </span></a></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: small;\">Project\r\nMorry changes outcomes for students from the tri-state area by improving\r\nopportunities through proven programs: approximately 98% of Project Morry\r\nstudents graduate from high school, 85% attend college and 91% of those who\r\nattend college graduate.&nbsp; In addition to\r\ntheir academic success, Project Morry students exemplify our principles of\r\nteamwork, positive core values, volunteerism, and personal responsibility.&nbsp; They are leaders at school and in their\r\ncommunities.&nbsp;</span></p>\r\n<p class=\"MsoNormal\">&nbsp;</p>','350 Executive Boulevard, Suite 125','Elmsford','Ne','10523','United States','Youth Services','http://www.ProjectMorry.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
