INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (6862,'Move For Hunger','<p><span style=\"color: #444444; font-family: \"><em><strong>Move For Hunger mobilizes the relocation industry to reduce food waste and fight hunger</strong></em></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #444444; font-family: \">As you may be aware, many people throw out a good deal of &ldquo;stuff&rdquo; when they move.&nbsp; Unfortunately, a lot of this &ldquo;stuff&rdquo; is food that could be delivered to a family in need rather than thrown away.&nbsp; That&rsquo;s where we come in &hellip;</span></p>\r\n<p><span style=\"color: #444444; font-family: \">By teaming up with relocation companies across the country, Move For Hunger is creating one of the nation&rsquo;s largest year-round service programs.&nbsp; Our movers offer to pick up the unwanted, non-perishable food items from those who are moving and deliver it to their local food banks.</span></p>','814 Asbury Avenue','Asbury Park','Ne','7712','United States','Poverty and Hunger','http://www.moveforhunger.org/','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
