INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (6928,'Center for the Study of Social Policy','<p>\r\n<p class=\"MsoCommentText\" style=\"margin-bottom: .0001pt;\"><span style=\"font-size: 11.0pt; font-family: &quot;Calibri&quot;,sans-serif; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: &quot;Times New Roman&quot;;\">The\r\nCenter for the Study of Social Policy (CSSP) is a national, nonprofit public\r\npolicy, research and technical assistance organization headquartered in\r\nWashington, DC, with offices in New York City and Los Angeles. CSSP is\r\ncommitted to securing equitable opportunities and optimal outcomes for children\r\nand families. CSSP strives to achieve this by focusing on the families facing\r\nthe most significant barriers &ndash; including families living in poverty and those\r\nwhose lives are affected by discrimination based on race, immigration status,\r\nsexual orientation and gender identity. <strong style=\"mso-bidi-font-weight: normal;\"></strong></span></p>\r\n<p class=\"Default\"><span style=\"font-size: 11.0pt; mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: &quot;Times New Roman&quot;;\">&nbsp;</span></p>\r\n<p class=\"Default\"><span style=\"font-size: 11.0pt; mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: &quot;Times New Roman&quot;;\">CSSP strives to accomplish\r\nits mission by developing and <strong><em>advancing effective public policy</em></strong>;\r\nhelping to <strong><em>transform public systems </em></strong>to be more preventive,\r\nresults-oriented, accountable and caring; and supporting local leaders to <strong><em>create\r\nthe community opportunities, supports, services and environments in which all\r\nchildren and families can thrive</em></strong>. CSSP works in partnership with other\r\nnational organizations, foundations and governmental and community leaders to\r\ntest new ideas and approaches, provide technical assistance, generate new\r\nevidence and support networks of innovators. All of our work reflects a\r\nlong-standing organizational commitment to equity and social justice. </span></p>\r\n</p>','1575 Eye Street, NW, Suite 500','Washington','Di','20005','United States','Children and Youth','http://www.cssp.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
