INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (6950,'Operation Paw Time, Inc','<p>Operation Paw Time, Inc is focused on the rescue and rehoming of abandoned, neglected and abused animals.</p>\r\n<p>Our main mission and purpose is to nurture and rehabilitate the animals in our care, giving them a second chance at a better life.&nbsp;</p>\r\n<p>While our organization is geared toward domestic and feral felines we do rescue, care for, and rehome canines when able.&nbsp;</p>\r\n<p>Our organization is a small local 501(c)3, we are all volunteers and do not pay any employees. We do not qualify for grants or any assistance and rely&nbsp;on public donations to continue our efforts. We are a foster-based rescue, all of our animals live in homes until adopted.</p>\r\n<p>Our organization rescues many older animals that are no longer wanted and have more medical needs than most, we are always in need of assistance with medical costs.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','1001 Olde Creek Trail','Concord','No','28025','United States','Animal Welfare','http://www.opawtime.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
