INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (7174,'Youth Enrichment Services','<p style=\"box-sizing: inherit; margin-top: 0px; margin-bottom: 0px; color: #292b2c; font-family: &quot;Roboto Condensed&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 16px;\">The YES Mission: To challenge &amp; inspire youth with physical and mental activities that foster a life-long respect for self, others, and the environment.<br /><br />Since its founding in 1968, Youth Enrichment Services (YES) has connected more than 100,000 low to moderate income Boston youth to outdoor adventures outside.</p>\r\n<p style=\"box-sizing: inherit; margin-top: 0px; margin-bottom: 0px; color: #292b2c; font-family: &quot;Roboto Condensed&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 16px;\">&nbsp;</p>\r\n<p style=\"box-sizing: inherit; margin-top: 0px; margin-bottom: 0px; color: #292b2c; font-family: &quot;Roboto Condensed&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 16px;\">YES brings youth out of familiar environments to challenges in the mountains, and on the river. Year-round&nbsp;programming includes&nbsp;skiing/snowboarding, rock climbing, mountain biking, and kayaking/paddleboarding. To find out more about the programs at YES, <a href=\"http://www.yeskids.org\" target=\"_blank\">visit the website</a>!</p>','412 Massachusetts Avenue','Boston','Ma','2118','United States','Children and Youth, Sports, Recreation, and Leisure, Youth Services','http://www.yeskids.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
