INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (7192,'The University of Chicago','<p>\r\n<p class=\"MsoNormal\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 12.0pt; font-family: &quot;Century Gothic&quot;,sans-serif;\">About Us</span></strong></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12.0pt; font-family: &quot;Century Gothic&quot;,sans-serif;\">The\r\nUniversity of Chicago is an urban research university that has driven new ways\r\nof thinking since 1890. Our commitment to free and open inquiry draws inspired\r\nscholars to our global campuses, where ideas are born that challenge and change\r\nthe world.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12.0pt; font-family: &quot;Century Gothic&quot;,sans-serif;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12.0pt; font-family: &quot;Century Gothic&quot;,sans-serif;\">We\r\nempower individuals to challenge conventional thinking in pursuit of original\r\nideas. Students in the College develop critical, analytic, and writing skills\r\nin our rigorous, interdisciplinary core curriculum. Through graduate programs,\r\nstudents test their ideas with UChicago scholars, and become the next\r\ngeneration of leaders in academia, industry, nonprofits, and government.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12.0pt; font-family: &quot;Century Gothic&quot;,sans-serif;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12.0pt; font-family: &quot;Century Gothic&quot;,sans-serif;\">To\r\nlearn more about the university, click here </span><a href=\"http://www.uchicago.edu/\"><span style=\"font-size: 12.0pt; font-family: &quot;Century Gothic&quot;,sans-serif;\">http://www.uchicago.edu/</span></a><span style=\"font-size: 12.0pt; font-family: &quot;Century Gothic&quot;,sans-serif;\"> </span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12.0pt; font-family: &quot;Century Gothic&quot;,sans-serif;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 12.0pt; font-family: &quot;Century Gothic&quot;,sans-serif;\">Working at the\r\nUniversity of Chicago</span></strong></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12.0pt; font-family: &quot;Century Gothic&quot;,sans-serif;\">The\r\nUniversity of Chicago is a vibrant community of people dedicated to the pursuit\r\nof excellence in education and research. The second largest private employer in\r\nChicago, the University employs over 20,000 diverse and talented faculty and\r\nstaff who come from all over the world to support the University&rsquo;s mission of\r\ninquiry and academic excellence. To learn more about working at the University\r\nof Chicago, click here: </span><a href=\"https://www.uchicago.edu/jobs/\"><span style=\"font-size: 12.0pt; font-family: &quot;Century Gothic&quot;,sans-serif;\">https://www.uchicago.edu/jobs/</span></a><span style=\"font-size: 12.0pt; font-family: &quot;Century Gothic&quot;,sans-serif;\"> </span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12.0pt; font-family: &quot;Century Gothic&quot;,sans-serif;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12.0pt; font-family: &quot;Century Gothic&quot;,sans-serif;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12.0pt; font-family: &quot;Century Gothic&quot;,sans-serif;\">&nbsp;</span></p>\r\n</p>','5801 South Ellis Avenue','Chicago','Il','60637','United States','Education and Academia','http://5801 South Ellis Avenue','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
