INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (7221,'UnidosUS','<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #515151; font-family: &quot;Open Sans&quot;, OpenSansLight, sans-serif; font-size: 16px; line-height: 27px; letter-spacing: 0.3pt;\">Since 1968, UnidosUS&mdash;formerly known as NCLR&mdash;has remained a trusted, nonpartisan voice for Latinos.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #515151; font-family: &quot;Open Sans&quot;, OpenSansLight, sans-serif; font-size: 16px; line-height: 27px; letter-spacing: 0.3pt;\">We serve the Hispanic community through our research, policy analysis, and state and national advocacy efforts, as well as in our program work in communities nationwide. And we partner with a national network of nearly 300 Affiliates across the country to serve millions of Latinos in the areas of civic engagement, civil rights and immigration, education, workforce and the economy, health, and housing.</p>','1126 16th Street','Washington','Di','20036','United States','Human Rights and Civil Liberties','http://www.unidosus.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
