INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (7412,'Readers 2 Leaders','<h1 id=\"yui_3_17_2_1_1551210253942_382\" style=\"margin: 0px; text-rendering: optimizelegibility; line-height: 1.2em; font-family: &quot;Roboto Slab&quot;; letter-spacing: -1px; font-weight: 300; color: #1d2f32; background-color: #f9fafc; text-align: left; white-space: pre-wrap;\"><span style=\"font-size: x-small;\">Readers 2 Leaders\'&nbsp;mission is to develop and grow the reading skills of underserved Dallas children ages 3-12 so that they succeed in school and graduate prepared to live productive lives.   We are a literacy program that serves West Dallas students.  We recognize that students who don\'t read on grade level by third grade are four times less likely to graduate high school, and we work to help all our students beat those odds.&nbsp; Readers 2 Leaders operates  two After-School Programs, four In-School Programs, our lending library, special events, and parent education programs. </span></h1>','2223 Singleton Blvd., Suite 140','Dallas','Te','75212','United States','Children and Youth, Education and Academia, Teaching','http://www.readers2leaders.org/','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
