INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (7432,'Cool Classics!','<p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 10.0pt; font-family: &quot;Raleway SemiBold&quot;;\">Cool\r\nClassics, Inc. is committed to improving literacy among under-served elementary\r\nschool students, expanding their sense of arts, culture and humanities,\r\ncreating readers and critical thinkers and serving schools that have lost arts\r\nand culture programs and are overwhelmed by demands of test-driven curricula.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 10.0pt; font-family: &quot;Raleway SemiBold&quot;;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><em style=\"mso-bidi-font-style: normal;\"><span style=\"font-size: 10.0pt; font-family: &quot;Raleway SemiBold&quot;;\">Cool Classics!</span></em><span style=\"font-size: 10.0pt; font-family: &quot;Raleway SemiBold&quot;;\"> programs start with\r\nthe literary arts. We use classic books to connect children to a unified world\r\nof reading, art, humanities, culture and ideas. We aim to expand participants&rsquo;\r\nsense of the world, improve their academic and analytical skills while building\r\nlasting communities of our students, their families, teachers and school\r\nadministrators to insure success as they continue their education throughout\r\ntheir lives. </span></p>\r\n</p>','3712 N. Broadway, Suite 558','Chicago','Il','60613','United States','Children and Youth, Teaching','http://coolclassicschicago.org/','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
