INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (7453,'Crossing Bridges','<p style=\"box-sizing: inherit; color: #5e5e5e; font-family: &amp;quot; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: center; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px; margin: 0px;\"><span style=\"box-sizing: inherit;\"><span class=\"x-el x-el-span c1-8h c1-1x c1-36 x-d-ux\" style=\"box-sizing: inherit; font-family: &amp;quot; font-size: unset; font-weight: 700;\">Our Mission Statement</span>:</span></p>\r\n<p style=\"box-sizing: inherit; color: #5e5e5e; font-family: &amp;quot; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: center; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px; margin: 0px;\"><span style=\"box-sizing: inherit;\">To honor, serve and support our Veterans and military families&nbsp;</span></p>\r\n<p style=\"box-sizing: inherit; color: #5e5e5e; font-family: &amp;quot; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: center; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px; margin: 0px;\"><span style=\"box-sizing: inherit;\"><span class=\"x-el x-el-span c1-8h c1-1x c1-36 x-d-ux\" style=\"box-sizing: inherit; font-family: &amp;quot; font-size: unset; font-weight: 700;\">Our Vision</span>: To make a difference in the lives of those who sacrificed their lives and families to make others free.&nbsp;</span></p>\r\n<p style=\"box-sizing: inherit; color: #5e5e5e; font-family: &amp;quot; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: center; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px; margin: 0px;\"><span style=\"box-sizing: inherit;\"><span class=\"x-el x-el-span c1-8h c1-1x c1-36 x-d-ux\" style=\"box-sizing: inherit; font-family: &amp;quot; font-size: unset; font-weight: 700;\">Core Values</span>: &nbsp;These values are an expression of our vision and intent to make a difference in the lives of our military families</span></p>\r\n<p style=\"box-sizing: inherit; color: #5e5e5e; font-family: &amp;quot; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: center; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px; margin: 0px;\"><span style=\"box-sizing: inherit;\"><span class=\"x-el x-el-span c1-8h c1-1x c1-36 x-d-ux\" style=\"box-sizing: inherit; font-family: &amp;quot; font-size: unset; font-weight: 700;\">Excellence</span></span></p>\r\n<p style=\"box-sizing: inherit; color: #5e5e5e; font-family: &amp;quot; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: center; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px; margin: 0px;\"><span style=\"box-sizing: inherit;\">We are accountable to our community, our veterans and each other to deliver the highest quality service through the dedicated effort of every team member.</span></p>\r\n<p style=\"box-sizing: inherit; color: #5e5e5e; font-family: &amp;quot; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: center; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px; margin: 0px;\"><span style=\"box-sizing: inherit;\"><span class=\"x-el x-el-span c1-8h c1-1x c1-36 x-d-ux\" style=\"box-sizing: inherit; font-family: &amp;quot; font-size: unset; font-weight: 700;\">Empowerment</span></span></p>\r\n<p style=\"box-sizing: inherit; color: #5e5e5e; font-family: &amp;quot; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: center; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px; margin: 0px;\"><span style=\"box-sizing: inherit;\">We seek to supply the Inspiration for hope and nurture the wellbeing of the whole person, respecting physical, emotional and spiritual needs.</span></p>\r\n<p style=\"box-sizing: inherit; color: #5e5e5e; font-family: &amp;quot; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: center; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px; margin: 0px;\"><span style=\"box-sizing: inherit;\"><span class=\"x-el x-el-span c1-8h c1-1x c1-36 x-d-ux\" style=\"box-sizing: inherit; font-family: &amp;quot; font-size: unset; font-weight: 700;\">People</span></span></p>\r\n<p style=\"box-sizing: inherit; color: #5e5e5e; font-family: &amp;quot; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: center; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px; margin: 0px;\"><span style=\"box-sizing: inherit;\">We Value our teams, supporters and those we serve as our most important assets and the key to our success and sustainability</span></p>\r\n<p style=\"box-sizing: inherit; color: #5e5e5e; font-family: &amp;quot; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: center; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px; margin: 0px;\"><span style=\"box-sizing: inherit;\"><span class=\"x-el x-el-span c1-8h c1-1x c1-36 x-d-ux\" style=\"box-sizing: inherit; font-family: &amp;quot; font-size: unset; font-weight: 700;\">Integrity</span></span></p>\r\n<p style=\"box-sizing: inherit; color: #5e5e5e; font-family: &amp;quot; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: center; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px; margin: 0px;\"><span style=\"box-sizing: inherit;\">We hold ourselves to the highest standards of honesty, fairness and transparency</span></p>\r\n<p style=\"box-sizing: inherit; color: #5e5e5e; font-family: &amp;quot; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: center; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px; margin: 0px;\"><span style=\"box-sizing: inherit;\"><span class=\"x-el x-el-span c1-8h c1-1x c1-36 x-d-ux\" style=\"box-sizing: inherit; font-family: &amp;quot; font-size: unset; font-weight: 700;\">Compassion</span></span></p>\r\n<p style=\"box-sizing: inherit; color: #5e5e5e; font-family: &amp;quot; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: center; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px; margin: 0px;\"><span style=\"box-sizing: inherit;\">We are driven by our understanding of the importance of independence, choice, and dignity to quality of life.&nbsp;</span></p>\r\n<p style=\"box-sizing: inherit; color: #5e5e5e; font-family: &amp;quot; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: center; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px; margin: 0px;\"><span style=\"box-sizing: inherit;\"><span class=\"x-el x-el-span c1-8h c1-1x c1-36 x-d-ux\" style=\"box-sizing: inherit; font-family: &amp;quot; font-size: unset; font-weight: 700;\">Sustainability</span>&nbsp;</span></p>\r\n<p style=\"box-sizing: inherit; color: #5e5e5e; font-family: &amp;quot; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: center; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px; margin: 0px;\"><span style=\"box-sizing: inherit;\">We seek to be good stewards of resources</span></p>\r\n<p><strong></strong><em></em></p>','3850 Second Ste 150','Wayne','Mi','48184','United States','Veterans Issues','http://www.crossingbridgesmi.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
