INSERT INTO `nonprofits` (`id`, `orgName`, `mission`, `address`, `city`, `state`, `zip`, `country`, `orgFocus`, `url`, `datetime`, `timestamp`, `UserId`) VALUES (7635,'Program Manager','<p>\r\n<p class=\"MsoNormal\"><strong style=\"mso-bidi-font-weight: normal;\">The Asian American\r\nCivic Association</strong> (AACA) provides limited English speaking and economically\r\ndisadvantaged people with education, occupational training and social services\r\nenabling them to realize lasting economic self-sufficiency.</p>\r\n<p class=\"MsoNormal\">AACA has existing job training programs designed to bring\r\nimmigrants and economically challenged individuals to a high enough skill level\r\nquickly to start a career.<span style=\"mso-spacerun: yes;\">&nbsp; </span>AACA is\r\ncurrently expanding the suite of job training program offerings.</p>\r\n<p class=\"MsoNormal\"><strong style=\"mso-bidi-font-weight: normal;\">Position Available: </strong>Program\r\nManager, Sustainability Sector Careers<strong style=\"mso-bidi-font-weight: normal;\"><br /> Reports to:</strong> AACA Executive Director<strong style=\"mso-bidi-font-weight: normal;\"><br /> Hours:</strong> Full-time, 35 hours per week (may require hours outside of 9 to 5 on\r\na regular basis)</p>\r\n<p class=\"MsoNormal\"><strong style=\"mso-bidi-font-weight: normal;\">Position Summary:</strong><br /> The Program Manager will be responsible for administering and managing training\r\nprograms at AACA.<span style=\"mso-spacerun: yes;\">&nbsp; </span>The Manager will be\r\ntasked with ensuring timely filing of certification documentation, reporting to\r\ngrantors, overseeing contractors and instructors, creating and adjusting\r\ncurriculum, keeping records of student progress and data, and scheduling.<span style=\"mso-spacerun: yes;\">&nbsp; </span>In addition, the Manager will be the primary\r\npoint of contact for post-graduation placement, arranging internships with\r\nemployer partners, and maintaining relationship with employer partners.</p>\r\n<p class=\"MsoNormal\"><strong style=\"mso-bidi-font-weight: normal;\">Responsibilities:</strong></p>\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->Collaborate with Student Services Specialists re\r\nintake, screening, assessment, enrollment and retention of students, and provide\r\norientation for newly onboarded students</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->Oversee certifications, such as OSHA 10-Hour\r\nCertificate</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->Set and maintain class and instructor schedules</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->Supervisor contractors, including instructors</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->Recruit new employer partners</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->Nurture existing employer partners</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->Arrange for internships, tours and mock\r\ninterviews with employer partners</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->Assist graduates with job placement</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->Manage grant reporting</p>\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]-->Maintain strong records of student enrollment,\r\nprogress, and outcomes<br style=\"mso-special-character: line-break;\" /> <!--[if !supportLineBreakNewLine]--><br style=\"mso-special-character: line-break;\" /> <!--[endif]--></p>\r\n<p class=\"MsoNormal\"><strong style=\"mso-bidi-font-weight: normal;\">Qualifications and\r\nSkills Needed: </strong>Bachelor&rsquo;s degree required, Master&rsquo;s degree preferred, or\r\ncommensurate experience.<span style=\"mso-spacerun: yes;\">&nbsp; </span>3+ years prior\r\nexperience in trade occupations and/or program management experience preferred.</p>\r\n<p class=\"MsoNormal\"><strong style=\"mso-bidi-font-weight: normal;\">To apply</strong>, send\r\nresume and cover letter to:<br /> HR Department<br /> Asian American Civic Association<br /> 87 Tyler Street, 5<sup>th</sup> Floor<br /> Boston, MA 02111</p>\r\n<p class=\"MsoNormal\">Email: hr@aaca-boston.org</p>\r\n</p>','87 Tyler Street','Boston','Ma','2111','United States','Job Training and Workplace Issues, Multi-Service Community Agency','http://www.aaca-boston.org','2019-11-09 07:54:42','0000-00-00 00:00:00',1);
